t'=>'ಟರ್ಮ್ಗಳ ಪಟ್ಟಿ','Plugin that registered the template.'=>'ಟೆಂಪ್ಲೇಟ್ ಅನ್ನು ನೋಂದಾಯಿಸಿದ ಪ್ಲಗಿನ್.','Limit result set to items assigned one or more given formats.'=>'ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ನೀಡಲಾದ ಫಾರ್ಮ್ಯಾಟ್‌ಗಳನ್ನು ನಿಯೋಜಿಸಲಾದ ಐಟಂಗಳಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಮಿತಿಗೊಳಿಸಿ.','How to interpret the search input.'=>'ಸರ್ಚ್ ಇನ್ ಪುಟ್ ಅನ್ನು ಹೇಗೆ ವ್ಯಾಖ್ಯಾನಿಸುವುದು.','REST API routes must be registered on the %1$s action. Instead route \'%2$s\' with namespace \'%3$s\' was not registered on this action.'=>'REST API ಮಾರ್ಗಗಳನ್ನು %1$s ಕ್ರಿಯೆಯಲ್ಲಿ ನೋಂದಾಯಿಸಬೇಕು. ಬದಲಿಗೆ \'%3$s\' ನೇಮ್‌ಸ್ಪೇಸ್‌ನೊಂದಿಗೆ \'%2$s\' ಮಾರ್ಗವನ್ನು ಈ ಕ್ರಿಯೆಯಲ್ಲಿ ನೋಂದಾಯಿಸಲಾಗಿಲ್ಲ.','Namespace must not start or end with a slash. Instead namespace \'%1$s\' for route \'%2$s\' seems to contain a slash.'=>'ನೇಮ್‌ಸ್ಪೇಸ್ ಸ್ಲ್ಯಾಷ್‌ನೊಂದಿಗೆ ಪ್ರಾರಂಭವಾಗಬಾರದು ಅಥವಾ ಕೊನೆಗೊಳ್ಳಬಾರದು. ಬದಲಿಗೆ \'%2$s\' ಮಾರ್ಗಕ್ಕಾಗಿ \'%1$s\' ನೇಮ್‌ಸ್ಪೇಸ್ ಸ್ಲ್ಯಾಷ್ ಅನ್ನು ಹೊಂದಿರುವಂತೆ ತೋರುತ್ತಿದೆ.','Route must be specified. Instead within the namespace \'%1$s\', there seems to be an empty route \'%2$s\'.'=>'ಮಾರ್ಗವನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸಬೇಕು. ಬದಲಿಗೆ \'%1$s\' ನೇಮ್‌ಸ್ಪೇಸ್‌ನಲ್ಲಿ, ಖಾಲಿ ಮಾರ್ಗ \'%2$s\' ಇರುವಂತೆ ತೋರುತ್ತಿದೆ.','Routes must be namespaced with plugin or theme name and version. Instead there seems to be an empty namespace \'%1$s\' for route \'%2$s\'.'=>'ಮಾರ್ಗಗಳು ಪ್ಲಗಿನ್ ಅಥವಾ ಥೀಮ್ ಹೆಸರು ಮತ್ತು ಆವೃತ್ತಿಯೊಂದಿಗೆ ನೇಮ್ಸ್ಪೇಸ್ ಆಗಿರಬೇಕು. ಬದಲಿಗೆ \'%2$s\' ಮಾರ್ಗಕ್ಕಾಗಿ ಖಾಲಿ ನೇಮ್‌ಸ್ಪೇಸ್ \'%1$s\' ಇರುವಂತಿದೆ.','As an app icon and a browser icon.'=>'ಅಪ್ಲಿಕೇಶನ್ ಐಕಾನ್ ಮತ್ತು ಬ್ರೌಸರ್ ಐಕಾನ್ ಆಗಿ.','nounSite Icon Preview'=>'ಸೈಟ್ ಐಕಾನ್ ಪೂರ್ವವೀಕ್ಷಣೆ','Comments pagination'=>'ಟಿಪ್ಪಣಿಗಳು ಪ್ಯಾಜಿನೇಷನ್','Posts pagination'=>'ಪೋಸ್ಟ್‌ಗಳ ಪುಟ ವಿನ್ಯಾಸ','Translation loading for the %1$s domain was triggered too early. This is usually an indicator for some code in the plugin or theme running too early. Translations should be loaded at the %2$s action or later.'=>'%1$s ಡೊಮೇನ್‌ಗೆ ಅನುವಾದ ಲೋಡ್ ಆಗುವುದನ್ನು ತುಂಬಾ ಮುಂಚೆಯೇ ಟ್ರಿಗರ್ ಮಾಡಲಾಗಿದೆ. ಇದು ಸಾಮಾನ್ಯವಾಗಿ ಪ್ಲಗಿನ್ ಅಥವಾ ಥೀಮ್‌ನಲ್ಲಿ ಕೆಲವು ಕೋಡ್‌ಗೆ ಸೂಚಕವಾಗಿದೆ. ಅನುವಾದಗಳನ್ನು %2$s ಕ್ರಿಯೆಯಲ್ಲಿ ಅಥವಾ ನಂತರದಲ್ಲಿ ಲೋಡ್ ಮಾಡಬೇಕು.','The element can only be read during directive processing.'=>'ನಿರ್ದೇಶನ ಪ್ರಕ್ರಿಯೆಯ ಸಮಯದಲ್ಲಿ ಮಾತ್ರ ಅಂಶವನ್ನು ಓದಬಹುದು.','There has been a critical error on this website. Please check your site admin email inbox for instructions. If you continue to have problems, please try the <a href="%s">support forums</a>.'=>'ಈ ವೆಬ್‌ಸೈಟ್‌ನಲ್ಲಿ ನಿರ್ಣಾಯಕ ದೋಷ ಕಂಡುಬಂದಿದೆ. ಸೂಚನೆಗಳಿಗಾಗಿ ದಯವಿಟ್ಟು ನಿಮ್ಮ ಸೈಟ್ ನಿರ್ವಾಹಕ ಇಮೇಲ್ ಇನ್‌ಬಾಕ್ಸ್ ಅನ್ನು ಪರಿಶೀಲಿಸಿ. ನಿಮಗೆ ಸಮಸ್ಯೆಗಳು ಮುಂದುವರಿದರೆ, ದಯವಿಟ್ಟು <a href="%s">ಬೆಂಬಲ ವೇದಿಕೆಗಳನ್ನು</a> ಪ್ರಯತ್ನಿಸಿ.','Template "%s" is not registered.'=>'"%s" ಟೆಂಪ್ಲೇಟ್ ಅನ್ನು ನೋಂದಾಯಿಸಲಾಗಿಲ್ಲ.','Template "%s" is already registered.'=>'"%s" ಟೆಂಪ್ಲೇಟ್ ಅನ್ನು ಈಗಾಗಲೇ ನೋಂದಾಯಿಸಲಾಗಿದೆ.','Template names must contain a namespace prefix. Example: my-plugin//my-custom-template'=>'ಟೆಂಪ್ಲೇಟ್ ಹೆಸರುಗಳು ನೇಮ್‌ಸ್ಪೇಸ್ ಪೂರ್ವಪ್ರತ್ಯಯವನ್ನು ಹೊಂದಿರಬೇಕು. ಉದಾಹರಣೆ: my-plugin//my-custom-template','Template names must not contain uppercase characters.'=>'ಟೆಂಪ್ಲೇಟ್ ಹೆಸರುಗಳು ದೊಡ್ಡ ಅಕ್ಷರಗಳನ್ನು ಹೊಂದಿರಬಾರದು.','Template names must be strings.'=>'ಟೆಂಪ್ಲೇಟ್ ಹೆಸರುಗಳು ಸ್ಟ್ರಿಂಗ್ ಗಳಾಗಿರಬೇಕು.','The specified manifest file does not exist.'=>'ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ಮ್ಯಾನಿಫೆಸ್ಟ್ ಫೈಲ್ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Block metadata collections can only be registered for a specific plugin. The provided path is neither a core path nor a valid plugin path.'=>'ಬ್ಲಾಕ್ ಮೆಟಾಡೇಟಾ ಸಂಗ್ರಹಗಳನ್ನು ನಿರ್ದಿಷ್ಟ ಪ್ಲಗಿನ್‌ಗಾಗಿ ಮಾತ್ರ ನೋಂದಾಯಿಸಬಹುದು. ಒದಗಿಸಿದ ಮಾರ್ಗವು ಕೋರ್ ಮಾರ್ಗ ಅಥವಾ ಮಾನ್ಯವಾದ ಪ್ಲಗಿನ್ ಮಾರ್ಗವಲ್ಲ.','block titleWidget Group'=>'ವಿಜೆಟ್ ಗುಂಪು','Disable'=>'ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿ‍','Comment status'=>'ಕಾಮೆಂಟ್ ಸ್ಥಿತಿ','Items deleted.'=>'ಐಟಂಗಳನ್ನು ಅಳಿಸಲಾಗಿದೆ.','https://developer.wordpress.org/advanced-administration/wordpress/cookies/#enable-cookies-in-your-browser'=>'https://developer.wordpress.org/advanced-administration/wordpress/cookies/#enable-cookies-in-your-browser','https://developer.wordpress.org/advanced-administration/wordpress/cookies/'=>'https://developer.wordpress.org/advanced-administration/wordpress/cookies/','https://developer.wordpress.org/advanced-administration/wordpress/wp-config/'=>'https://developer.wordpress.org/advanced-administration/wordpress/wp-config/','Custom spacing sizes if defined by the theme.'=>'ಥೀಮ್‌ನಿಂದ ವ್ಯಾಖ್ಯಾನಿಸಿದರೆ ಕಸ್ಟಮ್ ಅಂತರದ ಗಾತ್ರಗಳು.','taxonomy template name%s Archives'=>'%s ಆರ್ಕೈವ್ಸ್','The uri for the theme\'s template directory. If this is a child theme, this refers to the parent theme, otherwise this is the same as the theme\'s stylesheet directory.'=>'ಥೀಮ್‌ನ ಟೆಂಪ್ಲೇಟ್ ಡೈರೆಕ್ಟರಿಗಾಗಿ uri. ಇದು ಮಕ್ಕಳ ಥೀಮ್ ಆಗಿದ್ದರೆ, ಇದು ಪೋಷಕ ಥೀಮ್ ಅನ್ನು ಸೂಚಿಸುತ್ತದೆ, ಇಲ್ಲದಿದ್ದರೆ ಇದು ಥೀಮ್‌ನ ಸ್ಟೈಲ್‌ಶೀಟ್ ಡೈರೆಕ್ಟರಿಯಂತೆಯೇ ಇರುತ್ತದೆ.','The uri for the theme\'s stylesheet directory.'=>'Uri ಥೀಮ್‌ನ ಸ್ಟೈಲ್‌ಶೀಟ್ ಡೈರೆಕ್ಟರಿಗಾಗಿ.','An array of the class names for the post container element.'=>'ಪೋಸ್ಟ್ ಕಂಟೈನರ್ ಅಂಶಕ್ಕಾಗಿ ವರ್ಗದ ಹೆಸರುಗಳ ಒಂದು ಶ್ರೇಣಿ.','Override the default excerpt length.'=>'ಡೀಫಾಲ್ಟ್ ಆಯ್ದ ಭಾಗದ ಉದ್ದವನ್ನು ಅತಿಕ್ರಮಿಸಿ.','The template_lock associated with the post type, or false if none.'=>'ಟೆಂಪ್ಲೇಟ್_ಲಾಕ್ ಪೋಸ್ಟ್ ಪ್ರಕಾರದೊಂದಿಗೆ ಸಂಯೋಜಿತವಾಗಿದೆ, ಅಥವಾ ಯಾವುದೂ ಇಲ್ಲದಿದ್ದರೆ ತಪ್ಪು.','The block template associated with the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರದೊಂದಿಗೆ ಸಂಯೋಜಿತವಾಗಿರುವ ಬ್ಲಾಕ್ ಟೆಂಪ್ಲೇಟ್.','REST API resource link nameJSON'=>'JSON','Template updated.'=>'ಟೆಂಪ್ಲೇಟ್ ನವೀಕರಿಸಲಾಗಿದೆ.','https://developer.wordpress.org/advanced-administration/debug/debug-network/'=>'https://developer.wordpress.org/advanced-administration/debug/debug-network/','https://www.w3.org/WAI/tutorials/images/decision-tree/'=>'https://www.w3.org/WAI/tutorials/images/decision-tree/','Uncaught error executing a derived state callback with path "%1$s" and namespace "%2$s".'=>'"%1$s" ಮಾರ್ಗ ಮತ್ತು ನೇಮ್‌ಸ್ಪೇಸ್ "%2$s" ನೊಂದಿಗೆ ಪಡೆದ ಸ್ಥಿತಿಯ ಕಾಲ್‌ಬ್ಯಾಕ್ ಅನ್ನು ಕಾರ್ಯಗತಗೊಳಿಸುವಲ್ಲಿ ಕಂಡುಬಂದಿಲ್ಲ.','Namespace or reference path cannot be empty. Directive value referenced: %s'=>'ನೇಮ್‌ಸ್ಪೇಸ್ ಅಥವಾ ಉಲ್ಲೇಖ ಮಾರ್ಗವು ಖಾಲಿಯಾಗಿರಬಾರದು. ನಿರ್ದೇಶನ ಮೌಲ್ಯವನ್ನು ಉಲ್ಲೇಖಿಸಲಾಗಿದೆ: %s','Interactivity directives failed to process in "%1$s" due to a missing "%2$s" end tag.'=>'"%2$s" ಅಂತ್ಯ ಟ್ಯಾಗ್ ಕಾಣೆಯಾದ ಕಾರಣ "%1$s" ನಲ್ಲಿ ಸಂವಾದಾತ್ಮಕ ನಿರ್ದೇಶನಗಳನ್ನು ಪ್ರಕ್ರಿಯೆಗೊಳಿಸಲು ವಿಫಲವಾಗಿದೆ.','Interactivity directives were detected on an incompatible %1$s tag when processing "%2$s". These directives will be ignored in the server side render.'=>'"%2$s" ಅನ್ನು ಪ್ರಕ್ರಿಯೆಗೊಳಿಸುವಾಗ ಹೊಂದಾಣಿಕೆಯಾಗದ %1$s ಟ್ಯಾಗ್‌ನಲ್ಲಿ ಸಂವಾದಾತ್ಮಕ ನಿರ್ದೇಶನಗಳನ್ನು ಪತ್ತೆಹಚ್ಚಲಾಗಿದೆ. ಈ ನಿರ್ದೇಶನಗಳನ್ನು ಸರ್ವರ್ ಸೈಡ್ ರೆಂಡರ್‌ನಲ್ಲಿ ನಿರ್ಲಕ್ಷಿಸಲಾಗುತ್ತದೆ.','The context can only be read during directive processing.'=>'ನಿರ್ದೇಶನ ಪ್ರಕ್ರಿಯೆಯ ಸಮಯದಲ್ಲಿ ಮಾತ್ರ ಸಂದರ್ಭವನ್ನು ಓದಬಹುದು.','The namespace can only be omitted during directive processing.'=>'ಡೈರೆಕ್ಟಿವ್ ಪ್ರೊಸೆಸಿಂಗ್ ಸಮಯದಲ್ಲಿ ಮಾತ್ರ ನೇಮ್‌ಸ್ಪೇಸ್ ಅನ್ನು ಬಿಟ್ಟುಬಿಡಬಹುದು.','The namespace should be a non-empty string.'=>'ನೇಮ್‌ಸ್ಪೇಸ್ ಖಾಲಿ ಅಲ್ಲದ ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','The namespace is required when state data is passed.'=>'ಸ್ಟೇಟ್ ಡೇಟಾವನ್ನು ರವಾನಿಸಿದಾಗ ನೇಮ್‌ಸ್ಪೇಸ್ ಅಗತ್ಯವಿದೆ.','Interactivity directives were detected inside an incompatible %1$s tag. These directives will be ignored in the server side render.'=>'ಹೊಂದಾಣಿಕೆಯಾಗದ %1$s ಟ್ಯಾಗ್‌ನಲ್ಲಿ ಸಂವಾದಾತ್ಮಕ ನಿರ್ದೇಶನಗಳನ್ನು ಪತ್ತೆಹಚ್ಚಲಾಗಿದೆ. ಈ ನಿರ್ದೇಶನಗಳನ್ನು ಸರ್ವರ್ ಸೈಡ್ ರೆಂಡರ್‌ನಲ್ಲಿ ನಿರ್ಲಕ್ಷಿಸಲಾಗುತ್ತದೆ.','https://developer.wordpress.org/advanced-administration/security/https/'=>'https://developer.wordpress.org/advanced-administration/security/https/','https://developer.wordpress.org/advanced-administration/debug/debug-wordpress/'=>'https://developer.wordpress.org/advanced-administration/debug/debug-wordpress/','oEmbed resource link nameoEmbed (XML)'=>'oEmbed (XML)','oEmbed resource link nameoEmbed (JSON)'=>'oEmbed (JSON)','Categories dropdown (show_option_none parameter)None'=>'ಯಾವುದೂ ಇಲ್ಲ','Search themes'=>'ಥೀಮ್‌ಗಳನ್ನು ಹುಡುಕಿ','Edit %1$s (%2$s, sub-item %3$d of %4$d under %5$s, level %6$s)'=>'%1$s ಎಡಿಟ್ ಮಾಡಿ (%2$s, %5$s ಅಡಿಯಲ್ಲಿ %4$d ನ ಉಪ-ಐಟಂ %3$d, ಹಂತ %6$s)','Loaded version \'%1$s\' incompatible with expected version \'%2$s\'.'=>'ಲೋಡ್ ಮಾಡಲಾದ ಆವೃತ್ತಿ \'%1$s\' ನಿರೀಕ್ಷಿತ ಆವೃತ್ತಿ \'%2$s\' ನೊಂದಿಗೆ ಹೊಂದಿಕೆಯಾಗುವುದಿಲ್ಲ.','Missing required inputs to pre-computed WP_Token_Map.'=>'ಪೂರ್ವ-ಕಂಪ್ಯೂಟೆಡ್ WP_Token_Map ಗೆ ಅಗತ್ಯವಿರುವ ಇನ್‌ಪುಟ್‌ಗಳು ಕಾಣೆಯಾಗಿದೆ.','Token Map tokens and substitutions must all be shorter than %1$d bytes.'=>'ಟೋಕನ್ ಮ್ಯಾಪ್ ಟೋಕನ್‌ಗಳು ಮತ್ತು ಪರ್ಯಾಯಗಳು ಎಲ್ಲಾ %1$d ಬೈಟ್‌ಗಳಿಗಿಂತ ಚಿಕ್ಕದಾಗಿರಬೇಕು.','The %1$s filter must return an integer value greater than 0.'=>'%1$s ಫಿಲ್ಟರ್ 0 ಕ್ಕಿಂತ ಹೆಚ್ಚಿನ ಪೂರ್ಣಾಂಕ ಮೌಲ್ಯವನ್ನು ಹಿಂತಿರುಗಿಸಬೇಕು.','Edit %1$s (%2$s, sub-item %3$d of %4$d under %5$s, level %6$d)'=>'%1$s ಎಡಿಟ್ ಮಾಡಿ (%2$s, %5$s ಅಡಿಯಲ್ಲಿ %4$d ನ ಉಪ-ಐಟಂ %3$d, ಹಂತ %6$d)','Edit %1$s (%2$s, sub-item %3$d of %4$d under %5$s)'=>'%1$s ಎಡಿಟ್ ಮಾಡಿ (%2$s, %5$s ಅಡಿಯಲ್ಲಿ %4$d ನ %3$d ಉಪ-ಐಟಂ)','Edit %1$s (%2$s, %3$d of %4$d)'=>'%1$s ಎಡಿಟ್ ಮಾಡಿ (%2$s, %4$d ರಲ್ಲಿ %3$d)','https://developer.wordpress.org/advanced-administration/wordpress/css/'=>'https://developer.wordpress.org/advanced-administration/wordpress/css/','Block name must be a string or array.'=>'ಬ್ಲಾಕ್ ಹೆಸರು ಸ್ಟ್ರಿಂಗ್ ಅಥವಾ ಅರೇ ಆಗಿರಬೇಕು.','… <a class="wp-block-latest-posts__read-more" href="%1$s" rel="noopener noreferrer">Read more<span class="screen-reader-text">: %2$s</span></a>'=>'… <a class="wp-block-latest-posts__read-more" href="%1$s" rel="noopener noreferrer">ಇನ್ನಷ್ಟು ಓದಿ<span class="screen-reader-text">: %2$s</span></a>','`boolean` type for second argument `$settings` is deprecated. Use `array()` instead.'=>'ಎರಡನೇ ಆರ್ಗ್ಯುಮೆಂಟ್ `$settings` ಗಾಗಿ `ಬೂಲಿಯನ್` ಪ್ರಕಾರವನ್ನು ಅಸಮ್ಮತಿಸಲಾಗಿದೆ. ಬದಲಿಗೆ `array()` ಬಳಸಿ.','Use as a `pre_render_block` filter is deprecated. Use with `render_block_data` instead.'=>'`pre_render_block` ಫಿಲ್ಟರ್ ಆಗಿ ಬಳಕೆಯನ್ನು ಅಸಮ್ಮತಿಸಲಾಗಿದೆ. ಬದಲಿಗೆ `render_block_data` ಜೊತೆಗೆ ಬಳಸಿ.','block descriptionDisplay footnotes added to the page.'=>'ಪುಟಕ್ಕೆ ಸೇರಿಸಲಾದ ಫುಟ್ ನೋಟ್ಸ್ ಪ್ರದರ್ಶಿಸಿ.','block descriptionReuse this design across your site.'=>'ನಿಮ್ಮ ಸೈಟ್‌ನಾದ್ಯಂತ ಈ ವಿನ್ಯಾಸವನ್ನು ಮರುಬಳಕೆ ಮಾಡಿ.','Value'=>'ಮೌಲ್ಯ','Invalid term name.'=>'ಅಮಾನ್ಯ ಪದದ ಹೆಸರು.','View Pattern Category'=>'ಪ್ಯಾಟರ್ನ್ ವರ್ಗವನ್ನು ವೀಕ್ಷಿಸಿ','Update Pattern Category'=>'ಪ್ಯಾಟರ್ನ್ ವರ್ಗವನ್ನು ನವೀಕರಿಸಿ','Search Pattern Categories'=>'ಪ್ಯಾಟರ್ನ್ ವರ್ಗಗಳನ್ನು ಹುಡುಕಿ','Popular Pattern Categories'=>'ಜನಪ್ರಿಯ ಪ್ಯಾಟರ್ನ್ ವರ್ಗಗಳು','No pattern categories found.'=>'ಯಾವುದೇ ಮಾದರಿ ವರ್ಗಗಳು ಕಂಡುಬಂದಿಲ್ಲ.','No pattern categories'=>'ಮಾದರಿ ವರ್ಗಗಳಿಲ್ಲ','New Pattern Category Name'=>'ಹೊಸ ಮಾದರಿಯ ವರ್ಗದ ಹೆಸರು','Pattern Categories list navigation'=>'ಪ್ಯಾಟರ್ನ್ ವರ್ಗಗಳ ಪಟ್ಟಿ ಸಂಚರಣೆ','Pattern Categories list'=>'ಪ್ಯಾಟರ್ನ್ ವರ್ಗಗಳ ಪಟ್ಟಿ','A link to a pattern category.'=>'ಮಾದರಿ ವರ್ಗಕ್ಕೆ ಲಿಂಕ್.','Pattern Category Link'=>'ಪ್ಯಾಟರ್ನ್ ವರ್ಗ ಲಿಂಕ್','Edit Pattern Category'=>'ಪ್ಯಾಟರ್ನ್ ವರ್ಗವನ್ನು ಸಂಪಾದಿಸಿ','Choose from the most used pattern categories'=>'ಹೆಚ್ಚು ಬಳಸಿದ ಮಾದರಿ ವಿಭಾಗಗಳಿಂದ ಆಯ್ಕೆಮಾಡಿ','&larr; Go to Pattern Categories'=>'&larr; ಪ್ಯಾಟರ್ನ್ ವರ್ಗಗಳಿಗೆ ಹೋಗಿ','Add or remove pattern categories'=>'ಮಾದರಿ ವರ್ಗಗಳನ್ನು ಸೇರಿಸಿ ಅಥವಾ ತೆಗೆದುಹಾಕಿ','Function %s used incorrectly in PHP.'=>'PHP ಯಲ್ಲಿ %s ಕಾರ್ಯವನ್ನು ತಪ್ಪಾಗಿ ಬಳಸಲಾಗಿದೆ.','Where the template originally comes from e.g. \'theme\''=>'ಟೆಂಪ್ಲೇಟ್ ಮೂಲತಃ ಎಲ್ಲಿಂದ ಬರುತ್ತದೆ ಉದಾ. \'ಥೀಮ್\'','Human readable text for the author.'=>'ಲೇಖಕರಿಗೆ ಮಾನವ ಓದಬಹುದಾದ ಪಠ್ಯ.','Unknown author'=>'ಅಜ್ಞಾತ ಲೇಖಕ','The revision does not belong to the specified parent with id of "%d"'=>'ಪರಿಷ್ಕರಣೆಯು "%d" ಐಡಿಯೊಂದಿಗೆ ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ಪೋಷಕರಿಗೆ ಸೇರಿಲ್ಲ','Unique identifier for the global styles revision.'=>'ಜಾಗತಿಕ ಶೈಲಿಗಳ ಪರಿಷ್ಕರಣೆಗಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','The ID for the parent of the global styles revision.'=>'ಜಾಗತಿಕ ಶೈಲಿಗಳ ಪರಿಷ್ಕರಣೆಯ ಪೋಷಕರ ID.','font-family declaration in theme.json format, encoded as a string.'=>'theme.json ಸ್ವರೂಪದಲ್ಲಿ ಫಾಂಟ್-ಕುಟುಂಬ ಘೋಷಣೆ, ಸ್ಟ್ರಿಂಗ್ ಆಗಿ ಎನ್ಕೋಡ್ ಮಾಡಲಾಗಿದೆ.','URL to a preview image of the font family.'=>'ಫಾಂಟ್ ಕುಟುಂಬದ ಪೂರ್ವವೀಕ್ಷಣೆ ಚಿತ್ರಕ್ಕೆ URL.','Kebab-case unique identifier for the font family preset.'=>'ಫಾಂಟ್ ಫ್ಯಾಮಿಲಿ ಪ್ರಿಸೆಟ್‌ಗಾಗಿ ಕೆಬಾಬ್-ಕೇಸ್ ಅನನ್ಯ ಗುರುತಿಸುವಿಕೆ.','Name of the font family preset, translatable.'=>'ಫಾಂಟ್ ಫ್ಯಾಮಿಲಿ ಪೂರ್ವನಿಗದಿಯ ಹೆಸರು, ಅನುವಾದಿಸಬಹುದು.','font-face definition in theme.json format.'=>'theme.json ಸ್ವರೂಪದಲ್ಲಿ ಫಾಂಟ್-ಫೇಸ್ ವ್ಯಾಖ್ಯಾನ.','The IDs of the child font faces in the font family.'=>'ಫಾಂಟ್ ಕುಟುಂಬದಲ್ಲಿ ಚೈಲ್ಡ್ ಫಾಂಟ್ ಮುಖಗಳ ಐಡಿಗಳು.','A font family with slug "%s" already exists.'=>'ಸ್ಲಗ್ "%s" ನೊಂದಿಗೆ ಫಾಂಟ್ ಕುಟುಂಬವು ಈಗಾಗಲೇ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ.','%s cannot be updated.'=>'%s ಅನ್ನು ನವೀಕರಿಸಲಾಗುವುದಿಲ್ಲ.','%s parameter must be a valid JSON string.'=>'%s ಪ್ಯಾರಾಮೀಟರ್ ಮಾನ್ಯವಾದ JSON ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','Sorry, you are not allowed to access this font family.'=>'ಕ್ಷಮಿಸಿ, ಈ ಫಾಂಟ್ ಕುಟುಂಬವನ್ನು ಪ್ರವೇಶಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','Sorry, you are not allowed to access font families.'=>'ಕ್ಷಮಿಸಿ, ಫಾಂಟ್ ಕುಟುಂಬಗಳನ್ನು ಪ್ರವೇಶಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','font-face declaration in theme.json format, encoded as a string.'=>'theme.json ಫಾರ್ಮ್ಯಾಟ್‌ನಲ್ಲಿ ಫಾಂಟ್-ಫೇಸ್ ಘೋಷಣೆ, ಸ್ಟ್ರಿಂಗ್‌ನಂತೆ ಎನ್‌ಕೋಡ್ ಮಾಡಲಾಗಿದೆ.','URL to a preview image of the font face.'=>'ಫಾಂಟ್ ಮುಖದ ಪೂರ್ವವೀಕ್ಷಣೆ ಚಿತ್ರಕ್ಕೆ URL.','CSS unicode-range value.'=>'CSS ಯುನಿಕೋಡ್-ಶ್ರೇಣಿಯ ಮೌಲ್ಯ.','CSS size-adjust value.'=>'CSS ಗಾತ್ರ-ಹೊಂದಾಣಿಕೆ ಮೌಲ್ಯ.','CSS line-gap-override value.'=>'CSS ಲೈನ್-ಗ್ಯಾಪ್-ಓವರ್‌ರೈಡ್ ಮೌಲ್ಯ.','CSS font-variation-settings value.'=>'CSS ಫಾಂಟ್-ವ್ಯತ್ಯಯ-ಸೆಟ್ಟಿಂಗ್‌ಗಳ ಮೌಲ್ಯ.','CSS font-feature-settings value.'=>'CSS ಫಾಂಟ್-ಫೀಚರ್-ಸೆಟ್ಟಿಂಗ್‌ಗಳ ಮೌಲ್ಯ.','CSS font-variant value.'=>'CSS ಫಾಂಟ್-ವೇರಿಯಂಟ್ ಮೌಲ್ಯ.','CSS descent-override value.'=>'CSS ಅವರೋಹಣ-ಅತಿಕ್ರಮಣ ಮೌಲ್ಯ.','CSS ascent-override value.'=>'CSS ಆರೋಹಣ-ಅತಿಕ್ರಮಣ ಮೌಲ್ಯ.','CSS font-stretch value.'=>'CSS ಫಾಂಟ್-ಸ್ಟ್ರೆಚ್ ಮೌಲ್ಯ.','Paths or URLs to the font files.'=>'ಫಾಂಟ್ ಫೈಲ್‌ಗಳಿಗೆ ಮಾರ್ಗಗಳು ಅಥವಾ URL ಗಳು.','CSS font-display value.'=>'CSS ಫಾಂಟ್-ಡಿಸ್ಪ್ಲೇ ಮೌಲ್ಯ.','List of available font weights, separated by a space.'=>'ಲಭ್ಯವಿರುವ ಫಾಂಟ್ ತೂಕಗಳ ಪಟ್ಟಿ, ಸ್ಪೇಸ್‌ನಿಂದ ಬೇರ್ಪಡಿಸಲಾಗಿದೆ.','CSS font-style value.'=>'CSS ಫಾಂಟ್ ಶೈಲಿಯ ಮೌಲ್ಯ.','CSS font-family value.'=>'CSS ಫಾಂಟ್-ಕುಟುಂಬ ಮೌಲ್ಯ.','font-face declaration in theme.json format.'=>'theme.json ಫಾರ್ಮ್ಯಾಟ್‌ನಲ್ಲಿ ಫಾಂಟ್-ಫೇಸ್ ಘೋಷಣೆ.','Version of the theme.json schema used for the typography settings.'=>'ಟೈಪೋಗ್ರಫಿ ಸೆಟ್ಟಿಂಗ್‌ಗಳಿಗಾಗಿ ಬಳಸಲಾದ theme.json ಸ್ಕೀಮಾದ ಆವೃತ್ತಿ.','Font faces do not support trashing. Set "%s" to delete.'=>'ಫಾಂಟ್ ಮುಖಗಳು ಅನುಪಯುಕ್ತವನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ. ಅಳಿಸಲು "%s" ಅನ್ನು ಹೊಂದಿಸಿ.','A font face matching those settings already exists.'=>'ಆ ಸೆಟ್ಟಿಂಗ್‌ಗಳಿಗೆ ಹೊಂದಿಕೆಯಾಗುವ ಫಾಂಟ್ ಮುಖವು ಈಗಾಗಲೇ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ.','The font face does not belong to the specified font family with id of "%d".'=>'ಫಾಂಟ್ ಮುಖವು "%d" ನ ಐಡಿಯೊಂದಿಗೆ ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ಫಾಂಟ್ ಕುಟುಂಬಕ್ಕೆ ಸೇರಿಲ್ಲ.','File %1$s must be used in %2$s.'=>'%1$s ಫೈಲ್ ಅನ್ನು %2$s ನಲ್ಲಿ ಬಳಸಬೇಕು.','%1$s value "%2$s" must be a valid URL or file reference.'=>'%1$s ಮೌಲ್ಯವು "%2$s" ಮಾನ್ಯವಾದ URL ಅಥವಾ ಫೈಲ್ ಉಲ್ಲೇಖವಾಗಿರಬೇಕು.','%s values must be non-empty strings.'=>'%s ಮೌಲ್ಯಗಳು ಖಾಲಿ ಅಲ್ಲದ ಸ್ಟ್ರಿಂಗ್‌ಗಳಾಗಿರಬೇಕು.','%s cannot be empty.'=>'%s ಖಾಲಿ ಇರುವಂತಿಲ್ಲ.','font_face_settings parameter must be a valid JSON string.'=>'font_face_settings ಪ್ಯಾರಾಮೀಟರ್ ಮಾನ್ಯವಾದ JSON ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','Sorry, you are not allowed to access this font face.'=>'ಕ್ಷಮಿಸಿ, ಈ ಫಾಂಟ್ ಫೇಸ್ ಅನ್ನು ಪ್ರವೇಶಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','Sorry, you are not allowed to access font faces.'=>'ಕ್ಷಮಿಸಿ, ಫಾಂಟ್ ಮುಖಗಳನ್ನು ಪ್ರವೇಶಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','Unique identifier for the font face.'=>'ಫಾಂಟ್ ಮುಖಕ್ಕಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','The ID for the parent font family of the font face.'=>'ಫಾಂಟ್ ಮುಖದ ಮೂಲ ಫಾಂಟ್ ಕುಟುಂಬಕ್ಕೆ ID.','Sorry, you are not allowed to access font collections.'=>'ಕ್ಷಮಿಸಿ, ಫಾಂಟ್ ಸಂಗ್ರಹಣೆಗಳನ್ನು ಪ್ರವೇಶಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','The categories for the font collection.'=>'ಫಾಂಟ್ ಸಂಗ್ರಹಕ್ಕಾಗಿ ವಿಭಾಗಗಳು.','The font families for the font collection.'=>'ಫಾಂಟ್ ಸಂಗ್ರಹಕ್ಕಾಗಿ ಫಾಂಟ್ ಕುಟುಂಬಗಳು.','The description for the font collection.'=>'ಫಾಂಟ್ ಸಂಗ್ರಹದ ವಿವರಣೆ.','The name for the font collection.'=>'ಫಾಂಟ್ ಸಂಗ್ರಹಕ್ಕೆ ಹೆಸರು.','Unique identifier for the font collection.'=>'ಫಾಂಟ್ ಸಂಗ್ರಹಕ್ಕಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','Font collection not found.'=>'ಫಾಂಟ್ ಸಂಗ್ರಹ ಕಂಡುಬಂದಿಲ್ಲ.','Allowed child block types.'=>'ಅನುಮತಿಸಲಾದ ಚೈಲ್ಡ್ ಬ್ಲಾಕ್ ಪ್ರಕಾರಗಳು.','Public facing script module IDs.'=>'ಸಾರ್ವಜನಿಕ ಎದುರಿಸುತ್ತಿರುವ ಸ್ಕ್ರಿಪ್ಟ್ ಮಾಡ್ಯೂಲ್ ಐಡಿಗಳು.','This site does not support post thumbnails on attachments with MIME type %s.'=>'MIME ಪ್ರಕಾರ %s ನೊಂದಿಗೆ ಲಗತ್ತುಗಳ ಪೋಸ್ಟ್ ಥಂಬ್‌ನೇಲ್‌ಗಳನ್ನು ಈ ಸೈಟ್ ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','Font Face'=>'ಫಾಂಟ್ ಮುಖ','Font Faces'=>'ಫಾಂಟ್ ಮುಖಗಳು','Font Families'=>'ಫಾಂಟ್ ಕುಟುಂಬಗಳು','Font collection "%s" not found.'=>'ಫಾಂಟ್ ಸಂಗ್ರಹ "%s" ಕಂಡುಬಂದಿಲ್ಲ.','Font collection with slug: "%s" is already registered.'=>'ಸ್ಲಗ್‌ನೊಂದಿಗೆ ಫಾಂಟ್ ಸಂಗ್ರಹಣೆ: "%s" ಈಗಾಗಲೇ ನೋಂದಾಯಿಸಲಾಗಿದೆ.','Font collection "%1$s" has missing or empty property: "%2$s".'=>'ಫಾಂಟ್ ಸಂಗ್ರಹ "%1$s" ಕಾಣೆಯಾಗಿದೆ ಅಥವಾ ಖಾಲಿ ಪ್ರಾಪರ್ಟಿಯನ್ನು ಹೊಂದಿದೆ: "%2$s".','Error decoding the font collection data from the HTTP response JSON.'=>'HTTP ಪ್ರತಿಕ್ರಿಯೆ JSON ನಿಂದ ಫಾಂಟ್ ಸಂಗ್ರಹ ಡೇಟಾವನ್ನು ಡಿಕೋಡಿಂಗ್ ಮಾಡುವಲ್ಲಿ ದೋಷ.','Error fetching the font collection data from "%s".'=>'"%s" ನಿಂದ ಫಾಂಟ್ ಸಂಗ್ರಹ ಡೇಟಾವನ್ನು ಪಡೆಯುವಲ್ಲಿ ದೋಷ.','Error decoding the font collection JSON file contents.'=>'ಫಾಂಟ್ ಸಂಗ್ರಹ JSON ಫೈಲ್ ವಿಷಯಗಳ ಡಿಕೋಡಿಂಗ್ ದೋಷ.','Font collection JSON file is invalid or does not exist.'=>'ಫಾಂಟ್ ಸಂಗ್ರಹ JSON ಫೈಲ್ ಅಮಾನ್ಯವಾಗಿದೆ ಅಥವಾ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Font collection slug "%s" is not valid. Slugs must use only alphanumeric characters, dashes, and underscores.'=>'ಫಾಂಟ್ ಸಂಗ್ರಹಣೆ ಸ್ಲಗ್ "%s" ಮಾನ್ಯವಾಗಿಲ್ಲ. ಗೊಂಡೆಹುಳುಗಳು ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಅಕ್ಷರಗಳು, ಡ್ಯಾಶ್‌ಗಳು ಮತ್ತು ಅಂಡರ್‌ಸ್ಕೋರ್‌ಗಳನ್ನು ಮಾತ್ರ ಬಳಸಬೇಕು.','font categoryMonospace'=>'ಮಾನೋಸ್ಪೇಸ್','font categoryHandwriting'=>'ಕೈಬರಹ','font categorySerif'=>'ಸೆರಿಫ್','font categoryDisplay'=>'ಪ್ರದರ್ಶನ','font categorySans Serif'=>'ಸಾನ್ಸ್ ಸೆರಿಫ್','Install from Google Fonts. Fonts are copied to and served from your site.'=>'Google ಫಾಂಟ್‌ಗಳಿಂದ ಸ್ಥಾಪಿಸಿ. ಫಾಂಟ್‌ಗಳನ್ನು ನಿಮ್ಮ ಸೈಟ್‌ಗೆ ನಕಲಿಸಲಾಗುತ್ತದೆ ಮತ್ತು ಸೇವೆ ಸಲ್ಲಿಸಲಾಗುತ್ತದೆ.','font collection nameGoogle Fonts'=>'ಗೂಗಲ್ ಫಾಂಟ್‌ಗಳು','App icon preview: The current image has no alternative text. The file name is: %s'=>'ಅಪ್ಲಿಕೇಶನ್ ಐಕಾನ್ ಪೂರ್ವವೀಕ್ಷಣೆ: ಪ್ರಸ್ತುತ ಚಿತ್ರವು ಯಾವುದೇ ಪರ್ಯಾಯ ಪಠ್ಯವನ್ನು ಹೊಂದಿಲ್ಲ. ಫೈಲ್ ಹೆಸರು: %s','App icon preview: Current image: %s'=>'ಅಪ್ಲಿಕೇಶನ್ ಐಕಾನ್ ಪೂರ್ವವೀಕ್ಷಣೆ: ಪ್ರಸ್ತುತ ಚಿತ್ರ: %s','Browser icon preview: The current image has no alternative text. The file name is: %s'=>'ಬ್ರೌಸರ್ ಐಕಾನ್ ಪೂರ್ವವೀಕ್ಷಣೆ: ಪ್ರಸ್ತುತ ಚಿತ್ರವು ಯಾವುದೇ ಪರ್ಯಾಯ ಪಠ್ಯವನ್ನು ಹೊಂದಿಲ್ಲ. ಫೈಲ್ ಹೆಸರು: %s','Browser icon preview: Current image: %s'=>'ಬ್ರೌಸರ್ ಐಕಾನ್ ಮುನ್ನೋಟ: ಪ್ರಸ್ತುತ ಚಿತ್ರ: %s','sub item'=>'ಉಪ ವಸ್ತು','Some of the %1$s %2$s values are invalid'=>'ಕೆಲವು %1$s %2$s ಮೌಲ್ಯಗಳು ಅಮಾನ್ಯವಾಗಿವೆ','Entries in dependencies array must be either strings or arrays with an id key.'=>'ಅವಲಂಬನೆಗಳ ರಚನೆಯಲ್ಲಿನ ನಮೂದುಗಳು ಐಡಿ ಕೀಲಿಯೊಂದಿಗೆ ಸ್ಟ್ರಿಂಗ್‌ಗಳು ಅಥವಾ ಸರಣಿಗಳಾಗಿರಬೇಕು.','Missing required id key in entry among dependencies array.'=>'ಅವಲಂಬನೆಗಳ ರಚನೆಯ ನಡುವಿನ ಪ್ರವೇಶದಲ್ಲಿ ಅಗತ್ಯವಿರುವ ಐಡಿ ಕೀಯನ್ನು ಕಳೆದುಕೊಂಡಿದೆ.','All required plugins are installed and activated.'=>'ಅಗತ್ಯವಿರುವ ಎಲ್ಲಾ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಸ್ಥಾಪಿಸಲಾಗಿದೆ ಮತ್ತು ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','The following plugins must be activated first: %s.'=>'ಕೆಳಗಿನ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಮೊದಲು ಸಕ್ರಿಯಗೊಳಿಸಬೇಕು: %s.','The plugin has no required plugins.'=>'ಪ್ಲಗಿನ್ ಗೆ ಅಗತ್ಯವಿರುವ ಪ್ಲಗಿನ್ ಗಳಿಲ್ಲ.','The plugin is not installed.'=>'ಪ್ಲಗಿನ್ ಅನ್ನು ಸ್ಥಾಪಿಸಲಾಗಿಲ್ಲ.','No plugin specified.'=>'ಯಾವುದೇ ಪ್ಲಗಿನ್ ಅನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸಲಾಗಿಲ್ಲ.','Please contact the plugin authors for more information.'=>'ಹೆಚ್ಚಿನ ಮಾಹಿತಿಗಾಗಿ ದಯವಿಟ್ಟು ಪ್ಲಗಿನ್ ಲೇಖಕರನ್ನು ಸಂಪರ್ಕಿಸಿ.','These plugins cannot be activated because their requirements are invalid.'=>'ಈ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ ಏಕೆಂದರೆ ಅವುಗಳ ಅವಶ್ಯಕತೆಗಳು ಅಮಾನ್ಯವಾಗಿದೆ.','The first plugin requires the second plugin.%1$s requires %2$s'=>'%1$s ಗೆ %2$s ಅಗತ್ಯವಿದೆ','Please contact your network administrator.'=>'ದಯವಿಟ್ಟು ನಿಮ್ಮ ನೆಟ್‌ವರ್ಕ್ ನಿರ್ವಾಹಕರನ್ನು ಸಂಪರ್ಕಿಸಿ.','<a href="%s">Manage plugins</a>.'=>'<a href="%s">ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಿ</a>.','Some required plugins are missing or inactive.'=>'ಅಗತ್ಯವಿರುವ ಕೆಲವು ಪ್ಲಗಿನ್‌ಗಳು ಕಾಣೆಯಾಗಿವೆ ಅಥವಾ ನಿಷ್ಕ್ರಿಯವಾಗಿವೆ.','"%1$s" in %2$s %3$s is not a hex or rgb string.'=>'%2$s %3$s ನಲ್ಲಿ "%1$s" hex ಅಥವಾ rgb ಸ್ಟ್ರಿಂಗ್ ಅಲ್ಲ.','The Site Icon is what you see in browser tabs, bookmark bars, and within the WordPress mobile apps. It should be square and at least <code>%1$s 