ಆರ್ಕೈವ್ಸ್','Template nameAll Archives'=>'ಎಲ್ಲಾ ಆರ್ಕೈವ್ಗಳು','Template nameSingle Entries'=>'ಏಕ ನಮೂದುಗಳು','Template nameBlog Home'=>'ಬ್ಲಾಗ್ ಮನೆ','template part areaFooter'=>'ಅಡಿಟಿಪ್ಪಣಿ','template part areaHeader'=>'ಶೀರ್ಷಿಕೆ','template part areaGeneral'=>'ಸಾಮಾನ್ಯ','block categoryPatterns'=>'ಮಾದರಿಗಳು','custom image headerHeader'=>'ಶೀರ್ಷಿಕೆ','custom backgroundBackground'=>'ಹಿನ್ನೆಲೆ','Get Involved'=>'ತೊಡಗಿಸಿಕೊಳ್ಳಿ','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'ಡೆಡ್ ಲಿಂಕ್ ಅಥವಾ ತಪ್ಪಾಗಿ ಟೈಪ್ ಮಾಡಿದ URL ನಂತಹ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲದ ಪುಟವನ್ನು ಸಂದರ್ಶಕರು ವೀಕ್ಷಿಸಿದಾಗ ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Displays your site\'s Privacy Policy page.'=>'ನಿಮ್ಮ ಸೈಟ್‌ನ ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Displays when a visitor performs a search on your website.'=>'ಸಂದರ್ಶಕರು ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್‌ನಲ್ಲಿ ಹುಡುಕಾಟ ನಡೆಸಿದಾಗ ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Displays when a visitor views the dedicated page that exists for any media attachment.'=>'ಯಾವುದೇ ಮಾಧ್ಯಮ ಲಗತ್ತಿಸುವಿಕೆಗಾಗಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಮೀಸಲಾದ ಪುಟವನ್ನು ಸಂದರ್ಶಕರು ವೀಕ್ಷಿಸಿದಾಗ ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'ಪೋಸ್ಟ್ ಟ್ಯಾಗ್ ಆರ್ಕೈವ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ. ಹೆಚ್ಚು ನಿರ್ದಿಷ್ಟವಾದ ಟೆಂಪ್ಲೇಟ್ (ಉದಾ., ಟ್ಯಾಗ್: ಪಿಜ್ಜಾ) ಕಂಡುಬರದಿದ್ದಾಗ ಈ ಟೆಂಪ್ಲೇಟ್ ಫಾಲ್‌ಬ್ಯಾಕ್ ಆಗಿ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತದೆ.','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'ನಿರ್ದಿಷ್ಟ ದಿನಾಂಕವನ್ನು ಭೇಟಿ ಮಾಡಿದಾಗ ಪೋಸ್ಟ್ ಆರ್ಕೈವ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ (ಉದಾ., example.com/2023/).','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'ಕಸ್ಟಮ್ ಟ್ಯಾಕ್ಸಾನಮಿ ಆರ್ಕೈವ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ. ವರ್ಗಗಳು ಮತ್ತು ಟ್ಯಾಗ್‌ಗಳಂತೆ, ಟ್ಯಾಕ್ಸಾನಮಿಗಳು ವಿಷಯಗಳನ್ನು ವರ್ಗೀಕರಿಸಲು ನೀವು ಬಳಸುವ ಪದಗಳನ್ನು ಹೊಂದಿವೆ. ಉದಾಹರಣೆಗೆ: "ಆರ್ಟ್" ಹೆಸರಿನ ಟ್ಯಾಕ್ಸಾನಮಿಯು "ಆಧುನಿಕ" ಮತ್ತು "18 ನೇ ಶತಮಾನ" ನಂತಹ ಬಹು ಪದಗಳನ್ನು ಹೊಂದಿರಬಹುದು. ಹೆಚ್ಚು ನಿರ್ದಿಷ್ಟವಾದ ಟೆಂಪ್ಲೇಟ್ (ಉದಾ, ಟ್ಯಾಕ್ಸಾನಮಿ: ಕಲೆ) ಕಂಡುಬರದಿದ್ದಾಗ ಈ ಟೆಂಪ್ಲೇಟ್ ಫಾಲ್‌ಬ್ಯಾಕ್ ಆಗಿ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತದೆ.','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'ಪೋಸ್ಟ್ ವರ್ಗದ ಆರ್ಕೈವ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ. ಹೆಚ್ಚು ನಿರ್ದಿಷ್ಟವಾದ ಟೆಂಪ್ಲೇಟ್ (ಉದಾ., ವರ್ಗ: ಪಾಕವಿಧಾನಗಳು) ಕಂಡುಬರದಿದ್ದಾಗ ಈ ಟೆಂಪ್ಲೇಟ್ ಫಾಲ್‌ಬ್ಯಾಕ್ ಆಗಿ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತದೆ.','Block pattern categoryAbout'=>'ಕುರಿತು','Block pattern categoryTeam'=>'ತಂಡ','Block pattern categoryPosts'=>'ಪೋಸ್ಟ್ಗಳು','Block pattern categoryBanners'=>'ಬ್ಯಾನರ್ಗಳು','block descriptionThe author name.'=>'ಲೇಖಕರ ಹೆಸರು.','block titleAuthor Name'=>'ಲೇಖಕರ ಹೆಸರು','block keywordpage'=>'ಪುಟ','block descriptionDisplays a page inside a list of all pages.'=>'ಎಲ್ಲಾ ಪುಟಗಳ ಪಟ್ಟಿಯೊಳಗೆ ಒಂದು ಪುಟವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','block titlePage List Item'=>'ಪುಟ ಪಟ್ಟಿ ಐಟಂ','Style Variations'=>'ಶೈಲಿ ವ್ಯತ್ಯಾಸಗಳು','Position'=>'ಸ್ಥಾನ','Sticky'=>'ಅಂಟು','https://wordpress.org/documentation/article/reset-your-password/'=>'https://wordpress.org/documentation/article/reset-your-password/','https://wordpress.org/documentation/article/site-editor/'=>'https://wordpress.org/documentation/article/site-editor/','Array of column names to be searched.'=>'ಶೋಧಿಸಬೇಕಾದ ಖಾನೆ ಹೆಸರುಗಳ ಶ್ರೇಣಿ.','The block types which can use this pattern.'=>'ಈ ಮಾದರಿಯನ್ನು ಬಳಸಬಹುದಾದ ಬ್ಲಾಕ್ ಪ್ರಕಾರಗಳು.','An array of template types where the pattern fits.'=>'ಮಾದರಿ ಹೊಂದಿಕೊಳ್ಳುವ ಟೆಂಪ್ಲೇಟ್ ಪ್ರಕಾರಗಳ ಶ್ರೇಣಿ.','Download file'=>'ಕಡತವನ್ನು ಡೌನ್ಲೋಡ್ ಮಾಡಿ','https://wordpress.org/documentation/article/manage-wordpress-widgets/'=>'https://wordpress.org/documentation/article/manage-wordpress-widgets/','Values for the input array must be either objects or arrays.'=>'ಇನ್ ಪುಟ್ ಶ್ರೇಣಿಯ ಮೌಲ್ಯಗಳು ಆಬ್ಜೆಕ್ಟ್ ಗಳು ಅಥವಾ ಶ್ರೇಣಿಗಳಾಗಿರಬೇಕು.','The image already has the requested size.'=>'ಇಮೇಜ್ ಈಗಾಗಲೇ ವಿನಂತಿಸಿದ ಗಾತ್ರವನ್ನು ಹೊಂದಿದೆ.',': %s'=>': %s','untitled post %s'=>'ಶೀರ್ಷಿಕೆರಹಿತ ಪೋಸ್ಟ್ %s','Untitled post %d'=>'ಶೀರ್ಷಿಕೆರಹಿತ ಪೋಸ್ಟ್ %d','Different layouts containing video or audio.'=>'ವೀಡಿಯೊ ಅಥವಾ ಆಡಿಯೋ ಹೊಂದಿರುವ ವಿವಿಧ ಲೇಔಟ್‌ಗಳು.','Different layouts for displaying images.'=>'ಚಿತ್ರಗಳನ್ನು ಪ್ರದರ್ಶಿಸಲು ವಿವಿಧ ವಿನ್ಯಾಸಗಳು.','Showcase your latest work.'=>'ನಿಮ್ಮ ಇತ್ತೀಚಿನ ಕೆಲಸವನ್ನು ಪ್ರದರ್ಶಿಸಿ.','Block pattern categoryPortfolio'=>'ಪೋರ್ಟ್ಫೋಲಿಯೋ','Introduce yourself.'=>'ನಿಮ್ಮ ಪರಿಚಯ ಮಾಡಿಕೊಳ್ಳಿ.','Display your contact information.'=>'ನಿಮ್ಮ ಸಂಪರ್ಕ ಮಾಹಿತಿಯನ್ನು ಪ್ರದರ್ಶಿಸಿ.','Block pattern categoryContact'=>'ಸಂಪರ್ಕಿಸಿ','Briefly describe what your business does and how you can help.'=>'ನಿಮ್ಮ ವ್ಯವಹಾರವು ಏನು ಮಾಡುತ್ತದೆ ಮತ್ತು ನೀವು ಹೇಗೆ ಸಹಾಯ ಮಾಡಬಹುದು ಎಂಬುದನ್ನು ಸಂಕ್ಷಿಪ್ತವಾಗಿ ವಿವರಿಸಿ.','Block pattern categoryServices'=>'ಸೇವೆಗಳು','Share reviews and feedback about your brand/business.'=>'ನಿಮ್ಮ ಬ್ರ್ಯಾಂಡ್/ವ್ಯವಹಾರದ ಕುರಿತು ವಿಮರ್ಶೆಗಳು ಮತ್ತು ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಹಂಚಿಕೊಳ್ಳಿ.','A variety of designs to display your team members.'=>'ನಿಮ್ಮ ತಂಡದ ಸದಸ್ಯರನ್ನು ಪ್ರದರ್ಶಿಸಲು ವಿವಿಧ ವಿನ್ಯಾಸಗಳು.','Sections whose purpose is to trigger a specific action.'=>'ಒಂದು ನಿರ್ದಿಷ್ಟ ಕ್ರಿಯೆಯನ್ನು ಪ್ರಚೋದಿಸುವ ಉದ್ದೇಶವನ್ನು ಹೊಂದಿರುವ ವಿಭಾಗಗಳು.','Block pattern categoryCall to Action'=>'ಕ್ರಿಯೆಗೆ ಕರೆ','Display your latest posts in lists, grids or other layouts.'=>'ಪಟ್ಟಿಗಳು, ಗ್ರಿಡ್ ಗಳು ಅಥವಾ ಇತರ ಲೇಔಟ್ ಗಳಲ್ಲಿ ನಿಮ್ಮ ಇತ್ತೀಚಿನ ಪೋಸ್ಟ್ ಗಳನ್ನು ಪ್ರದರ್ಶಿಸಿ.','Patterns containing mostly text.'=>'ಹೆಚ್ಚಾಗಿ ಪಠ್ಯವನ್ನು ಒಳಗೊಂಡಿರುವ ಮಾದರಿಗಳು.','https://wordpress.org/documentation/'=>'https://wordpress.org/documentation/','Sorry, you are not allowed to view terms for this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪೋಸ್ಟ್‌ನ ಟರ್ಮ್ಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','block titleList item'=>'ಪಟ್ಟಿ ಐಟಂ','block titleComments'=>'ಕಾಮೆಂಟ್‌ಗಳು','block titleComments Page Numbers'=>'ಪ್ರತಿಕ್ರಿಯೆಗಳ ಪುಟ ಸಂಖ್ಯೆಗಳು','block titleComments Next Page'=>'ಪ್ರತಿಕ್ರಿಯೆಗಳ ಮುಂದಿನ ಪುಟ','Single item: %s'=>'ಒಂದೇ ಐಟಂ: %s','Default template'=>'ಡೀಫಾಲ್ಟ್ ಟೆಂಪ್ಲೇಟ್','%s comment'=>'%s ಕಾಮೆಂಟ್' . "\0" . '%s ಕಾಮೆಂಟ್‌ಗಳು','Create a site or only a username:'=>'ಸೈಟ್ ಅಥವಾ ಬಳಕೆದಾರ ಹೆಸರನ್ನು ಮಾತ್ರ ರಚಿಸಿ:','Site Domain (subdomain only):'=>'ಸೈಟ್ ಡೊಮೇನ್ (ಉಪಡೊಮೇನ್ ಮಾತ್ರ):','There doesn\'t seem to be a %s file. It is needed before the installation can continue.'=>'%s ಫೈಲ್ ಇದ್ದಂತೆ ತೋರುತ್ತಿಲ್ಲ. ಸ್ಥಾಪನಾ ಕಾರ್ಯವು ಮುಂದುವರಿಯುವ ಮೊದಲು ಇದು ಅವಶ್ಯಕವಾಗಿದೆ.','The date and time the preferences were updated.'=>'ದಿನಾಂಕ ಮತ್ತು ಸಮಯ ಆದ್ಯತೆಗಳನ್ನು ನವೀಕರಿಸಲಾಗಿದೆ.','Revisions not enabled.'=>'ಪರಿಷ್ಕರಣೆಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿಲ್ಲ.','The icon for the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರದ ಐಕಾನ್.','*'=>'*','%sX-Large'=>'%sX-ದೊಡ್ಡದು','%sX-Small'=>'%sX-ಸಣ್ಣ','put your unique phrase here'=>'ನಿಮ್ಮ ವಿಶಿಷ್ಟ ಪದಗುಚ್ಛವನ್ನು ಇಲ್ಲಿ ಹಾಕಿ','Cache key must not be an empty string.'=>'ಕ್ಯಾಶ್ ಕೀಲಿಯು ಖಾಲಿ ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬಾರದು.','When checking for the %s capability, you must always check it against a specific user.'=>'%s ಸಾಮರ್ಥ್ಯವನ್ನು ಪರಿಶೀಲಿಸುವಾಗ, ನೀವು ಯಾವಾಗಲೂ ನಿರ್ದಿಷ್ಟ ಬಳಕೆದಾರರ ವಿರುದ್ಧ ಪರಿಶೀಲಿಸಬೇಕು.','When checking for the %s capability, you must always check it against a specific term.'=>'%s ಸಾಮರ್ಥ್ಯವನ್ನು ಪರಿಶೀಲಿಸುವಾಗ, ನೀವು ಯಾವಾಗಲೂ ಅದನ್ನು ನಿರ್ದಿಷ್ಟ ಪದದ ವಿರುದ್ಧ ಪರಿಶೀಲಿಸಬೇಕು.','When checking for the %s capability, you must always check it against a specific comment.'=>'%s ಸಾಮರ್ಥ್ಯವನ್ನು ಪರಿಶೀಲಿಸುವಾಗ, ನೀವು ಯಾವಾಗಲೂ ನಿರ್ದಿಷ್ಟ ಕಾಮೆಂಟ್ ವಿರುದ್ಧ ಅದನ್ನು ಪರಿಶೀಲಿಸಬೇಕು.','When checking for the %s capability, you must always check it against a specific page.'=>'%s ಸಾಮರ್ಥ್ಯವನ್ನು ಪರಿಶೀಲಿಸುವಾಗ, ನೀವು ಯಾವಾಗಲೂ ನಿರ್ದಿಷ್ಟ ಪುಟದ ವಿರುದ್ಧ ಅದನ್ನು ಪರಿಶೀಲಿಸಬೇಕು.','When checking for the %s capability, you must always check it against a specific post.'=>'%s ಸಾಮರ್ಥ್ಯಕ್ಕಾಗಿ ಪರಿಶೀಲಿಸುವಾಗ, ನೀವು ಯಾವಾಗಲೂ ನಿರ್ದಿಷ್ಟ ಪೋಸ್ಟ್‌ನಲ್ಲಿ ಅದನ್ನು ಪರಿಶೀಲಿಸಬೇಕು.','Your object cache implementation does not support flushing individual groups.'=>'ನಿಮ್ಮ ಆಬ್ಜೆಕ್ಟ್ ಕ್ಯಾಶ್ ಅನುಷ್ಠಾನವು ಪ್ರತ್ಯೇಕ ಗುಂಪುಗಳನ್ನು ಫ್ಲಶ್ ಮಾಡುವುದನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','Your object cache implementation does not support flushing the in-memory runtime cache.'=>'ನಿಮ್ಮ ಆಬ್ಜೆಕ್ಟ್ ಕ್ಯಾಶ್ ಅನುಷ್ಠಾನವು ಇನ್-ಮೆಮೊರಿ ರನ್‌ಟೈಮ್ ಸಂಗ್ರಹವನ್ನು ಫ್ಲಶ್ ಮಾಡುವುದನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','Deleted author: %s'=>'ಅಳಿಸಲಾದ ಲೇಖಕ: %s','Template for %s'=>'%s ಗಾಗಿ ಟೆಂಪ್ಲೇಟ್','Not found: %1$s (%2$s)'=>'ಕಂಡುಬಂದಿಲ್ಲ: %1$s (%2$s)','Block pattern categoryFooters'=>'ಅಡಿಬರಹಗಳು','Whether a theme uses block-based templates.'=>'ಥೀಮ್ ಬ್ಲಾಕ್ ಆಧಾರಿತ ಟೆಂಪ್ಲೇಟ್‌ಗಳನ್ನು ಬಳಸುತ್ತದೆಯೇ.','The ID of the page that should display the latest posts'=>'ಇತ್ತೀಚಿನ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಪ್ರದರ್ಶಿಸಬೇಕಾದ ಪುಟದ ID','The ID of the page that should be displayed on the front page'=>'ಮೊದಲ ಪುಟದಲ್ಲಿ ಪ್ರದರ್ಶಿಸಬೇಕಾದ ಪುಟದ ID','What to show on the front page'=>'ಮೊದಲ ಪುಟದಲ್ಲಿ ಏನು ತೋರಿಸಬೇಕು','File %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'ಯಾವುದೇ ಪರ್ಯಾಯ ಲಭ್ಯವಿಲ್ಲದ ಆವೃತ್ತಿ %2$s ರಿಂದ %1$s ಫೈಲ್ ಅನ್ನು <strong>ಅಸಮ್ಮತಿಗೊಳಿಸಲಾಗಿದೆ</strong>.','File %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'%2$s ಆವೃತ್ತಿಯಿಂದ %1$s ಫೈಲ್ ಅನ್ನು <strong>ಅಸಮ್ಮತಿಗೊಳಿಸಲಾಗಿದೆ</strong>! ಬದಲಿಗೆ %3$s ಬಳಸಿ.','Function %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'%2$s ಆವೃತ್ತಿಯಿಂದ %1$s ಕಾರ್ಯವನ್ನು <strong>ಅಸಮ್ಮತಿಗೊಳಿಸಲಾಗಿದೆ</strong> ಯಾವುದೇ ಪರ್ಯಾಯ ಲಭ್ಯವಿಲ್ಲ.','Function %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'%2$s ಆವೃತ್ತಿಯಿಂದ %1$s ಕಾರ್ಯವನ್ನು <strong>ಅಸಮ್ಮತಿಗೊಳಿಸಲಾಗಿದೆ</strong>! ಬದಲಿಗೆ %3$s ಬಳಸಿ.','block descriptionDisplays the link of a post, page, or any other content-type.'=>'ಪೋಸ್ಟ್, ಪುಟ, ಅಥವಾ ಯಾವುದೇ ಇತರ ವಿಷಯ-ಪ್ರಕಾರದ ಲಿಂಕ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','block titleRead More'=>'ಮತ್ತಷ್ಟು ಓದು','block descriptionContains the block elements used to render content when no query results are found.'=>'ಯಾವುದೇ ಪ್ರಶ್ನೆ ಫಲಿತಾಂಶಗಳು ಕಂಡುಬರದಿದ್ದಾಗ ವಿಷಯವನ್ನು ನಿರೂಪಿಸಲು ಬಳಸಲಾಗುವ ಬ್ಲಾಕ್ ಅಂಶಗಳನ್ನು ಒಳಗೊಂಡಿದೆ.','block titleNo results'=>'ಯಾವುದೇ ಫಲಿತಾಂಶಗಳಿಲ್ಲ','block descriptionDisplay post author details such as name, avatar, and bio.'=>'ಹೆಸರು, ಅವತಾರ ಮತ್ತು ಬಯೋ ಮುಂತಾದ ಪೋಸ್ಟ್ ಲೇಖಕರ ವಿವರಗಳನ್ನು ಪ್ರದರ್ಶಿಸಿ.','block descriptionThe author biography.'=>'ಲೇಖಕ ಜೀವನಚರಿತ್ರೆ.','block titleAuthor Biography'=>'ಲೇಖಕರ ಜೀವನಚರಿತ್ರೆ','block descriptionCreate a link that always points to the homepage of the site. Usually not necessary if there is already a site title link present in the header.'=>'ಯಾವಾಗಲೂ ಸೈಟ್‌ನ ಮುಖಪುಟಕ್ಕೆ ಸೂಚಿಸುವ ಲಿಂಕ್ ಅನ್ನು ರಚಿಸಿ. ಹೆಡರ್‌ನಲ್ಲಿ ಈಗಾಗಲೇ ಸೈಟ್ ಶೀರ್ಷಿಕೆ ಲಿಂಕ್ ಇದ್ದರೆ ಸಾಮಾನ್ಯವಾಗಿ ಅಗತ್ಯವಿಲ್ಲ.','block titleHome Link'=>'ಮುಖಪುಟ ಲಿಂಕ್','block descriptionGather blocks in a layout container.'=>'ಬ್ಲಾಕ್ಗಳನ್ನು ಒಂದು ಲೇಔಟ್ ಕಂಟೇನರ್ನಲ್ಲಿ ಒಟ್ಟುಗೂಡಿಸಿ.','block descriptionDisplays a title with the number of comments.'=>'ಕಾಮೆಂಟ್‌ಗಳ ಸಂಖ್ಯೆಯೊಂದಿಗೆ ಶೀರ್ಷಿಕೆಯನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','block titleComments Title'=>'ಕಾಮೆಂಟ್‌ಗಳ ಶೀರ್ಷಿಕೆ','block titleComments Pagination'=>'ಕಾಮೆಂಟ್‌ಗಳು ಪುಟೀಕರಣ','block descriptionDisplays the previous comment\'s page link.'=>'ಹಿಂದಿನ ಕಾಮೆಂಟ್‌ನ ಪುಟದ ಲಿಂಕ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','block descriptionDisplays a list of page numbers for comments pagination.'=>'ಕಾಮೆಂಟ್‌ಗಳ ವಿನ್ಯಾಸಕ್ಕಾಗಿ ಪುಟ ಸಂಖ್ಯೆಗಳ ಪಟ್ಟಿಯನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','block descriptionDisplays the next comment\'s page link.'=>'ಮುಂದಿನ ಕಾಮೆಂಟ್‌ನ ಪುಟದ ಲಿಂಕ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','block titleComment Template'=>'ಕಾಮೆಂಟ್ ಟೆಂಪ್ಲೇಟ್','block descriptionDisplays a link to reply to a comment.'=>'ಕಾಮೆಂಟ್‌ಗೆ ಪ್ರತ್ಯುತ್ತರಿಸಲು ಲಿಂಕ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','block titleComment Reply Link'=>'ಕಾಮೆಂಟ್ ಪ್ರತ್ಯುತ್ತರ ಲಿಂಕ್','block descriptionDisplays a link to edit the comment in the WordPress Dashboard. This link is only visible to users with the edit comment capability.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಡ್ಯಾಶ್‌ಬೋರ್ಡ್‌ನಲ್ಲಿ ಕಾಮೆಂಟ್ ಅನ್ನು ಸಂಪಾದಿಸಲು ಲಿಂಕ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ. ಈ ಲಿಂಕ್ ಎಡಿಟ್ ಕಾಮೆಂಟ್ ಸಾಮರ್ಥ್ಯವನ್ನು ಹೊಂದಿರುವ ಬಳಕೆದಾರರಿಗೆ ಮಾತ್ರ ಗೋಚರಿಸುತ್ತದೆ.','block titleComment Edit Link'=>'ಕಾಮೆಂಟ್ ಸಂಪಾದಿಸಿ ಲಿಂಕ್','block descriptionDisplays the date on which the comment was posted.'=>'ಕಾಮೆಂಟ್ ಅನ್ನು ಪೋಸ್ಟ್ ಮಾಡಿದ ದಿನಾಂಕವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','block descriptionDisplays the contents of a comment.'=>'ಕಾಮೆಂಟ್‌ನ ವಿಷಯಗಳನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','block descriptionDisplays the name of the author of the comment.'=>'ಕಾಮೆಂಟ್‌ನ ಲೇಖಕರ ಹೆಸರನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','block titleComment Author Name'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರ ಹೆಸರು','block descriptionAdd a user’s avatar.'=>'ಬಳಕೆದಾರರ ಅವತಾರವನ್ನು ಸೇರಿಸಿ.','block titleAvatar'=>'ಅವತಾರ','A WordPress Commenter'=>'ಒಬ್ಬ ವರ್ಡ್ಪ್ರೆಸ್ ಕಾಮೆಂಟರ್','Responses to %s'=>'%s ಗೆ ಪ್ರತಿಕ್ರಿಯೆಗಳು','Response to %s'=>'%s ಗೆ ಪ್ರತಿಕ್ರಿಯೆ','block titleComment Date'=>'ಕಾಮೆಂಟ್ ದಿನಾಂಕ','block titleComment Content'=>'ಕಾಮೆಂಟ್ ವಿಷಯ','Default Avatar'=>'ಡೀಫಾಲ್ಟ್ ಅವತಾರ್','Alignment optionNone'=>'ಯಾವುದೂ ಇಲ್ಲ','There is already a ping from that URL for this post.'=>'ಈ ಪೋಸ್ಟ್‌ಗಾಗಿ ಆ URL ನಿಂದ ಈಗಾಗಲೇ ಪಿಂಗ್ ಇದೆ.','The password cannot be a space or all spaces.'=>'ಪಾಸ್‌ವರ್ಡ್ ಸ್ಪೇಸ್ ಅಥವಾ ಎಲ್ಲಾ ಸ್ಪೇಸ್‌ಗಳಾಗಿರಬಾರದು.','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'ಹೆಚ್ಚಿನ ಸಹಾಯ ಬೇಕೇ? <a href="%1$s">%2$s ನಲ್ಲಿ ಬೆಂಬಲ ಲೇಖನವನ್ನು ಓದಿ</a>.','The database server could be connected to (which means your username and password is okay) but the %s database could not be selected.'=>'ಡೇಟಾಬೇಸ್ ಸರ್ವರ್ ಅನ್ನು ಸಂಪರ್ಕಿಸಬಹುದು (ಅಂದರೆ ನಿಮ್ಮ ಬಳಕೆದಾರಹೆಸರು ಮತ್ತು ಪಾಸ್‌ವರ್ಡ್ ಸರಿಯಾಗಿದೆ) ಆದರೆ %s ಡೇಟಾಬೇಸ್ ಅನ್ನು ಆಯ್ಕೆ ಮಾಡಲಾಗಲಿಲ್ಲ.','Cannot select database'=>'ಡೇಟಾಬೇಸ್ ಆಯ್ಕೆ ಮಾಡಲು ಸಾಧ್ಯವಾಗುತ್ತಿಲ್ಲ','That file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ಆ ಫೈಲ್ ಕಂಡುಬಂದಿಲ್ಲ. ನಿಮ್ಮ <a href="%s">ಮಾಧ್ಯಮ ಲೈಬ್ರರಿ</a> ಅನ್ನು ಪರಿಶೀಲಿಸಿ ಮತ್ತು ಅದನ್ನು ಅಳಿಸಲಾಗಿಲ್ಲ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ.','Sorry, the video at the supplied URL cannot be loaded. Please check that the URL is for a supported video file (%s) or stream (e.g. YouTube and Vimeo).'=>'ಕ್ಷಮಿಸಿ, ಸರಬರಾಜು ಮಾಡಿದ URL ನಲ್ಲಿ ವೀಡಿಯೊವನ್ನು ಲೋಡ್ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ. ದಯವಿಟ್ಟು URL ಬೆಂಬಲಿತ ವೀಡಿಯೊ ಫೈಲ್ (%s) ಅಥವಾ ಸ್ಟ್ರೀಮ್ (ಉದಾ. YouTube ಮತ್ತು Vimeo) ಗಾಗಿಯೇ ಎಂಬುದನ್ನು ಪರಿಶೀಲಿಸಿ.','That video cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ಆ ವೀಡಿಯೋ ಪತ್ತೆಯಾಗಿಲ್ಲ. ನಿಮ್ಮ <a href="%s">ಮಾಧ್ಯಮ ಲೈಬ್ರರಿ</a> ಅನ್ನು ಪರಿಶೀಲಿಸಿ ಮತ್ತು ಅದನ್ನು ಅಳಿಸಲಾಗಿಲ್ಲ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ.','That image cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ಆ ಚಿತ್ರ ಸಿಗಲಿಲ್ಲ. ನಿಮ್ಮ <a href="%s">ಮಾಧ್ಯಮ ಲೈಬ್ರರಿ</a> ಅನ್ನು ಪರಿಶೀಲಿಸಿ ಮತ್ತು ಅದನ್ನು ಅಳಿಸಲಾಗಿಲ್ಲ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ.','That audio file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'ಆ ಆಡಿಯೋ ಫೈಲ್ ಕಂಡುಬಂದಿಲ್ಲ. ನಿಮ್ಮ <a href="%s">ಮಾಧ್ಯಮ ಲೈಬ್ರರಿ</a> ಅನ್ನು ಪರಿಶೀಲಿಸಿ ಮತ್ತು ಅದನ್ನು ಅಳಿಸಲಾಗಿಲ್ಲ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ.','User URL may not be longer than 100 characters.'=>'ಬಳಕೆದಾರರ URL 100 ಅಕ್ಷರಗಳಿಗಿಂತ ಹೆಚ್ಚು ಇರಬಾರದು.','Unable to pass %s if not using multisite.'=>'ಮಲ್ಟಿಸೈಟ್ ಬಳಸದಿದ್ದರೆ %s ಅನ್ನು ರವಾನಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Webfont font weight must be a properly formatted string or integer.'=>'ವೆಬ್‌ಫಾಂಟ್ ಫಾಂಟ್ ತೂಕವು ಸರಿಯಾಗಿ ಫಾರ್ಮ್ಯಾಟ್ ಮಾಡಲಾದ ಸ್ಟ್ರಿಂಗ್ ಅಥವಾ ಪೂರ್ಣಾಂಕವಾಗಿರಬೇಕು.','Each webfont src must be a non-empty string.'=>'ಪ್ರತಿಯೊಂದು ವೆಬ್‌ಫಾಂಟ್ src ಖಾಲಿ ಅಲ್ಲದ ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','Webfont src must be a non-empty string or an array of strings.'=>'Webfont src ಖಾಲಿ ಅಲ್ಲದ ಸ್ಟ್ರಿಂಗ್ ಅಥವಾ ಸ್ಟ್ರಿಂಗ್‌ಗಳ ಒಂದು ಶ್ರೇಣಿಯಾಗಿರಬೇಕು.','Webfont font family must be a non-empty string.'=>'ವೆಬ್‌ಫಾಂಟ್ ಫಾಂಟ್ ಕುಟುಂಬವು ಖಾಲಿ ಅಲ್ಲದ ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','Limit results to those matching a pattern (slug).'=>'ಪ್ಯಾಟರ್ನ್ ಗೆ (ಸ್ಲಗ್) ಹೊಂದಿಕೆಯಾಗುವ ಫಲಿತಾಂಶಗಳಿಗೆ ಮಿತಿಗೊಳಿಸಿ.','Ancestor blocks.'=>'ಪೂರ್ವಜ ಬ್ಲಾಕ್ಗಳು.','Determines whether the pattern is visible in inserter.'=>'ಇನ್ಸರ್ಟರ್ನಲ್ಲಿ ಪ್ಯಾಟರ್ನ್ ಗೋಚರಿಸುತ್ತದೆಯೇ ಎಂಬುದನ್ನು ನಿರ್ಧರಿಸುತ್ತದೆ.','The pattern keywords.'=>'ಪ್ಯಾಟರ್ನ್ ಕೀವರ್ಡ್ಗಳು.','The pattern detailed description.'=>'ಮಾದರಿ ವಿವರವಾದ ವಿವರಣೆ.','The pattern name.'=>'ಪ್ಯಾಟರ್ನ್ ಹೆಸರು.','Sorry, you are not allowed to view the registered block patterns.'=>'ಕ್ಷಮಿಸಿ, ನೋಂದಾಯಿತ ಬ್ಲಾಕ್ ಪ್ಯಾಟರ್ನ್‌ಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','The category label, in human readable format.'=>'ವರ್ಗದ ಲೇಬಲ್, ಮಾನವ ಓದಬಲ್ಲ ಸ್ವರೂಪದಲ್ಲಿ.','The category name.'=>'ವರ್ಗದ ಹೆಸರು.','Sorry, you are not allowed to view the registered block pattern categories.'=>'ಕ್ಷಮಿಸಿ, ನೋಂದಾಯಿತ ಬ್ಲಾಕ್ ಪ್ಯಾಟರ್ನ್ ವಿಭಾಗಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿಸಲಾಗುವುದಿಲ್ಲ.','Error in deleting the attachment.'=>'ಲಗತ್ತನ್ನು ಅಳಿಸುವಲ್ಲಿ ದೋಷ.','<strong>Error:</strong> This is not a valid feed template.'=>'<strong>ದೋಷ:</strong> ಇದು ಮಾನ್ಯವಾದ ಫೀಡ್ ಟೆಂಪ್ಲೇಟ್ ಅಲ್ಲ.','unit symbolPB'=>'PB','unit symbolEB'=>'EB','unit symbolZB'=>'ZB','unit symbolYB'=>'YB','The description will be displayed in the menu if the active theme supports it.'=>'ಸಕ್ರಿಯ ಥೀಮ್ ಅದನ್ನು ಬೆಂಬಲಿಸಿದರೆ ವಿವರಣೆಯನ್ನು ಮೆನುವಿನಲ್ಲಿ ಪ್ರದರ್ಶಿಸಲಾಗುತ್ತದೆ.','A title on that page cannot be found.'=>'ಆ ಪುಟದಲ್ಲಿ ಶೀರ್ಷಿಕೆ ಕಂಡುಬಂದಿಲ್ಲ.','color schemeLight'=>'ಲೈಟ್','color schemeDark'=>'ಡಾರ್ಕ್','<strong>Error:</strong> The themes directory is either empty or does not exist. Please check your installation.'=>'<strong>ದೋಷ:</strong> ಥೀಮ್‌ಗಳ ಡೈರೆಕ್ಟರಿ ಖಾಲಿಯಾಗಿದೆ ಅಥವಾ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ. ದಯವಿಟ್ಟು ನಿಮ್ಮ ಸ್ಥಾಪನೆಯನ್ನು ಪರಿಶೀಲಿಸಿ.','File does not exist?'=>'ಕಡತ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ?','Responses'=>'ಪ್ರತಿಕ್ರಿಯೆಗಳು','Response'=>'ಪ್ರತಿಕ್ರಿಯೆ','Older Comments'=>'ಹಳೆಯ ಕಾಮೆಂಟ್‌ಗಳು','Newer Comments'=>'ಹೊಸ ಕಾಮೆಂಟ್‌ಗಳು','(%s website link, opens in a new tab)'=>'(%s ವೆಬ್‌ಸೈಟ್ ಲಿಂಕ್, ಹೊಸ ಟ್ಯಾಬ್‌ನಲ್ಲಿ ತೆರೆಯುತ್ತದೆ)','(%s author archive, opens in a new tab)'=>'(%s ಲೇಖಕರ ಆರ್ಕೈವ್, ಹೊಸ ಟ್ಯಾಬ್‌ನಲ್ಲಿ ತೆರೆಯುತ್ತದೆ)','%s Avatar'=>'%s ಅವತಾರ್','Could not register file "%s" as a block pattern ("Title" field missing)'=>'ಮಾದರಿ ವಿವರವಾದ ವಿವರಣೆ. "%s" ಫೈಲ್ ಅನ್ನು ಬ್ಲಾಕ್ ಮಾದರಿಯಾಗಿ ನೋಂದಾಯಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ ("ಶೀರ್ಷಿಕೆ" ಫೀಲ್ಡ್ ಕಾಣೆಯಾಗಿದೆ)','Could not register file "%1$s" as a block pattern (invalid slug "%2$s")'=>'"%1$s" ಫೈಲ್ ಅನ್ನು ಬ್ಲಾಕ್ ಮಾದರಿಯಾಗಿ ನೋಂದಾಯಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ (ಅಮಾನ್ಯ ಸ್ಲಗ್ "%2$s")','Could not register file "%s" as a block pattern ("Slug" field missing)'=>'ಫೈಲ್ "%s" ಅನ್ನು ಬ್ಲಾಕ್ ಮಾದರಿಯಾಗಿ ನೋಂದಾಯಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ ("ಸ್ಲಗ್" ಫೀಲ್ಡ್ ಕಾಣೆಯಾಗಿದೆ)','Block pattern categoryFeatured'=>'ವೈಶಿಷ್ಟ್ಯಗೊಳಿಸಿದ','Use Site Editor'=>'ಸೈಟ್ ಸಂಪಾದಕವನ್ನು ಬಳಸಿ','Hurray! Your theme supports site editing with blocks. <a href="%1$s">Tell me more</a>. %2$s'=>'ಹುರ್ರೇ! ನಿಮ್ಮ ಥೀಮ್ ಬ್ಲಾಕ್‌ಗಳೊಂದಿಗೆ ಸೈಟ್ ಸಂಪಾದನೆಯನ್ನು ಬೆಂಬಲಿಸುತ್ತದೆ. <a href="%1$s">ನನಗೆ ಇನ್ನಷ್ಟು ಹೇಳಿ</a>. %2$s','Icon'=>'ಐಕಾನ್','Site icon.'=>'ಸೈಟ್ ಐಕಾನ್','block descriptionDisplay the description of categories, tags and custom taxonomies when viewing an archive.'=>'ಆರ್ಕೈವ್ ಅನ್ನು ವೀಕ್ಷಿಸುವಾಗ ವಿಭಾಗಗಳು, ಟ್ಯಾಗ್‌ಗಳು ಮತ್ತು ಕಸ್ಟಮ್ ಟ್ಯಾಕ್ಸಾನಮಿಗಳ ವಿವರಣೆಯನ್ನು ಪ್ರದರ್ಶಿಸಿ.','block titleTerm Description'=>'ಪದದ ವಿವರಣೆ','block descriptionEdit the different global regions of your site, like the header, footer, sidebar, or create your own.'=>'ಹೆಡರ್, ಅಡಿಟಿಪ್ಪಣಿ, ಸೈಡ್‌ಬಾರ್‌ನಂತಹ ನಿಮ್ಮ ಸೈಟ್‌ನ ವಿವಿಧ ಜಾಗತಿಕ ಪ್ರದೇಶಗಳನ್ನು ಸಂಪಾದಿಸಿ ಅಥವಾ ನಿಮ್ಮದೇ ಆದದನ್ನು ರಚಿಸಿ.','block titleTemplate Part'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗ','block descriptionCreate structured content in rows and columns to display information.'=>'ಮಾಹಿತಿಯನ್ನು ಪ್ರದರ್ಶಿಸಲು ಸಾಲುಗಳು ಮತ್ತು ಕಾಲಮ್‌ಗಳಲ್ಲಿ ರಚನಾತ್ಮಕ ವಿಷಯವನ್ನು ರಚಿಸಿ.','block descriptionDisplays the name of this site. Update the block, and the changes apply everywhere it’s used. This will also appear in the browser title bar and in search results.'=>'ಈ ಸೈಟ್‌ನ ಹೆಸರನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ. ಬ್ಲಾಕ್ ಅನ್ನು ನವೀಕರಿಸಿ ಮತ್ತು ಬದಲಾವಣೆಗಳು ಅದನ್ನು ಬಳಸಿದ ಎಲ್ಲೆಡೆ ಅನ್ವಯಿಸುತ್ತವೆ. ಇದು ಬ್ರೌಸರ್ ಶೀರ್ಷಿಕೆ ಪಟ್ಟಿ ಮತ್ತು ಹುಡುಕಾಟ ಫಲಿತಾಂಶಗಳಲ್ಲಿ ಸಹ ಗೋಚರಿಸುತ್ತದೆ.','block style labelPlain'=>'ಸರಳ','block titlePagination'=>'ಪುಟ ವಿನ್ಯಾಸ','block titlePrevious Page'=>'ಹಿಂದಿನ ಪುಟ','block titlePage Numbers'=>'ಪುಟ ಸಂಖ್ಯೆಗಳು','block titleNext Page'=>'ಮುಂದಿನ ಪುಟ','block descriptionDisplays the next or previous post link that is adjacent to the current post.'=>'ಪ್ರಸ್ತುತ ಪೋಸ್ಟ್‌ಗೆ ಪಕ್ಕದಲ್ಲಿರುವ ಮುಂದಿನ ಅಥವಾ ಹಿಂದಿನ ಪೋಸ್ಟ್ ಲಿಂಕ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','block titlePost Navigation Link'=>'ಪೋಸ್ಟ್ ನ್ಯಾವಿಗೇಷನ್ ಲಿಂಕ್','block descriptionDisplay a post\'s comments form.'=>'ಒಂದು ಪೋಸ್ಟ್‌ನ ಕಾಮೆಂಟ್ಸ್ ಫಾರ್ಮನ್ನು ಪ್ರದರ್ಶಿಸಿ.','block titleComments Form'=>'ಕಾಮೆಂಟ್ಗಳ ಫಾರ್ಮ್','block descriptionShow a block pattern.'=>'ಬ್ಲಾಕ್ ಮಾದರಿಯನ್ನು ತೋರಿಸಿ.','block titlePattern'=>'ಮಾದರಿ','block descriptionA collection of blocks that allow visitors to get around your site.'=>'ಸಂದರ್ಶಕರು ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಸುತ್ತಲು ಅನುಮತಿಸುವ ಬ್ಲಾಕ್‌ಗಳ ಸಂಗ್ರಹ.','block titleNavigation'=>'ಸಂಚರಣೆ','block descriptionAdd a submenu to your navigation.'=>'ನಿಮ್ಮ ನ್ಯಾವಿಗೇಷನ್‌ಗೆ ಉಪಮೆನುವನ್ನು ಸೇರಿಸಿ.','block titleSubmenu'=>'ಉಪಮೆನು','block descriptionAdd a page, link, or another item to your navigation.'=>'ನಿಮ್ಮ ನ್ಯಾವಿಗೇಷನ್‌ಗೆ ಪುಟ, ಲಿಂಕ್ ಅಥವಾ ಇನ್ನೊಂದು ಐಟಂ ಅನ್ನು ಸೇರಿಸಿ.','block titleCustom Link'=>'ಕಸ್ಟಮ್ ಲಿಂಕ್','block descriptionDisplay content in multiple columns, with blocks added to each column.'=>'ಬಹು ಕಾಲಮ್‌ಗಳಲ್ಲಿ ವಿಷಯವನ್ನು ಪ್ರದರ್ಶಿಸಿ, ಪ್ರತಿ ಕಾಲಮ್‌ಗೆ ಬ್ಲಾಕ್‌ಗಳನ್ನು ಸೇರಿಸಲಾಗಿದೆ.','Preload valueNone'=>'ಯಾವುದೂ ಇಲ್ಲ','No comments'=>'ಯಾವುದೇ ಕಾಮೆಂಟ್‌ಗಳಿಲ್ಲ','Media item link optionNone'=>'ಯಾವುದೂ ಇಲ್ಲ','Could not strip invalid text.'=>'ಅಮಾನ್ಯ ಪಠ್ಯವನ್ನು ತೆಗೆದುಹಾಕಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not retrieve table charset.'=>'ಟೇಬಲ್ ಅಕ್ಷರ ಸೆಟ್ ಅನ್ನು ಹಿಂಪಡೆಯಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','WordPress database error: Processing the values for the following fields failed: %s. The supplied values may be too long or contain invalid data.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಡೇಟಾಬೇಸ್ ದೋಷ: ಕೆಳಗಿನ ಕ್ಷೇತ್ರಗಳಿಗೆ ಮೌಲ್ಯಗಳನ್ನು ಪ್ರಕ್ರಿಯೆಗೊಳಿಸುವುದು ವಿಫಲವಾಗಿದೆ: %s. ಸರಬರಾಜು ಮಾಡಲಾದ ಮೌಲ್ಯಗಳು ತುಂಬಾ ಉದ್ದವಾಗಿರಬಹುದು ಅಥವಾ ಅಮಾನ್ಯ ಡೇಟಾವನ್ನು ಹೊಂದಿರಬಹುದು.','WordPress database error: Processing the value for the following field failed: %s. The supplied value may be too long or contains invalid data.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಡೇಟಾಬೇಸ್ ದೋಷ: ಕೆಳಗಿನ ಕ್ಷೇತ್ರಕ್ಕೆ ಮೌಲ್ಯವನ್ನು ಪ್ರಕ್ರಿಯೆಗೊಳಿಸುವುದು ವಿಫಲವಾಗಿದೆ: %s. ಒದಗಿಸಿದ ಮೌಲ್ಯವು ತುಂಬಾ ಉದ್ದವಾಗಿರಬಹುದು ಅಥವಾ ಅಮಾನ್ಯ ಡೇಟಾವನ್ನು ಹೊಂದಿರಬಹುದು.','WordPress database error: Could not perform query because it contains invalid data.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಡೇಟಾಬೇಸ್ ದೋಷ: ಇದು ಅಮಾನ್ಯ ಡೇಟಾವನ್ನು ಹೊಂದಿರುವ ಕಾರಣ ಪ್ರಶ್ನೆಯನ್ನು ನಿರ್ವಹಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','"%1$s" style should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'"%1$s" ಶೈಲಿಯನ್ನು ಹೊಸ ವಿಜೆಟ್‌ಗಳ ಸಂಪಾದಕ (%2$s ಅಥವಾ %3$s) ಜೊತೆಗೆ ಸೇರಿಸಬಾರದು.','"%1$s" script should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'"%1$s" ಸ್ಕ್ರಿಪ್ಟ್ ಅನ್ನು ಹೊಸ ವಿಜೆಟ್‌ಗಳ ಸಂಪಾದಕ (%2$s ಅಥವಾ %3$s) ಜೊತೆಗೆ ಸೇರಿಸಬಾರದು.','The description is not prominent by default; however, some themes may show it.'=>'ವಿವರಣೆಯು ಪೂರ್ವನಿಯೋಜಿತವಾಗಿ ಪ್ರಮುಖವಾಗಿಲ್ಲ; ಆದಾಗ್ಯೂ, ಕೆಲವು ಥೀಮ್‌ಗಳು ಅದನ್ನು ತೋರಿಸಬಹುದು.','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band.'=>'ಕ್ರಮಾನುಗತವನ್ನು ರಚಿಸಲು ಪೋಷಕರ ಪದವನ್ನು ನಿಯೋಜಿಸಿ. ಉದಾಹರಣೆಗೆ Jazz ಎಂಬ ಪದವು ಬೇಬಾಪ್ ಮತ್ತು ಬಿಗ್ ಬ್ಯಾಂಡ್‌ನ ಮೂಲವಾಗಿದೆ.','The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'&#8220;ಸ್ಲಗ್&#8221; ಒಂದು ಹೆಸರಿನ URL ಸ್ನೇಹಿ ಆವೃತ್ತಿಯಾಗಿದೆ. ಇದು ಸಾಮಾನ್ಯವಾಗಿ ಎಲ್ಲಾ ಸಣ್ಣಕ್ಷರವಾಗಿದೆ ಮತ್ತು ಅಕ್ಷರಗಳು, ಸಂಖ್ಯೆಗಳು ಮತ್ತು ಹೈಫನ್‌ಗಳನ್ನು ಮಾತ್ರ ಒಳಗೊಂಡಿರುತ್ತದೆ.','The name is how it appears on your site.'=>'ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ ಅದು ಹೇಗೆ ಕಾಣಿಸಿಕೊಳ್ಳುತ್ತದೆ ಎಂಬುದು ಹೆಸರು.','Template Part Area'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗ ಪ್ರದೇಶ','Template Part Areas'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗ ಪ್ರದೇಶಗಳು','The server cannot process the image. This can happen if the server is busy or does not have enough resources to complete the task. Uploading a smaller image may help. Suggested maximum size is 2560 pixels.'=>'ಸರ್ವರ್ ಚಿತ್ರವನ್ನು ಪ್ರಕ್ರಿಯೆಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ಸರ್ವರ್ ಕಾರ್ಯನಿರತವಾಗಿದ್ದರೆ ಅಥವಾ ಕಾರ್ಯವನ್ನು ಪೂರ್ಣಗೊಳಿಸಲು ಸಾಕಷ್ಟು ಸಂಪನ್ಮೂಲಗಳನ್ನು ಹೊಂದಿಲ್ಲದಿದ್ದರೆ ಇದು ಸಂಭವಿಸಬಹುದು. ಚಿಕ್ಕ ಚಿತ್ರವನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡುವುದರಿಂದ ಸಹಾಯವಾಗಬಹುದು. ಸೂಚಿಸಲಾದ ಗರಿಷ್ಠ ಗಾತ್ರವು 2560 ಪಿಕ್ಸೆಲ್‌ಗಳು.','Limit result set to users who have published posts.'=>'ಪೋಸ್ಟ್‌ಗಳನ್ನು ಪ್ರಕಟಿಸಿದ ಬಳಕೆದಾರರಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಮಿತಿಗೊಳಿಸಲಾಗಿದೆ.','Limit result set to users matching at least one specific capability provided. Accepts csv list or single capability.'=>'ಒದಗಿಸಿದ ಕನಿಷ್ಠ ಒಂದು ನಿರ್ದಿಷ್ಟ ಸಾಮರ್ಥ್ಯವನ್ನು ಹೊಂದಿಕೆಯಾಗುವ ಬಳಕೆದಾರರಿಗೆ ಮಿತಿ ಫಲಿತಾಂಶವನ್ನು ಹೊಂದಿಸಲಾಗಿದೆ. csv ಪಟ್ಟಿ ಅಥವಾ ಏಕ ಸಾಮರ್ಥ್ಯವನ್ನು ಸ್ವೀಕರಿಸುತ್ತದೆ.','Sorry, you are not allowed to filter users by capability.'=>'ಕ್ಷಮಿಸಿ, ಸಾಮರ್ಥ್ಯದ ಮೂಲಕ ಬಳಕೆದಾರರನ್ನು ಫಿಲ್ಟರ್ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿಸಲಾಗುವುದಿಲ್ಲ.','Unable to retrieve body from response at this URL.'=>'ಈ URL ನಲ್ಲಿ ಪ್ರತಿಕ್ರಿಯೆಯಿಂದ ದೇಹವನ್ನು ಹಿಂಪಡೆಯಲು ಸಾಧ್ಯವಾಗುತ್ತಿಲ್ಲ.','URL not found. Response returned a non-200 status code for this URL.'=>'URL ಕಂಡುಬಂದಿಲ್ಲ. ಈ URL ಗಾಗಿ ಪ್ರತಿಕ್ರಿಯೆಯು 200 ಅಲ್ಲದ ಸ್ಥಿತಿ ಕೋಡ್ ಅನ್ನು ಹಿಂತಿರುಗಿಸಿದೆ.','Sorry, you are not allowed to process remote URLs.'=>'ಕ್ಷಮಿಸಿ, ರಿಮೋಟ್ URL ಗಳನ್ನು ಪ್ರಕ್ರಿಯೆಗೊಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','Invalid URL'=>'ಅಮಾನ್ಯ URL','The Open Graph image link of the %1$s or %2$s element from the URL.'=>'URL ನಿಂದ %1$s ಅಥವಾ %2$s ಅಂಶದ ಓಪನ್ ಗ್ರಾಫ್ ಇಮೇಜ್ ಲಿಂಕ್.','The content of the %s element from the URL.'=>'URL ನಿಂದ %s ಅಂಶದ ವಿಷಯ.','The favicon image link of the %s element from the URL.'=>'URL ನಿಂದ %s ಅಂಶದ ಫೆವಿಕಾನ್ ಇಮೇಜ್ ಲಿಂಕ್.','The contents of the %s element from the URL.'=>'URL ನಿಂದ %s ಅಂಶದ ವಿಷಯಗಳು.','The URL to process.'=>'ಪ್ರಕ್ರಿಯೆಗೊಳಿಸಲು URL.','Where the template part is intended for use (header, footer, etc.)'=>'ಟೆಂಪ್ಲೇಟ್ ಭಾಗವು ಬಳಕೆಗೆ ಉದ್ದೇಶಿಸಿದ್ದರೆ (ಹೆಡರ್, ಅಡಿಟಿಪ್ಪಣಿ, ಇತ್ಯಾದಿ.)','Whether a template is a custom template.'=>'ಟೆಂಪ್ಲೇಟ್ ಕಸ್ಟಮ್ ಟೆಂಪ್ಲೇಟ್ ಆಗಿದೆಯೇ.','The ID for the author of the template.'=>'ಟೆಂಪ್ಲೇಟ್‌ನ ಲೇಖಕರ ID.','HTML title for the template, transformed for display.'=>'ಟೆಂಪ್ಲೇಟ್‌ಗಾಗಿ HTML ಶೀರ್ಷಿಕೆ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','Title for the template, as it exists in the database.'=>'ಟೆಂಪ್ಲೇಟ್‌ಗಾಗಿ ಶೀರ್ಷಿಕೆ, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವಂತೆ.','Version of the content block format used by the template.'=>'ಟೆಂಪ್ಲೇಟ್ ಬಳಸುವ ಕಂಟೆಂಟ್ ಬ್ಲಾಕ್ ಫಾರ್ಮ್ಯಾಟ್‌ನ ಆವೃತ್ತಿ.','Content for the template, as it exists in the database.'=>'ಟೆಂಪ್ಲೇಟ್‌ಗಾಗಿ ವಿಷಯ, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವಂತೆ.','Source of a customized template'=>'ಕಸ್ಟಮೈಸ್ ಮಾಡಿದ ಟೆಂಪ್ಲೇಟ್‌ನ ಮೂಲ','Type of template.'=>'ಟೆಂಪ್ಲೇಟ್ ಪ್ರಕಾರ.','Post type to get the templates for.'=>'ಟೆಂಪ್ಲೇಟ್‌ಗಳನ್ನು ಪಡೆಯಲು ಪೋಸ್ಟ್ ಪ್ರಕಾರ.','Limit to the specified template part area.'=>'ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ಟೆಂಪ್ಲೇಟ್ ಭಾಗ ಪ್ರದೇಶಕ್ಕೆ ಮಿತಿಗೊಳಿಸಿ.','REST namespace route for the taxonomy.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಗಾಗಿ REST ನೇಮ್‌ಸ್ಪೇಸ್ ಮಾರ್ಗ.','Whether to make the post type available for selection in navigation menus.'=>'ನ್ಯಾವಿಗೇಶನ್ ಮೆನುಗಳಲ್ಲಿ ಆಯ್ಕೆಗಾಗಿ ಪೋಸ್ಟ್ ಪ್ರಕಾರವನ್ನು ಮಾಡಬೇಕೆ.','Whether to generate a default UI for managing this post type.'=>'ಈ ಪೋಸ್ಟ್ ಪ್ರಕಾರವನ್ನು ನಿರ್ವಹಿಸಲು ಡೀಫಾಲ್ಟ್ UI ಅನ್ನು ರಚಿಸಬೇಕೆ.','The visibility settings for the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕಾಗಿ ಗೋಚರತೆಯ ಸೆಟ್ಟಿಂಗ್‌ಗಳು.','REST route\'s namespace for the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕಾಗಿ REST ಮಾರ್ಗದ ನೇಮ್‌ಸ್ಪೇಸ್.','Whether to automatically add top level pages to this menu.'=>'ಈ ಮೆನುಗೆ ಉನ್ನತ ಮಟ್ಟದ ಪುಟಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಸೇರಿಸಬೇಕೆ.','The locations assigned to the menu.'=>'ಮೆನುಗೆ ನಿಯೋಜಿಸಲಾದ ಸ್ಥಳಗಳು.','The menu cannot be deleted.'=>'ಮೆನುವನ್ನು ಅಳಿಸಲಾಗುವುದಿಲ್ಲ','Menus do not support trashing. Set \'%s\' to delete.'=>'ಮೆನುಗಳು ಅನುಪಯುಕ್ತವನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ. ಅಳಿಸಲು \'%s\' ಹೊಂದಿಸಿ.','Sorry, you are not allowed to view menus.'=>'ಕ್ಷಮಿಸಿ, ಮೆನುಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','The ID of the assigned menu.'=>'ನಿಯೋಜಿಸಲಾದ ಮೆನುವಿನ ID.','The description of the menu location.'=>'ಮೆನು ಸ್ಥಳದ ವಿವರಣೆ.','The name of the menu location.'=>'ಮೆನು ಸ್ಥಳದ ಹೆಸರು.','Invalid menu location.'=>'ಅಮಾನ್ಯ ಮೆನು ಸ್ಥಳ.','Sorry, you are not allowed to view menu locations.'=>'ಕ್ಷಮಿಸಿ, ಮೆನು ಸ್ಥಳಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','An alphanumeric identifier for the menu location.'=>'ಮೆನು ಸ್ಥಳಕ್ಕಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಗುರುತಿಸುವಿಕೆ.','The terms assigned to the object in the %s taxonomy.'=>'%s ಟ್ಯಾಕ್ಸಾನಮಿಯಲ್ಲಿ ಆಬ್ಜೆಕ್ಟ್‌ಗೆ ನಿಯೋಜಿಸಲಾದ ನಿಯಮಗಳು.','Whether the menu item represents an object that no longer exists.'=>'ಮೆನು ಐಟಂ ಇನ್ನು ಮುಂದೆ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲದ ವಸ್ತುವನ್ನು ಪ್ರತಿನಿಧಿಸುತ್ತದೆಯೇ.','The XFN relationship expressed in the link of this menu item.'=>'XFN ಸಂಬಂಧವನ್ನು ಈ ಮೆನು ಐಟಂನ ಲಿಂಕ್‌ನಲ್ಲಿ ವ್ಯಕ್ತಪಡಿಸಲಾಗಿದೆ.','The URL to which this menu item points.'=>'ಈ ಮೆನು ಐಟಂ ಸೂಚಿಸುವ URL.','The singular label used to describe this type of menu item.'=>'ಈ ರೀತಿಯ ಮೆನು ಐಟಂ ಅನ್ನು ವಿವರಿಸಲು ಏಕವಚನ ಲೇಬಲ್ ಅನ್ನು ಬಳಸಲಾಗುತ್ತದೆ.','The target attribute of the link element for this menu item.'=>'ಈ ಮೆನು ಐಟಂಗಾಗಿ ಲಿಂಕ್ ಅಂಶದ ಗುರಿ ಗುಣಲಕ್ಷಣ.','The database ID of the original object this menu item represents, for example the ID for posts or the term_id for categories.'=>'ಈ ಮೆನು ಐಟಂ ಪ್ರತಿನಿಧಿಸುವ ಮೂಲ ವಸ್ತುವಿನ ಡೇಟಾಬೇಸ್ ID, ಉದಾಹರಣೆಗೆ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ID ಅಥವಾ ವರ್ಗಗಳಿಗೆ term_id.','The type of object originally represented, such as "category", "post", or "attachment".'=>'ವಸ್ತುವಿನ ಪ್ರಕಾರವನ್ನು ಮೂಲತಃ ಪ್ರತಿನಿಧಿಸಲಾಗುತ್ತದೆ, ಉದಾಹರಣೆಗೆ "ವರ್ಗ", "ಪೋಸ್ಟ್" ಅಥವಾ "ಲಗತ್ತು".','The DB ID of the nav_menu_item that is this item\'s menu parent, if any, otherwise 0.'=>'ಈ ಐಟಂನ ಮೆನು ಮೂಲವಾಗಿರುವ nav_menu_item ನ DB ID, ಯಾವುದಾದರೂ ಇದ್ದರೆ, ಇಲ್ಲದಿದ್ದರೆ 0.','The description of this menu item.'=>'ಈ ಮೆನು ಐಟಂನ ವಿವರಣೆ.','Class names for the link element of this menu item.'=>'ಈ ಮೆನು ಐಟಂನ ಲಿಂಕ್ ಅಂಶಕ್ಕಾಗಿ ವರ್ಗ ಹೆಸರುಗಳು.','Text for the title attribute of the link element for this menu item.'=>'ಈ ಮೆನು ಐಟಂಗಾಗಿ ಲಿಂಕ್ ಅಂಶದ ಶೀರ್ಷಿಕೆ ಗುಣಲಕ್ಷಣಕ್ಕಾಗಿ ಪಠ್ಯ.','The ID for the parent of the object.'=>'ವಸ್ತುವಿನ ಪೋಷಕ ID.','A named status for the object.'=>'ವಸ್ತುವಿಗೆ ಹೆಸರಿಸಲಾದ ಸ್ಥಿತಿ.','The family of objects originally represented, such as "post_type" or "taxonomy".'=>'"post_type" ಅಥವಾ "taxonomy" ನಂತಹ ಮೂಲತಃ ಪ್ರತಿನಿಧಿಸುವ ವಸ್ತುಗಳ ಕುಟುಂಬ.','HTML title for the object, transformed for display.'=>'ವಸ್ತುವಿನ HTML ಶೀರ್ಷಿಕೆ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','Title for the object, as it exists in the database.'=>'ವಸ್ತುವಿನ ಶೀರ್ಷಿಕೆ, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿರುವಂತೆ.','Get linked object.'=>'ಲಿಂಕ್ ಮಾಡಲಾದ ವಸ್ತುವನ್ನು ಪಡೆಯಿರಿ.','The url is required when using a custom menu item type.'=>'ಕಸ್ಟಮ್ ಮೆನು ಐಟಂ ಪ್ರಕಾರವನ್ನು ಬಳಸುವಾಗ url ಅಗತ್ಯವಿದೆ.','The title is required when using a custom menu item type.'=>'ಕಸ್ಟಮ್ ಮೆನು ಐಟಂ ಪ್ರಕಾರವನ್ನು ಬಳಸುವಾಗ ಶೀರ್ಷಿಕೆಯ ಅಗತ್ಯವಿದೆ.','Menu items do not support trashing. Set \'%s\' to delete.'=>'ಮೆನು ಐಟಂಗಳು ಅನುಪಯುಕ್ತವನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ. ಅಳಿಸಲು \'%s\' ಹೊಂದಿಸಿ.','Sorry, you are not allowed to access the global styles on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ಜಾಗತಿಕ ಶೈಲಿಗಳನ್ನು ಪ್ರವೇಶಿಸಲು ನಿಮಗೆ ಅನುಮತಿಸಲಾಗುವುದಿಲ್ಲ.','Title for the global styles variation, as it exists in the database.'=>'ಜಾಗತಿಕ ಶೈಲಿಗಳ ಬದಲಾವಣೆಯ ಶೀರ್ಷಿಕೆ, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವಂತೆ.','Title of the global styles variation.'=>'ಜಾಗತಿಕ ಶೈಲಿಗಳ ಬದಲಾವಣೆಯ ಶೀರ್ಷಿಕೆ.','Global settings.'=>'ಜಾಗತಿಕ ಸೆಟ್ಟಿಂಗ್‌ಗಳು','Global styles.'=>'ಜಾಗತಿಕ ಶೈಲಿಗಳು.','ID of global styles config.'=>'ಜಾಗತಿಕ ಶೈಲಿಗಳ ಸಂರಚನೆಯ ID.','No global styles config exist with that id.'=>'ಆ ಐಡಿಯೊಂದಿಗೆ ಯಾವುದೇ ಜಾಗತಿಕ ಶೈಲಿಗಳ ಸಂರಚನೆಯು ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Sorry, you are not allowed to view this global style.'=>'ಕ್ಷಮಿಸಿ, ಈ ಜಾಗತಿಕ ಶೈಲಿಯನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','Sorry, you are not allowed to edit this global style.'=>'ಕ್ಷಮಿಸಿ, ಈ ಜಾಗತಿಕ ಶೈಲಿಯನ್ನು ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','The theme identifier'=>'ಥೀಮ್ ಗುರುತಿಸುವಿಕೆ','Sorry, you are not allowed to export templates and template parts.'=>'ಕ್ಷಮಿಸಿ, ಟೆಂಪ್ಲೇಟ್‌ಗಳು ಮತ್ತು ಟೆಂಪ್ಲೇಟ್ ಭಾಗಗಳನ್ನು ರಫ್ತು ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿಯಿಲ್ಲ.','Public facing and editor style handles.'=>'ಸಾರ್ವಜನಿಕ ಮುಖ ಮತ್ತು ಸಂಪಾದಕ ಶೈಲಿಯ ಹ್ಯಾಂಡಲ್.','Public facing and editor script handles.'=>'ಸಾರ್ವಜನಿಕ ಮುಖ ಮತ್ತು ಸಂಪಾದಕ ಸ್ಕ್ರಿಪ್ಟ್ ಹ್ಯಾಂಡಲ್.','The date when the block was last updated.'=>'ಬ್ಲಾಕ್ ಅನ್ನು ಕೊನೆಯದಾಗಿ ನವೀಕರಿಸಿದ ದಿನಾಂಕ.','file type groupVideo'=>'ವಿಡಿಯೋ','file type groupAudio'=>'ಆಡಿಯೋ','Navigation menus that can be inserted into your site.'=>'ನಿಮ್ಮ ಸೈಟ್‌ಗೆ ಸೇರಿಸಬಹುದಾದ ನ್ಯಾವಿಗೇಷನ್ ಮೆನುಗಳು.','Navigation Menus list'=>'ನ್ಯಾವಿಗೇಶನ್ ಮೆನುಗಳ ಪಟ್ಟಿ','Navigation Menus list navigation'=>'ನ್ಯಾವಿಗೇಷನ್ ಮೆನುಗಳ ಪಟ್ಟಿ ನ್ಯಾವಿಗೇಷನ್','Filter Navigation Menu list'=>'ನ್ಯಾವಿಗೇಶನ್ ಮೆನು ಪಟ್ಟಿಯನ್ನು ಫಿಲ್ಟರ್ ಮಾಡಿ','Uploaded to this Navigation Menu'=>'ಈ ನ್ಯಾವಿಗೇಶನ್ ಮೆನುಗೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ','Insert into Navigation Menu'=>'ನ್ಯಾವಿಗೇಶನ್ ಮೆನುವಿನಲ್ಲಿ ಸೇರಿಸಿ','Navigation Menu archives'=>'ನ್ಯಾವಿಗೇಷನ್ ಮೆನು ಆರ್ಕೈವ್ಸ್','No Navigation Menu found in Trash.'=>'ಅನುಪಯುಕ್ತದಲ್ಲಿ ಯಾವುದೇ ನ್ಯಾವಿಗೇಷನ್ ಮೆನು ಕಂಡುಬಂದಿಲ್ಲ.','No Navigation Menu found.'=>'ಯಾವುದೇ ನ್ಯಾವಿಗೇಷನ್ ಮೆನು ಕಂಡುಬಂದಿಲ್ಲ.','Parent Navigation Menu:'=>'ಪೋಷಕ ನ್ಯಾವಿಗೇಷನ್ ಮೆನು:','Search Navigation Menus'=>'ಹುಡುಕಾಟ ನ್ಯಾವಿಗೇಷನ್ ಮೆನುಗಳು','View Navigation Menu'=>'ನ್ಯಾವಿಗೇಷನ್ ಮೆನು ವೀಕ್ಷಿಸಿ','Edit Navigation Menu'=>'ನ್ಯಾವಿಗೇಶನ್ ಮೆನು ಸಂಪಾದಿಸಿ','New Navigation Menu'=>'ಹೊಸ ನ್ಯಾವಿಗೇಷನ್ ಮೆನು','Add New Navigation Menu'=>'ಹೊಸ ನ್ಯಾವಿಗೇಷನ್ ಮೆನು ಸೇರಿಸಿ','post type s