nameIndex'=>'ಸೂಚ್ಯಂಕ','The Footer template defines a page area that typically contains site credits, social links, or any other combination of blocks.'=>'ಅಡಿಟಿಪ್ಪಣಿ ಟೆಂಪ್ಲೇಟ್ ಸಾಮಾನ್ಯವಾಗಿ ಸೈಟ್ ಕ್ರೆಡಿಟ್‌ಗಳು, ಸಾಮಾಜಿಕ ಲಿಂಕ್‌ಗಳು ಅಥವಾ ಬ್ಲಾಕ್‌ಗಳ ಯಾವುದೇ ಸಂಯೋಜನೆಯನ್ನು ಒಳಗೊಂಡಿರುವ ಪುಟ ಪ್ರದೇಶವನ್ನು ವ್ಯಾಖ್ಯಾನಿಸುತ್ತದೆ.','The Header template defines a page area that typically contains a title, logo, and main navigation.'=>'ಶಿರೋಲೇಖ ಟೆಂಪ್ಲೇಟ್ ಸಾಮಾನ್ಯವಾಗಿ ಶೀರ್ಷಿಕೆ, ಲೋಗೋ ಮತ್ತು ಮುಖ್ಯ ನ್ಯಾವಿಗೇಶನ್ ಅನ್ನು ಒಳಗೊಂಡಿರುವ ಪುಟದ ಪ್ರದೇಶವನ್ನು ವ್ಯಾಖ್ಯಾನಿಸುತ್ತದೆ.','General templates often perform a specific role like displaying post content, and are not tied to any particular area.'=>'ಸಾಮಾನ್ಯ ಟೆಂಪ್ಲೇಟ್‌ಗಳು ಸಾಮಾನ್ಯವಾಗಿ ಪೋಸ್ಟ್ ವಿಷಯವನ್ನು ಪ್ರದರ್ಶಿಸುವಂತಹ ನಿರ್ದಿಷ್ಟ ಪಾತ್ರವನ್ನು ನಿರ್ವಹಿಸುತ್ತವೆ ಮತ್ತು ಯಾವುದೇ ನಿರ್ದಿಷ್ಟ ಪ್ರದೇಶಕ್ಕೆ ಸಂಬಂಧಿಸಿರುವುದಿಲ್ಲ.','Edit site'=>'ಸೈಟ್ ಸಂಪಾದಿಸಿ','Previous Page'=>'ಹಿಂದಿನ ಪುಟ','Next Page'=>'ಮುಂದಿನ ಪುಟ','Keyword'=>'ಕೀವರ್ಡ್','Embed of %s.'=>'%s ಎಂಬೆಡ್ ಮಾಡಿ.','PDF embed'=>'PDF ಎಂಬೆಡ್','Block pattern categoryMedia'=>'ಮಾಧ್ಯಮ','The date the comment was published, as GMT.'=>'ಕಾಮೆಂಟ್ ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ, GMT ಯಂತೆ.','block keywordlink'=>'ಕೊಂಡಿ','An alphanumeric identifier for the post unique to its type.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಐಡೆಂಟಿಫೈಯರ್ ಅದರ ಪ್ರಕಾರಕ್ಕೆ ವಿಶಿಷ್ಟವಾಗಿದೆ.','The date the post was last modified, as GMT.'=>'ಪೋಸ್ಟ್ ಅನ್ನು ಕೊನೆಯದಾಗಿ ಮಾರ್ಪಡಿಸಿದ ದಿನಾಂಕ, GMT ಯಂತೆ.','The date the post was last modified, in the site\'s timezone.'=>'ಪೋಸ್ಟ್ ಅನ್ನು ಕೊನೆಯದಾಗಿ ಮಾರ್ಪಡಿಸಿದ ದಿನಾಂಕ, ಸೈಟ್‌ನ ಸಮಯವಲಯದಲ್ಲಿ.','GUID for the post, as it exists in the database.'=>'ಪೋಸ್ಟ್‌ನ GUID, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಇರುವಂತೆ.','The date the post was published, in the site\'s timezone.'=>'ಪೋಸ್ಟ್ ಅನ್ನು ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ, ಸೈಟ್‌ನ ಸಮಯವಲಯದಲ್ಲಿ.','The ID for the parent of the comment.'=>'ಕಾಮೆಂಟ್‌ನ ಪೋಷಕರಿಗೆ ಐಡಿ.','The date the comment was published, in the site\'s timezone.'=>'ಜಾಲತಾಣದ ಸಮಯವಲಯದಲ್ಲಿ ಕಾಮೆಂಟ್ ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ.','HTML content for the comment, transformed for display.'=>'ಕಾಮೆಂಟ್‌ಗಾಗಿ HTML ವಿಷಯ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','Content for the comment, as it exists in the database.'=>'ಕಾಮೆಂಟ್‌ಗಾಗಿ ವಿಷಯ, ಏಕೆಂದರೆ ಇದು ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ.','The content for the comment.'=>'ಕಾಮೆಂಟ್‌ಗಾಗಿ ವಿಷಯ.','The ID for the parent of the autosave.'=>'ಆಟೋಸೇವ್‌ನ ಪೋಷಕರಿಗೆ ಐಡಿ.','block keywordmovie'=>'ಚಲನಚಿತ್ರ','block descriptionEmbed a video from your media library or upload a new one.'=>'ನಿಮ್ಮ ಮಾಧ್ಯಮ ಲೈಬ್ರರಿಯಿಂದ ವೀಡಿಯೊವನ್ನು ಎಂಬೆಡ್ ಮಾಡಿ ಅಥವಾ ಹೊಸದನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಿ.','block keywordpoem'=>'ಕವಿತೆ','block keywordpoetry'=>'ಕವಿತೆ','block descriptionInsert poetry. Use special spacing formats. Or quote song lyrics.'=>'ಕಾವ್ಯವನ್ನು ಸೇರಿಸಿ. ವಿಶೇಷ ಅಂತರದ ಸ್ವರೂಪಗಳನ್ನು ಬಳಸಿ. ಅಥವಾ ಹಾಡಿನ ಸಾಹಿತ್ಯವನ್ನು ಉಲ್ಲೇಖಿಸಿ.','block descriptionThis block is deprecated. Please use the Columns block instead.'=>'ಈ ಬ್ಲಾಕ್ ಅನ್ನು ಅಸಮ್ಮತಿಸಲಾಗಿದೆ. ದಯವಿಟ್ಟು ಬದಲಿಗೆ ಕಾಲಮ್ ಬ್ಲಾಕ್ ಅನ್ನು ಬಳಸಿ.','block style labelStripes'=>'ಪಟ್ಟೆಗಳು','block descriptionAdd white space between blocks and customize its height.'=>'ಬ್ಲಾಕ್‌ಗಳ ನಡುವೆ ಬಿಳಿ ಜಾಗವನ್ನು ಸೇರಿಸಿ ಮತ್ತು ಅದರ ಎತ್ತರವನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡಿ.','block style labelPill Shape'=>'ಮಾತ್ರೆ ಆಕಾರ','block style labelLogos Only'=>'ಲೋಗೋಗಳು ಮಾತ್ರ','block descriptionDisplay icons linking to your social profiles or sites.'=>'ನಿಮ್ಮ ಸಾಮಾಜಿಕ ಮಾಧ್ಯಮ ಪ್ರೊಫೈಲ್‌ಗಳು ಅಥವಾ ವೆಬ್‌ಸೈಟ್‌ಗಳಿಗೆ ಲಿಂಕ್ ಮಾಡುವ ಐಕಾನ್‌ಗಳನ್ನು ಪ್ರದರ್ಶಿಸಿ.','block descriptionDisplay an icon linking to a social profile or site.'=>'ಸಾಮಾಜಿಕ ಮಾಧ್ಯಮ ಪ್ರೊಫೈಲ್ ಅಥವಾ ವೆಬ್‌ಸೈಟ್‌ಗೆ ಲಿಂಕ್ ಮಾಡುವ ಐಕಾನ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸಿ.','block titleSite Title'=>'ಜಾಲತಾಣದ ಶೀರ್ಷಿಕೆ','block keyworddescription'=>'ವಿವರಣೆ','block descriptionDescribe in a few words what the site is about. The tagline can be used in search results or when sharing on social networks even if it’s not displayed in the theme design.'=>'ವೆಬ್‌ಸೈಟ್ ಏನೆಂದು ಕೆಲವು ಪದಗಳಲ್ಲಿ ವಿವರಿಸಿ. ಟ್ಯಾಗ್‌ಲೈನ್ ಅನ್ನು ಹುಡುಕಾಟ ಫಲಿತಾಂಶಗಳಲ್ಲಿ ಅಥವಾ ಸಾಮಾಜಿಕ ಜಾಲತಾಣಗಳಲ್ಲಿ ಹಂಚಿಕೊಳ್ಳುವಾಗ ಅದನ್ನು ಥೀಮ್ ವಿನ್ಯಾಸದಲ್ಲಿ ಪ್ರದರ್ಶಿಸದಿದ್ದರೂ ಬಳಸಬಹುದು.','block titleSite Tagline'=>'ಜಾಲತಾಣದ ಅಡಿಬರಹ','block titleSite Logo'=>'ಸೈಟ್ ಲೋಗೋ','block descriptionI