ಿನಂತಿಸಿ.','<strong>Error:</strong> Your password reset link appears to be invalid. Please request a new link below.'=>'<strong>ದೋಷ:</strong> ನಿಮ್ಮ ಪಾಸ್‌ವರ್ಡ್ ಮರುಹೊಂದಿಸುವ ಲಿಂಕ್ ಅಮಾನ್ಯವಾಗಿರುವಂತೆ ತೋರುತ್ತಿದೆ. ದಯವಿಟ್ಟು ಕೆಳಗಿನ ಹೊಸ ಲಿಂಕ್ ಅನ್ನು ವಿನಂತಿಸಿ.','Block HTML:'=>'ಬ್ಲಾಕ್ HTML:','A widget containing a block.'=>'ಬ್ಲಾಕ್ ಹೊಂದಿರುವ ವಿಜೆಟ್.','%1$s or %2$s'=>'%1$s or %2$s','<strong>Error:</strong> Unknown username. Check again or try your email address.'=>'<strong>ದೋಷ:</strong> ಅಜ್ಞಾತ ಬಳಕೆದಾರ ಹೆಸರು. ಮತ್ತೊಮ್ಮೆ ಪರಿಶೀಲಿಸಿ ಅಥವಾ ನಿಮ್ಮ ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ಪ್ರಯತ್ನಿಸಿ.','<strong>Error:</strong> Unknown email address. Check again or try your username.'=>'<strong>ದೋಷ:</strong> ಅಜ್ಞಾತ ಇಮೇಲ್ ವಿಳಾಸ. ಮತ್ತೊಮ್ಮೆ ಪರಿಶೀಲಿಸಿ ಅಥವಾ ನಿಮ್ಮ ಬಳಕೆದಾರ ಹೆಸರನ್ನು ಪ್ರಯತ್ನಿಸಿ.','<strong>Error:</strong> The username <strong>%s</strong> is not registered on this site. If you are unsure of your username, try your email address instead.'=>'<strong>ದೋಷ:</strong> ಬಳಕೆದಾರಹೆಸರು <strong>%s</strong> ಈ ಸೈಟ್‌ನಲ್ಲಿ ನೋಂದಾಯಿಸಲಾಗಿಲ್ಲ. ನಿಮ್ಮ ಬಳಕೆದಾರಹೆಸರು ನಿಮಗೆ ಖಚಿತವಿಲ್ಲದಿದ್ದರೆ, ಬದಲಿಗೆ ನಿಮ್ಮ ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ಪ್ರಯತ್ನಿಸಿ.','navigation link block descriptionA link to a category.'=>'ಒಂದು ವರ್ಗಕ್ಕೆ ಲಿಂಕ್.','navigation link block descriptionA link to a tag.'=>'ಟ್ಯಾಗ್‌ಗೆ ಲಿಂಕ್.','navigation link block titleCategory Link'=>'ವರ್ಗ ಲಿಂಕ್','navigation link block titleTag Link'=>'ಟ್ಯಾಗ್ ಲಿಂಕ್','This image cannot be processed by the web server. Convert it to JPEG or PNG before uploading.'=>'ಈ ಚಿತ್ರವನ್ನು ವೆಬ್ ಸರ್ವರ್ ಮೂಲಕ ಪ್ರಕ್ರಿಯೆಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ಅಪ್‌ಲೋಡ್ ಮಾಡುವ ಮೊದಲು ಅದನ್ನು JPEG ಅಥವಾ PNG ಗೆ ಪರಿವರ್ತಿಸಿ.','URL-encoded form data from the widget admin form. Used to update a widget that does not support instance. Write only.'=>'ವಿಜೆಟ್ ನಿರ್ವಾಹಕ ರೂಪದಿಂದ URL- ಎನ್ಕೋಡ್ ಮಾಡಿದ ಫಾರ್ಮ್ ಡೇಟಾ. ಉದಾಹರಣೆಯನ್ನು ಬೆಂಬಲಿಸದ ವಿಜೆಟ್ ಅನ್ನು ನವೀಕರಿಸಲು ಬಳಸಲಾಗುತ್ತದೆ. ಬರೆಯಲು ಮಾತ್ರ.','Unencoded instance settings, if supported.'=>'ಬೆಂಬಲಿತವಾಗಿದ್ದರೆ ಎನ್ಕೋಡ್ ಮಾಡದಿರುವ ನಿದರ್ಶನ ಸೆಟ್ಟಿಂಗ್ಗಳು.','Cryptographic hash of the instance settings.'=>'ನಿದರ್ಶನ ಸೆಟ್ಟಿಂಗ್‌ಗಳ ಕ್ರಿಪ್ಟೋಗ್ರಾಫಿಕ್ ಹ್ಯಾಶ್.','Base64 encoded representation of the instance settings.'=>'ಉದಾಹರಣೆ ಸೆಟ್ಟಿಂಗ್‌ಗಳ ಬೇಸ್ 64 ಎನ್‌ಕೋಡೆಡ್ ಪ್ರಾತಿನಿಧ್ಯ.','Instance settings of the widget, if supported.'=>'ವಿಜೆಟ್ನ ಸಾಂದರ್ಬಿಕ ಸೆಟ್ಟಿಂಗ್ಗಳು, ಬೆಂಬಲಿತವಾಗಿದ್ದರೆ.','HTML representation of the widget admin form.'=>'ವಿಜೆಟ್ ನಿರ್ವಾಹಕ ರೂಪದ HTML ಪ್ರಾತಿನಿಧ್ಯ.','HTML representation of the widget.'=>'ವಿಜೆಟ್ನ HTML ಪ್ರಾತಿನಿಧ್ಯ.','The sidebar the widget belongs to.'=>'ಸೈಡ್‌ಬಾರ್ ವಿಜೆಟ್ ಸೇರಿದೆ.','The type of the widget. Corresponds to ID in widget-types endpoint.'=>'ವಿಜೆಟ್-ರೀತಿಯ ಅಂತ್ಯಬಿಂದು.','Unique identifier for the widget.'=>'ವಿಜೆಟ್‌ಗಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','The sidebar to return widgets for.'=>'ವಿಜೆಟ್‌ಗಳನ್ನು ಹಿಂದಿರುಗಿಸಲು ಸೈಡ್‌ಬಾರ್.','The requested widget is invalid.'=>'ವಿನಂತಿಸಿದ ವಿಜೆಟ್ ಅಮಾನ್ಯವಾಗಿದೆ.','The provided instance is invalid. Must contain raw OR encoded and hash.'=>'ಒದಗಿಸಿದ ಉದಾಹರಣೆಯು ಅಮಾನ್ಯವಾಗಿದೆ. ಕಚ್ಚಾ ಅಥವಾ ಎನ್ಕೋಡ್ ಮತ್ತು ಹ್ಯಾಶ್ ಹೊಂದಿರಬೇಕು.','Widget type does not support raw instances.'=>'ವಿಜೆಟ್ ಪ್ರಕಾರವು ಕಚ್ಚಾ ನಿದರ್ಶನಗಳನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','Cannot set instance on a widget that does not extend WP_Widget.'=>'WP_Widget ಅನ್ನು ವಿಸ್ತರಿಸದ ವಿಜೆಟ್‌ನಲ್ಲಿ ನಿದರ್ಶನವನ್ನು ಹೊಂದಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','The provided widget type (id_base) cannot be updated.'=>'ಒದಗಿಸಿದ ವಿಜೆಟ್ ಪ್ರಕಾರವನ್ನು (id_base) ನವೀಕರಿಸಲಾಗುವುದಿಲ್ಲ.','Widget type (id_base) is required.'=>'ವಿಜೆಟ್ ಪ್ರಕಾರ (id_base) ಅಗತ್ಯವಿದೆ.','No widget was found with that id.'=>'ಆ ಐಡಿಯೊಂದಿಗೆ ಯಾವುದೇ ವಿಜೆಟ್ ಕಂಡುಬಂದಿಲ್ಲ.','Whether to force removal of the widget, or move it to the inactive sidebar.'=>'ವಿಜೆಟ್ ಅನ್ನು ತೆಗೆದುಹಾಕಲು ಒತ್ತಾಯಿಸಬೇಕೇ ಅಥವಾ ನಿಷ್ಕ್ರಿಯ ಸೈಡ್‌ಬಾರ್‌ಗೆ ಸರಿಸಬೇಕೆ.','The provided instance is malformed.'=>'ಒದಗಿಸಿದ ಉದಾಹರಣೆಯು ತಪ್ಪಾಗಿದೆ.','Cannot preview a widget that does not extend WP_Widget.'=>'WP_Widget ಅನ್ನು ವಿಸ್ತರಿಸದ ವಿಜೆಟ್ ಅನ್ನು ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ.','Class name'=>'ಕ್ಲಾಸ್ ನ ಹೆಸರು ','Whether the widget supports multiple instances'=>'ವಿಜೆಟ್ ಬಹು ನಿದರ್ಶನಗಳನ್ನು ಬೆಂಬಲಿಸುತ್ತದೆಯೇ','Description of the widget.'=>'ವಿಜೆಟ್ ವಿವರಣೆ.','Human-readable name identifying the widget type.'=>'ವಿಜೆಟ್ ಪ್ರಕಾರವನ್ನು ಗುರುತಿಸುವ ಮಾನವ-ಓದಬಲ್ಲ ಹೆಸರು.','Unique slug identifying the widget type.'=>'ವಿಜೆಟ್ ಪ್ರಕಾರವನ್ನು ಗುರುತಿಸುವ ವಿಶಿಷ್ಟ ಸ್ಲಗ್.','Invalid widget type.'=>'ಅಮಾನ್ಯವಾದ ವಿಜೆಟ್ ಪ್ರಕಾರ.','Serialized widget form data to encode into instance settings.'=>'ನಿದರ್ಶನ ಸೆಟ್ಟಿಂಗ್‌ಗಳಿಗೆ ಎನ್ಕೋಡ್ ಮಾಡಲು ಸರಣಿಗೊಳಿಸಿದ ವಿಜೆಟ್ ಫಾರ್ಮ್ ಡೇಟಾ.','Current instance settings of the widget.'=>'ವಿಜೆಟ್‌ನ ಪ್ರಸ್ತುತ ನಿದರ್ಶನ ಸೆಟ್ಟಿಂಗ್‌ಗಳು.','The widget type id.'=>'ವಿಜೆಟ್ ಪ್ರಕಾರದ ಐಡಿ.','Sort collection by user attribute.'=>'ಬಳಕೆದಾರ ಗುಣಲಕ್ಷಣದಿಂದ ಸಂಗ್ರಹವನ್ನು ವಿಂಗಡಿಸಿ.','Theme file exists.'=>'ಥೀಮ್ ಫೈಲ್ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ.','Post ID.'=>'ಪೋಸ್ಟ್ ಐಡಿ.','Status of template.'=>'ಟೆಂಪ್ಲೇಟ್‌ನ ಸ್ಥಿತಿ.','Description of template.'=>'ಟೆಂಪ್ಲೇಟ್ ವಿವರಣೆ.','Title of template.'=>'ಟೆಂಪ್ಲೇಟ್ ಶೀರ್ಷಿಕೆ.','Content of template.'=>'ಟೆಂಪ್ಲೇಟ್‌ನ ವಿಷಯ.','Source of template'=>'ಟೆಂಪ್ಲೇಟ್ ಮೂಲ','Theme identifier for the template.'=>'ಟೆಂಪ್ಲೇಟ್‌ಗಾಗಿ ಥೀಮ್ ಗುರುತಿಸುವಿಕೆ.','Unique slug identifying the template.'=>'ಟೆಂಪ್ಲೇಟ್ ಅನ್ನು ಗುರುತಿಸುವ ವಿಶಿಷ್ಟ ಸ್ಲಗ್.','ID of template.'=>'ಟೆಂಪ್ಲೇಟ್‌ನ ID.','Limit to the specified post id.'=>'ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ಪೋಸ್ಟ್ ಐಡಿಗೆ ಮಿತಿಗೊಳಿಸಿ.','The template has already been deleted.'=>'ಟೆಂಪ್ಲೇಟ್ ಅನ್ನು ಈಗಾಗಲೇ ಅಳಿಸಲಾಗಿದೆ.','Templates based on theme files can\'t be removed.'=>'ಥೀಮ್ ಫೈಲ್‌ಗಳನ್ನು ಆಧರಿಸಿದ ಟೆಂಪ್ಲೇಟ್‌ಗಳನ್ನು ತೆಗೆದುಹಾಕಲಾಗುವುದಿಲ್ಲ.','No templates exist with that id.'=>'ಆ ಐಡಿಯೊಂದಿಗೆ ಯಾವುದೇ ಟೆಂಪ್ಲೇಟ್‌ಗಳು ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Sorry, you are not allowed to access the templates on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ಟೆಂಪ್ಲೇಟ್‌ಗಳನ್ನು ಪ್ರವೇಶಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The id of a template'=>'ಟೆಂಪ್ಲೇಟ್‌ನ ಐಡಿ','Nested widgets.'=>'ನೆಸ್ಟೆಡ್ ವಿಜೆಟ್‌ಗಳು.','Status of sidebar.'=>'ಸೈಡ್‌ಬಾರ್‌ನ ಸ್ಥಿತಿ.','HTML content to append to the sidebar title when displayed. Default is a closing h2 element.'=>'ಪ್ರದರ್ಶಿಸಿದಾಗ ಸೈಡ್‌ಬಾರ್ ಶೀರ್ಷಿಕೆಗೆ ಸೇರಿಸಲು HTML ವಿಷಯ. ಡೀಫಾಲ್ಟ್ ಒಂದು ಮುಚ್ಚುವ h2 ಅಂಶವಾಗಿದೆ.','HTML content to prepend to the sidebar title when displayed. Default is an opening h2 element.'=>'ಪ್ರದರ್ಶಿಸಿದಾಗ ಸೈಡ್‌ಬಾರ್ ಶೀರ್ಷಿಕೆಗೆ ಅನುಗುಣವಾಗಿ HTML ವಿಷಯ. ಡೀಫಾಲ್ಟ್ ಒಂದು ಆರಂಭಿಕ h2 ಅಂಶವಾಗಿದೆ.','HTML content to append to each widget\'s HTML output when assigned to this sidebar. Default is a closing list item element.'=>'ಈ ಸೈಡ್‌ಬಾರ್‌ಗೆ ನಿಯೋಜಿಸಿದಾಗ ಪ್ರತಿ ವಿಜೆಟ್‌ನ HTML ಔಟ್‌ಪುಟ್‌ಗೆ ಸೇರಿಸಲು HTML ವಿಷಯ. ಡೀಫಾಲ್ಟ್ ಒಂದು ಮುಚ್ಚುವ ಪಟ್ಟಿ ಐಟಂ ಅಂಶವಾಗಿದೆ.','HTML content to prepend to each widget\'s HTML output when assigned to this sidebar. Default is an opening list item element.'=>'ಈ ಸೈಡ್‌ಬಾರ್‌ಗೆ ನಿಯೋಜಿಸಿದಾಗ ಪ್ರತಿ ವಿಜೆಟ್‌ನ HTML ಔಟ್‌ಪುಟ್‌ಗೆ ಪೂರ್ವಭಾವಿಯಾಗಿ HTML ವಿಷಯ. ಡೀಫಾಲ್ಟ್ ಒಂದು ಆರಂಭಿಕ ಪಟ್ಟಿ ಐಟಂ ಅಂಶವಾಗಿದೆ.','Extra CSS class to assign to the sidebar in the Widgets interface.'=>'ವಿಜೆಟ್‌ಗಳ ಇಂಟರ್‌ಫೇಸ್‌ನಲ್ಲಿ ಸೈಡ್‌ಬಾರ್‌ಗೆ ನಿಯೋಜಿಸಲು ಹೆಚ್ಚುವರಿ CSS ವರ್ಗ.','Description of sidebar.'=>'ಸೈಡ್‌ಬಾರ್‌ನ ವಿವರಣೆ.','Unique name identifying the sidebar.'=>'ಸೈಡ್‌ಬಾರ್ ಅನ್ನು ಗುರುತಿಸುವ ವಿಶಿಷ್ಟ ಹೆಸರು.','ID of sidebar.'=>'ಸೈಡ್‌ಬಾರ್‌ನ ID.','Inactive widgets'=>'ನಿಷ್ಕ್ರಿಯ ವಿಜೆಟ್‌ಗಳು','Sorry, you are not allowed to manage widgets on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ವಿಜೆಟ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','No sidebar exists with that id.'=>'ಆ ಐಡಿಯೊಂದಿಗೆ ಯಾವುದೇ ಸೈಡ್‌ಬಾರ್ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','The id of a registered sidebar'=>'ನೋಂದಾಯಿತ ಸೈಡ್‌ಬಾರ್‌ನ ಐಡಿ','The ID for the author of the revision.'=>'ಪರಿಷ್ಕರಣೆಯ ಲೇಖಕರಿಗೆ ID','Unique identifier for the revision.'=>'ಪರಿಷ್ಕರಣೆಗಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','Whether items must be assigned all or any of the specified terms.'=>'ಐಟಂಗಳನ್ನು ಎಲ್ಲವೂ ಅಥವಾ ಯಾವುದೇ ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ನಿಯಮಗಳಿಗೆ ಮಾತ್ರ ನಿಯೋಜಿಸಬೇಕೆ.','Sort collection by post attribute.'=>'ಪೋಸ್ಟ್ ಗುಣಲಕ್ಷಣದ ಮೂಲಕ ಸಂಗ್ರಹವನ್ನು ವಿಂಗಡಿಸಿ.','The order of the post in relation to other posts.'=>'ಇತರ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ಸಂಬಂಧಿಸಿದಂತೆ ಪೋಸ್ಟ್‌ನ ಪಾಳಿ.','The title for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ಶೀರ್ಷಿಕೆ.','Type of post.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರ.','URL to the post.'=>'ಪೋಸ್ಟ್‌ಗೆ URL','Unique identifier for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','Limit results to those matching a keyword ID.'=>'ಕೀವರ್ಡ್ ID ಗೆ ಹೊಂದುವವರಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Limit results to those matching 