್ಟ್ಯಾಂಪ್ ಮಾನ್ಯ Unix ಟೈಮ್‌ಸ್ಟ್ಯಾಂಪ್ ಆಗಿರಬೇಕು.','As a percentage of the image, the height to crop the image to. DEPRECATED: Use `modifiers` instead.'=>'ಚಿತ್ರದ ಶೇಕಡಾವಾರು, ಚಿತ್ರವನ್ನು ಕ್ರಾಪ್ ಮಾಡಲು ಎತ್ತರ. ನಿರಾಕರಿಸಲಾಗಿದೆ: ಬದಲಾಗಿ `ಮಾರ್ಪಾಡುಗಳನ್ನು` ಬಳಸಿ.','As a percentage of the image, the width to crop the image to. DEPRECATED: Use `modifiers` instead.'=>'ಚಿತ್ರದ ಶೇಕಡಾವಾರು, ಅಗಲವು ಚಿತ್ರವನ್ನು ಕ್ರಾಪ್ ಮಾಡಲು. ನಿರಾಕರಿಸಲಾಗಿದೆ: ಬದಲಾಗಿ `ಮಾರ್ಪಾಡುಗಳನ್ನು` ಬಳಸಿ','As a percentage of the image, the y position to start the crop from. DEPRECATED: Use `modifiers` instead.'=>'ಚಿತ್ರದ ಶೇಕಡಾವಾರು, y ಸ್ಥಾನದಿಂದ ಕ್ರಾಪ್ ಆರಂಭಿಸಲು. ನಿರಾಕರಿಸಲಾಗಿದೆ: ಬದಲಾಗಿ`ಮಾರ್ಪಾಡುಗಳನ್ನು` ಬಳಸಿ.','As a percentage of the image, the x position to start the crop from. DEPRECATED: Use `modifiers` instead.'=>'ಚಿತ್ರದ ಶೇಕಡಾವಾರು, ಕ್ರಾಪ್ ಆರಂಭಿಸಲು x ಸ್ಥಾನ. ನಿರಾಕರಿಸಲಾಗಿದೆ: ಬದಲಾಗಿ `ಮಾರ್ಪಾಡುಗಳನ್ನು` ಬಳಸಿ.','The amount to rotate the image clockwise in degrees. DEPRECATED: Use `modifiers` instead.'=>'ಚಿತ್ರವನ್ನು ಪ್ರದಕ್ಷಿಣಾಕಾರವಾಗಿ ಡಿಗ್ರಿಗಳಲ್ಲಿ ತಿರುಗಿಸುವ ಮೊತ್ತ. ನಿರಾಕರಿಸಲಾಗಿದೆ: ಬದಲಾಗಿ `ಮಾರ್ಪಾಡುಗಳನ್ನು` ಬಳಸಿ.','Height of the crop as a percentage of the image height.'=>'ಚಿತ್ರದ ಎತ್ತರಕ್ಕೆ ಶೇಕಡಾವಾರು ಕ್ರಾಪ್ ಎತ್ತರ.','Width of the crop as a percentage of the image width.'=>'ಚಿತ್ರದ ಅಗಲದ ಶೇಕಡಾವಾರು ಕ್ರಾಪ್ ಅಗಲ.','Vertical position from the top to begin the crop as a percentage of the image height.'=>'ಚಿತ್ರದ ಎತ್ತರದ ಶೇಕಡಾವಾರು ಕ್ರಾಪ್ ಪ್ರಾರಂಭಿಸಲು ಮೇಲಿನಿಂದ ಲಂಬವಾದ ಸ್ಥಾನ.','Horizontal position from the left to begin the crop as a percentage of the image width.'=>'ಚಿತ್ರದ ಅಗಲದ ಶೇಕಡಾವಾರು ಕ್ರಾಪ್ ಮಾಡಲು ಎಡದಿಂದ ಅಡ್ಡ ಸ್ಥಾನ.','Crop arguments.'=>'ಕ್ರಾಪ್ ವಾದಗಳು.','Crop type.'=>'ಕ್ರಾಪ್ ಪ್ರಕಾರ.','Angle to rotate clockwise in degrees.'=>'ಡಿಗ್ರಿಗಳಲ್ಲಿ ಪ್ರದಕ್ಷಿಣಾಕಾರವಾಗಿ ತಿರುಗಲು ಕೋನ.','Rotation arguments.'=>'ತಿರುಗುವಿಕೆ ವಾದಗಳು.','Rotation type.'=>'ತಿರುಗುವಿಕೆಯ ಪ್ರಕಾರ.','Rotation'=>'ಸುತ್ತುವಿಕೆ ','Image edit.'=>'ಚಿತ್ರ ಸಂಪಾದನೆ.','Array of image edits.'=>'ಚಿತ್ರ ಸಂಪಾದನೆಗಳ ಅರೇ.','Cannot introspect application password.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಆತ್ಮಾವಲೋಕನ ಮಾಡಲಾಗುವುದಿಲ್ಲ','The authenticated application password can only be introspected for the current user.'=>'ದೃಢೀಕರಿಸಿದ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಪ್ರಸ್ತುತ ಬಳಕೆದಾರನಿಗೆ ಮಾತ್ರ ಆತ್ಮಾವಲೋಕನ ಮಾಡಿಕೊಳ್ಳಬಹುದು.','Sorry, you are not allowed to delete this application password.'=>'ಕ್ಷಮಿಸಿ, ಈ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to delete application passwords for this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರರಿಗಾಗಿ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to edit this application password.'=>'ಕ್ಷಮಿಸಿ, ಈ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to create application passwords for this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರರಿಗಾಗಿ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳನ್ನು ರಚಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to read this application password.'=>'ಕ್ಷಮಿಸಿ, ಈ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಓದಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to list application passwords for this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರರಿಗಾಗಿ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳನ್ನು ಪಟ್ಟಿ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Limit result set to items with specific terms assigned in the %s taxonomy.'=>'%s ಟ್ಯಾಕ್ಸಾನಮಿಯಲ್ಲಿ ನಿಗದಿಪಡಿಸಲಾದ ನಿರ್ದಿಷ್ಟ ಪದಗಳೊಂದಿಗೆ ಐಟಂಗಳಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Whether to include child terms in the terms limiting the result set.'=>'ಫಲಿತಾಂಶವನ್ನು ಸೀಮಿತಗೊಳಿಸುವ ನಿಯಮಗಳಲ್ಲಿ ಚೈಲ್ಡ್ ನಿಯಮಗಳನ್ನು ಸೇರಿಸಬೇಕೆ.','Term IDs.'=>'ಅವಧಿ ಐಡಿಗಳು.','Perform an advanced term query.'=>'ಸುಧಾರಿತ ಪದದ ಪ್ರಶ್ನೆಯನ್ನು ನಿರ್ವಹಿಸಿ.','Term ID Taxonomy Query'=>'ಟರ್ಮ್ ID ಟ್ಯಾಕ್ಸಾನಮಿ ಪ್ರಶ್ನೆ','Match terms with the listed IDs.'=>'ಪಟ್ಟಿ ಮಾಡಲಾದ ID ಗಳೊಂದಿಗೆ ಟರ್ಮ್ಸ್ ಅನ್ನು ಹೊಂದಿಸಿ.','Term ID List'=>'ಟರ್ಮ್ ID ಪಟ್ಟಿ','Limit response to posts modified before a given ISO8601 compliant date.'=>'ನೀಡಿದ ISO8601 ಅನುಸರಣಾ ದಿನಾಂಕದ ಮೊದಲು ಮಾರ್ಪಡಿಸಿದ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Limit response to posts modified after a given ISO8601 compliant date.'=>'ನೀಡಿದ ISO8601 ಅನುಸರಣೆಯ ದಿನಾಂಕದ ನಂತರ ಮಾರ್ಪಡಿಸಿದ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಮಿತಿಗೊಳಿಸಿ.','A named status for the theme.'=>'ಥೀಮ್‌ಗಾಗಿ ಹೆಸರಿಸ