ವಿಳಾಸ: %2$s
ಹೆಸರು: %3$s','[%s] New Site Created'=>'[%s] ಹೊಸ ತಾಣ ರಚನೆಯಾಗಿದೆ','%s failed while writing image to stream.'=>'%s: PHP ಫಂಕ್ಷನ್ ಹೆಸರು.','The provided password is an invalid application password.'=>'ಒದಗಿಸಲಾದ ಪಾಸ್ ವರ್ಡ್ ಒಂದು ಅಮಾನ್ಯವಾದ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ಆಗಿದೆ.','Could not delete application passwords.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ಗಳನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not delete application password.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ಅಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not find an application password with that id.'=>'ಆ ಗುರುತಿನೊಂದಿಗೆ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ಹುಡುಕಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not save application password.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ಉಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','An application name is required to create an application password.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ರಚಿಸಲು ಅಪ್ಲಿಕೇಶನ್ ಹೆಸರು ಅಗತ್ಯವಿದೆ.','Copy URL to clipboard'=>'ಕ್ಲಿಪ್ ಬೋರ್ಡ್ ಗೆ URL ನಕಲಿಸು','Used as:'=>'ಇದರಂತೆ ಬಳಸಲಾಗುತ್ತದೆ:','%1$s must be a multiple of %2$s.'=>'%1$s %2$s ನ ಗುಣಾಕಾರವಾಗಿರಬೇಕು.','%1$s must contain at most %2$s property.'=>'%1$s ಹೆಚ್ಚೆಂದರೆ %2$s ಗುಣಲಕ್ಷಣವನ್ನು ಹೊಂದಿರಬೇಕು.' . "\0" . '%1$s ಹೆಚ್ಚೆಂದರೆ %2$s ಗುಣಲಕ್ಷಣಗಳನ್ನು ಹೊಂದಿರಬೇಕು.','%1$s must contain at least %2$s property.'=>'%1$s ಕನಿಷ್ಠ %2$s ಪ್ರಾಪರ್ಟಿಗಳನ್ನು ಹೊಂದಿರಬೇಕು.' . "\0" . '%1$s ಕನಿಷ್ಠ %2$s ಗುಣಗಳನ್ನು ಹೊಂದಿರಬೇಕು.','%s matches more than one of the expected formats.'=>'%s ನಿರೀಕ್ಷಿತ ಸ್ವರೂಪಗಳಲ್ಲಿ ಒಂದಕ್ಕಿಂತ ಹೆಚ್ಚು ಹೊಂದಿಕೆಯಾಗುತ್ತದೆ.','%1$s matches %2$l, but should match only one.'=>'%1$s %2$l ಗೆ ಹೊಂದಿಕೆಯಾಗುತ್ತದೆ, ಆದರೆ ಒಂದಕ್ಕೆ ಮಾತ್ರ ಹೊಂದಿಕೆಯಾಗಬೇಕು.','%s does not match any of the expected formats.'=>'%s ಯಾವುದೇ ನಿರೀಕ್ಷಿತ ಸ್ವರೂಪಗಳಿಗೆ ಹೊಂದಿಕೆಯಾಗುವುದಿಲ್ಲ.','%1$s is not a valid %2$l.'=>'%1$s ಮಾನ್ಯ %2$l ಅಲ್ಲ.','%1$s does not match the expected format. Reason: %2$s'=>'%1$s ನಿರೀಕ್ಷಿತ ಸ್ವರೂಪಕ್ಕೆ ಹೊಂದಿಕೆಯಾಗುತ್ತಿಲ್ಲ. ಕಾರಣ: %2$s','%1$s is not a valid %2$s. Reason: %3$s'=>'%1$s ಮಾನ್ಯವಾದ %2$s ಅಲ್ಲ. ಕಾರಣ: %3$s','The IP address the application password was last used by.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಕೊನೆಯದಾಗಿ ಬಳಸಿದ IP ವಿಳಾಸ.','The GMT date the application password was last used.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಕೊನೆಯದಾಗಿ ಬಳಸಿದ GMT ದಿನಾಂಕ.','The GMT date the application password was created.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ರಚಿಸಿದ GMT ದಿನಾಂಕ.','The generated password. Only available after adding an application.'=>'ರಚಿಸಿದ ಪಾಸ್ವರ್ಡ್. ಅಪ್ಲಿಕೇಶನ್ ಅನ್ನು ಸೇರಿಸಿದ ನಂತರ ಮಾತ್ರ ಲಭ್ಯವಿದೆ.','The name of the application password.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ವರ್ಡ್ ಹೆಸರು.','A UUID provided by the application to uniquely identify it. It is recommended to use an UUID v5 with the URL or DNS namespace.'=>'ಅನನ್ಯವಾಗಿ ಗುರುತಿಸಲು ಅಪ್ಲಿಕೇಶನ್‌ನಿಂದ ಒದಗಿಸಲಾದ UUID. URL ಅಥವಾ DNS ನೇಮ್‌ಸ್ಪೇಸ್‌ನೊಂದಿಗೆ UUID v5 ಅನ್ನು ಬಳಸಲು ಶಿಫಾರಸು ಮಾಡಲಾಗಿದೆ.','The unique identifier for the application password.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಾಗಿ ಅನನ್ಯ ಗುರುತಿಸುವಿಕೆ.','Application password not found.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ ವರ್ಡ್ ಸಿಗಲಿಲ್ಲ.','Application passwords are not available for your account. Please contact the site administrator for assistance.'=>'ನಿಮ್ಮ ಖಾತೆಗೆ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳು ಲಭ್ಯವಿಲ್ಲ. ಸಹಾಯಕ್ಕಾಗಿ ದಯವಿಟ್ಟು ಸೈಟ್ ನಿರ್ವಾಹಕರನ್ನು ಸಂಪರ್ಕಿಸಿ.','Application passwords are not available.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳು ಲಭ್ಯವಿಲ್ಲ.','Sorry, you are not allowed to manage application passwords for this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರರಿಗಾಗಿ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','HTML containing an action to direct the user to where they can resolve the issue.'=>'HTML ಬಳಕೆದಾರನಿಗೆ ಸಮಸ್ಯೆಯನ್ನು ಎಲ್ಲಿ ಪರಿಹರಿಸಬಹುದು ಎಂದು ನಿರ್ದೇಶಿಸುವ ಕ್ರಿಯೆಯನ್ನು ಒಳಗೊಂಡಿದೆ.','A more descriptive explanation of what the test looks for, and why it is important for the user.'=>'ಪರೀಕ್ಷೆಯು ಏನು ಹುಡುಕುತ್ತದೆ ಮತ್ತು ಬಳಕೆದಾರರಿಗೆ ಅದು ಏಕೆ ಮುಖ್ಯವಾಗಿದೆ ಎಂಬುದರ ಕುರಿತು ಹೆಚ್ಚು ವಿವರಣಾತ್ಮಕ ವಿವರಣೆ.','The category this test is grouped in.'=>'ಈ ಪರೀಕ್ಷೆಯನ್ನು ವರ್ಗೀಕರಿಸಿದ ವರ್ಗ.','The status of the test.'=>'ಪರೀಕ್ಷೆಯ ಸ್ಥಿತಿ.','A label describing the test.'=>'ಪರೀಕ್ಷೆಯನ್ನು ವಿವರಿಸುವ ಲೇಬಲ್.','The name of the test being run.'=>'ಚಾಲನೆಯಲ್ಲಿರುವ ಪರೀಕ್ಷೆಯ ಹೆಸರು.','Directory sizes could not be returned.'=>'ಡೈರೆಕ್ಟರಿ ಗಾತ್ರಗಳನ್ನು ಹಿಂತಿರುಗಿಸಲಾಗಲಿಲ್ಲ.','Version of block API.'=>'ಬ್ಲಾಕ್ API ನ ಆವೃತ್ತಿ.','Invalid parameters.'=>'ಅಮಾನ್ಯ ಪ್ಯಾರಾಮೀಟರ್ಗಳು.','The requested route does not support batch requests.'=>'ವಿನಂತಿಸಿದ ಮಾರ್ಗವು ಬ್ಯಾಚ್ ವಿನಂತಿಗಳನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','Could not parse the path.'=>'ಮಾರ್ಗವನ್ನು ಪಾರ್ಸ್ ಮಾಡಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','The handler for the route is invalid.'=>'ಮಾರ್ಗಕ್ಕಾಗಿ ಹ್ಯಾಂಡ್ಲರ್ ಅಮಾನ್ಯವಾಗಿದೆ.','You need to pass an array of post formats.'=>'ನೀವು ಪೋಸ್ಟ್ ಫಾರ್ಮ್ಯಾಟ್‌ಗಳ ಅರೇ ಅನ್ನು ಪಾಸ್ ಮಾಡಬೇಕಾಗುತ್ತದೆ.','This password reset request originated from the IP address %s.'=>'ಈ ಪಾಸ್‌ವರ್ಡ್ ಮರುಹೊಂದಿಸುವ ವಿನಂತಿಯು IP ವಿಳಾಸ %s ನಿಂದ ಹುಟ್ಟಿಕೊಂಡಿದೆ.','Sorry, you are not allowed to comment on this post.'=>'ಈ ಲೇಖನದ ಬಗ್ಗೆ ಪ್ರತಿಕ್ರಿಯೆ ನೀಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The %s constant is no longer supported.'=>'%s ಸ್ಥಿರವನ್ನು ಇನ್ನು ಮುಂದೆ ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','There is a new version of %s available, but it does not work with your version of PHP.'=>'%s ನ ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ, ಆದರೆ ಇದು ನಿಮ್ಮ PHP ಆವೃತ್ತಿಯೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ.','There is a new version of %s available, but it does not work with your version of WordPress.'=>'%s ನ ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ, ಆದರೆ ಇದು ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿಯೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ.','There is a new version of %s available, but it does not work with your versions of WordPress and PHP.'=>'%s ನ ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ, ಆದರೆ ಇದು ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಮತ್ತು PHP ಯ ಆವೃತ್ತಿಗಳೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ.','This theme does not work with your version of PHP.'=>'ಈ ಥೀಮ್ ನಿಮ್ಮ PHP ಆವೃತ್ತಿಯೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ.','This theme does not work with your version of WordPress.'=>'ಈ ಥೀಮ್ ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿಯೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ.','<a href="%s">Learn more about updating PHP</a>.'=>'<a href="%s">PHP ನವೀಕರಿಸುವ ಬಗ್ಗೆ ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ</a>.','<a href="%s">Please update WordPress</a>.'=>'<a href="%s">ದಯವಿಟ್ಟು ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ನವೀಕರಿಸಿ</a>.','<a href="%1$s">Please update WordPress</a>, and then <a href="%2$s">learn more about updating PHP</a>.'=>'<a href="%1$s">ದಯವಿಟ್ಟು ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ನವೀಕರಿಸಿ</a>, ತದನಂತರ <a href="%2$s">PHP ನವೀಕರಿಸುವ ಕುರಿತು ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ</a>.','This theme does not work with your versions of WordPress and PHP.'=>'ಈ ಥೀಮ್ ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಮತ್ತು PHP ಆವೃತ್ತಿಗಳೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುವುದಿಲ್ಲ.','Please use %s to add new schema properties.'=>'ಹೊಸ ಸ್ಕೀಮಾ ಗುಣಲಕ್ಷಣಗಳನ್ನು ಸೇರಿಸಲು ದಯವಿಟ್ಟು %s ಬಳಸಿ.','The "%s" must be a callable function.'=>'"%s" ಒಂದು ಕರೆಯಬಹುದಾದ ಕಾರ್ಯವಾಗಿರಬೇಕು.','Unauthorized. You may remove the %s param to preview as frontend.'=>'ಅನಧಿಕೃತ. ಮುಂಭಾಗವಾಗಿ ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡಲು ನೀವು %s ಪ್ಯಾರಮ್ ಅನ್ನು ತೆಗೆದುಹಾಕಬಹುದು.','The "%1$s" option key has been renamed to "%2$s".'=>'"%1$s" ಆಯ್ಕೆ ಕೀಲಿಯನ್ನು "%2$s" ಎಂದು ಮರುಹೆಸರಿಸಲಾಗಿದೆ.','Sorry, you are not allowed to manage network plugins.'=>'ಕ್ಷಮಿಸಿ, ನೆಟ್‌ವರ್ಕ್ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The REST API route definition for %1$s is missing the required %2$s argument. For REST API routes that are intended to be public, use %3$s as the permission callback.'=>'%1$s ಉಳಿದ ಎಪಿಐ ಮಾರ್ಗ ವ್ಯಾಖ್ಯಾನವು ಅಗತ್ಯವಿರುವ %2$s ವಾದವನ್ನು ಕಾಣೆಯಾಗಿದೆ. ಸಾರ್ವಜನಿಕವಾಗಿರಲು ಉದ್ದೇಶಿಸಿರುವ ರೆಸ್ಟ್ ಎಪಿಐ ಮಾರ್ಗಗಳಿಗಾಗಿ, ಅನುಮತಿ ಕಾಲ್ ಬ್ಯಾಕ್ ಆಗಿ %3$s ಬಳಸಿ.','Could not update attachment in the database.'=>'ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಲಗತ್ತನ್ನು ನವೀಕರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Sorry, you are not allowed to activate this plugin.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','by %s'=>'%s ನಿಂದ','Menu Item'=>'ಮೆನು ವಸ್ತು','Comment'=>'ಪ್ರತಿಕ್ರಿಯೆ','Crop'=>'ಕತ್ತರಿಸಿ','Notifications'=>'ಅಧಿಸೂಚನೆಗಳು','The file URL has been copied to your clipboard'=>'ಫೈಲ್ URL ಅನ್ನು ನಿಮ್ಮ ಕ್ಲಿಪ್‌ಬೋರ್ಡ್‌ಗೆ ನಕಲಿಸಲಾಗಿದೆ','Embed Handler'=>'ಎಂಬೆಡ್ ಹ್ಯಾಂಡ್ಲರ್','Read the <a href="%s" target="_blank">Debugging a WordPress Network</a> article. Some of the suggestions there may help you figure out what went wrong.'=>'<a href="%s" target="_blank">ವರ್ಡ್ಪ್ರೆಸ್ ನೆಟ್ವರ್ಕ್ ಡೀಬಗ್ ಮಾಡುವುದು</a> ಲೇಖನವನ್ನು ಓದಿ. ಅಲ್ಲಿನ ಕೆಲವು ಸಲಹೆಗಳು ತಪ್ಪಾಗಿರುವುದನ್ನು ಕಂಡುಹಿಡಿಯಲು ನಿಮಗೆ ಸಹಾಯ ಮಾಡಬಹುದು.','Block pattern category "%s" not found.'=>'ಬ್ಲಾಕ್ ಮಾದರಿ ಪ್ಯಾಟರ್ನ್ "%s" ಕಂಡುಬಂದಿಲ್ಲ.','Block pattern category name must be a string.'=>'ಬ್ಲಾಕ್ ಪ್ಯಾಟರ್ನ್ ವರ್ಗದ ಹೆಸರು ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','Block patter