cter long.'=>'%1$s ಹೆಚ್ಚೆಂದರೆ %2$s ಅಕ್ಷರ ಉದ್ದವಿರಬೇಕು.' . "\0" . '%1$s ಹೆಚ್ಚೆಂದರೆ %2$s ಅಕ್ಷರಗಳಷ್ಟು ಉದ್ದವಿರಬೇಕು.','%1$s must be at least %2$s character long.'=>'%1$s ಕನಿಷ್ಠ %2$s ಅಕ್ಷರ ಉದ್ದವಿರಬೇಕು.' . "\0" . '%1$s ಕನಿಷ್ಠ %2$s ಅಕ್ಷರಗಳಷ್ಟು ಉದ್ದವಿರಬೇಕು.','%1$s is a required property of %2$s.'=>'%1$s ಎನ್ನುವುದು %2$s ನ ಅಗತ್ಯವಿರುವ ಆಸ್ತಿಯಾಗಿದೆ.','%s has duplicate items.'=>'%s ನಕಲಿ ಐಟಂಗಳನ್ನು ಹೊಂದಿದೆ.','%1$s must contain at most %2$s item.'=>'%1$s ಹೆಚ್ಚೆಂದರೆ %2$s ಐಟಂ ಅನ್ನು ಹೊಂದಿರಬೇಕು.' . "\0" . '%1$s ಹೆಚ್ಚೆಂದರೆ %2$s ಐಟಂಗಳನ್ನು ಹೊಂದಿರಬೇಕು.','%1$s must contain at least %2$s item.'=>'%1$s ಕನಿಷ್ಠ %2$s ಐಟಂ ಅನ್ನು ಹೊಂದಿರಬೇಕು.' . "\0" . '%1$s ಕನಿಷ್ಠ %2$s ಐಟಂಗಳನ್ನು ಹೊಂದಿರಬೇಕು.','The "type" schema keyword for %1$s can only be one of the built-in types: %2$l.'=>'%1$s ಗಾಗಿ "ಟೈಪ್" ಸ್ಕೀಮಾ ಕೀವರ್ಡ್ ಅಂತರ್ನಿರ್ಮಿತ ಪ್ರಕಾರಗಳಲ್ಲಿ ಒಂದಾಗಿರಬಹುದು: %2$l.','The "type" schema keyword for %s is required.'=>'%s ಗಾಗಿ "ಟೈಪ್" ಸ್ಕೀಮಾ ಕೀವರ್ಡ್ ಅಗತ್ಯವಿದೆ.','Cannot stabilize objects. Convert the object to an array first.'=>'ವಸ್ತುಗಳನ್ನು ಸ್ಥಿರಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ವಸ್ತುವನ್ನು ಮೊದಲು ಅರೇಯಾಗಿ ಪರಿವರ್ತಿಸಿ.','The "type" schema keyword for %1$s can only contain the built-in types: %2$l.'=>'%1$s ಗಾಗಿ "ಟೈಪ್" ಸ್ಕೀಮಾ ಕೀವರ್ಡ್ ಅಂತರ್ನಿರ್ಮಿತ ಪ್ರಕಾರಗಳನ್ನು ಮಾತ್ರ ಒಳಗೊಂಡಿರುತ್ತದೆ: %2$l.','%1$s (%2$s)'=>'%1$s (%2$s)','This notice was triggered by the %s handle.'=>'ಈ ಸೂಚನೆಯು %s ಹ್ಯಾಂಡಲ್‌ನಿಂದ ಪ್ರಚೋದಿಸಲ್ಪಟ್ಟಿದೆ.','Please consider writing more inclusive code.'=>'ದಯವಿಟ್ಟು ಹೆಚ್ಚು ಅಂತರ್ಗತ ಕೋಡ್ ಬರೆಯುವುದನ್ನು ಪರಿಗಣಿಸಿ.','URL to the edited image file.'=>'ಸಂಪಾದಿಸಿದ ಇಮೇಜ್ ಫೈಲ್‌ಗೆ URL.','Unable to crop this image.'=>'ಈ ಚಿತ್ರವನ್ನು ಕ್ರಾಪ್ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ.','Unable to rotate this image.'=>'ಈ ಚಿತ್ರವನ್ನು ತಿರುಗಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Unable to edit this image.'=>'ಈ ಚಿತ್ರವನ್ನು ಸಂಪಾದಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','The image was not edited. Edit the image before applying the changes.'=>'ಚಿತ್ರವನ್ನು ಸಂಪಾದಿಸಲಾಗಿಲ್ಲ. ಬದಲಾವಣೆಗಳನ್ನು ಅನ್ವಯಿಸುವ ಮೊದಲು ಚಿತ್ರವನ್ನು ಸಂಪಾದಿಸಿ.','This type of file cannot be edited.'=>'ಈ ರೀತಿಯ ಫೈಲ್ ಅನ್ನು ಸಂಪಾದಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Unable to get meta information for file.'=>'ಫೈಲ್‌ಗಾಗಿ ಮೆಟಾ ಮಾಹಿತಿಯನ್ನು ಪಡೆಯಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Limit result set to blocks matching the search term.'=>'ಹುಡುಕಾಟ ಪದಕ್ಕೆ ಹೊಂದಿಕೆಯಾಗುವ ಬ್ಲಾಕ್‌ಗಳಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಮಿತಿಗೊಳಿಸಿ.','The date when the block was last updated, in fuzzy human readable format.'=>'ಬ್ಲಾಕ್ ಅನ್ನು ಕೊನೆಯದಾಗಿ ನವೀಕರಿಸಿದ ದಿನಾಂಕ, ಅಸ್ಪಷ್ಟ ಮಾನವ ಓದಬಲ್ಲ ಸ್ವರೂಪದಲ್ಲಿ.','The block icon.'=>'ಬ್ಲಾಕ್ ಐಕಾನ್.','The WordPress.org username of the block author.'=>'ಬ್ಲಾಕ್ ಲೇಖಕರ WordPress.org ಬಳಕೆದಾರಹೆಸರು.','The number of blocks published by the same author.'=>'ಅದೇ ಲೇಖಕರು ಪ್ರಕಟಿಸಿದ ಬ್ಲಾಕ್‌ಗಳ ಸಂಖ್ಯೆ.','The average rating of blocks published by the same author.'=>'ಅದೇ ಲೇಖಕರು ಪ್ರಕಟಿಸಿದ ಬ್ಲಾಕ್‌ಗಳ ಸರಾಸರಿ ರೇಟಿಂಗ್.','The number sites that have activated this block.'=>'ಈ ಬ್ಲಾಕ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿದ ಸೈಟ್ಗಳ ಸಂಖ್ಯೆ.','The number of ratings.'=>'ರೇಟಿಂಗ್‌ಗಳ ಸಂಖ್ಯೆ.','The star rating of the block.'=>'ಬ್ಲಾಕ್‌ನ ಸ್ಟಾರ್ ರೇಟಿಂಗ್.','The block slug.'=>'ಬ್ಲಾಕ್ ಸ್ಲಗ್.','A short description of the block, in human readable format.'=>'ಬ್ಲಾಕ್‌ನ ಚಿಕ್ಕ ವಿವರಣೆ, ಮಾನವ ಓದಬಲ್ಲ ರೂಪದಲ್ಲಿ.','The block title, in human readable format.'=>'ಬ್ಲಾಕ್ ಶೀರ್ಷಿಕೆ, ಮಾನವ ಓದಬಲ್ಲ ರೂಪದಲ್ಲಿ.','The block name, in namespace/block-name format.'=>'ಬ್ಲಾಕ್ ಹೆಸರು, ನೇಮ್‌ಸ್ಪೇಸ್/ಬ್ಲಾಕ್-ನೇಮ್ ಫಾರ್ಮ್ಯಾಟ್‌ನಲ್ಲಿ.','Sorry, you are not allowed to browse the block directory.'=>'ಕ್ಷಮಿಸಿ, ಬ್ಲಾಕ್ ಡೈರೆಕ್ಟರಿಯನ್ನು ಬ್ರೌಸ್ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','This username is invalid because it uses illegal characters. Please enter a valid username.'=>'ಈ ಬಳಕೆದಾರಹೆಸರು ಅಮಾನ್ಯವಾಗಿದೆ ಏಕೆಂದರೆ ಇದು ಕಾನೂನುಬಾಹಿರ ಅಕ್ಷರಗಳನ್ನು ಬಳಸುತ್ತದೆ. ದಯವಿಟ್ಟು ಮಾನ್ಯವಾದ ಬಳಕೆದಾರ ಹೆಸರನ್ನು ನಮೂದಿಸಿ.','Limits results to plugins with the given status.'=>'ನೀಡಿರುವ ಸ್ಥಿತಿಯೊಂದಿಗೆ ಪ್ಲಗಿನ್‌ಗಳಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಸೀಮಿತಗೊಳಿಸುತ್ತದೆ.','The plugin\'s text domain.'=>'ಪ್ಲಗಿನ್‌ನ ಪಠ್ಯ ಡೊಮೇನ್.','Minimum required version of PHP.'=>'PHP ಯ ಕನಿಷ್ಠ ಆವೃತ್ತಿ.','Minimum required version of WordPress.'=>'ವರ್ಡ್ಪ್ರೆಸ್ನ ಕನಿಷ್ಠ ಅಗತ್ಯವಿರುವ ಆವೃತ್ತಿ.','Whether the plugin can only be activated network-wide.'=>'ಪ್ಲಗಿನ್ ಅನ್ನು ನೆಟ್ವರ್ಕ್-ವ್ಯಾಪಕವಾಗಿ ಮಾತ್ರ ಸಕ್ರಿಯಗೊಳಿಸಬಹುದೇ.','The plugin version number.'=>'ಪ್ಲಗಿನ್ ಆವೃತ್ತಿ ಸಂಖ್ಯೆ.','The plugin description formatted for display.'=>'ಪ್ಲಗಿನ್ ವಿವರಣೆಯನ್ನು ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ಫಾರ್ಮ್ಯಾಟ್ ಮಾಡಲಾಗಿದೆ.','The raw plugin description.'=>'ಕಚ್ಚಾ ಪ್ಲಗಿನ್ ವಿವರಣೆ.','The plugin description.'=>'ಪ್ಲಗಿನ್ ವಿವರಣೆ.','Plugin author\'s website address.'=>'ಪ್ಲಗಿನ್ ಲೇಖಕರ ವೆಬ್‌ಸೈಟ್ ವಿಳಾಸ.','The plugin author.'=>'ಪ್ಲಗಿನ್ ಲೇಖಕ.','The plugin\'s website address.'=>'ಪ್ಲಗಿನ್‌ನ ವೆಬ್‌ಸೈಟ್ ವಿಳಾಸ.','The plugin name.'=>'ಪ್ಲಗಿನ್ ಹೆಸರು.','The plugin file.'=>'ಪ್ಲಗಿನ್ ಫೈಲ್.','The filesystem is currently unavailable for managing plugins.'=>'ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಲು ಫೈಲ್‌ಸಿಸ್ಟಮ್ ಪ್ರಸ್ತುತ ಲಭ್ಯವಿಲ್ಲ.','Network only plugin must be network activated.'=>'ನೆಟ್‌ವರ್ಕ್ ಮಾತ್ರ ಪ್ಲಗಿನ್ ಅನ್ನು ನೆಟ್‌ವರ್ಕ್ ಸಕ್ರಿಯಗೊಳಿಸಬೇಕು.','Sorry, you are not allowed to deactivate this plugin.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Cannot delete an active plugin. Please deactivate it first.'=>'ಸಕ್ರಿಯ ಪ್ಲಗಿನ್ ಅನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ದಯವಿಟ್ಟು ಮೊದಲು ಅದನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿ.','Sorry, you are not allowed to delete plugins for this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ಗಾಗಿ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Unable to determine what plugin was installed.'=>'ಯಾವ ಪ್ಲಗಿನ್ ಅನ್ನು ಸ್ಥಾಪಿಸಲಾಗಿದೆ ಎಂಬುದನ್ನು ನಿರ್ಧರಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Unable to connect to the filesystem. Please confirm your credentials.'=>'ಕಡತ ವ್ಯವಸ್ಥೆಗೆ ಸಂಪರ್ಕಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ದಯವಿಟ್ಟು ನಿಮ್ಮ ರುಜುವಾತುಗಳನ್ನು ದೃಡೀಕರಿಸಿ.','Sorry, you are not allowed to activate plugins.'=>'ಕ್ಷಮಿಸಿ, ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to install plugins on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಸ್ಥಾಪಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Plugin not found.'=>'ಪ್ಲಗಿನ್ ಕಂಡುಬಂದಿಲ್ಲ.','Sorry, you are not allowed to manage plugins for this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ಗಾಗಿ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The plugin activation status.'=>'ಪ್ಲಗಿನ್ ಸಕ್ರಿಯಗೊಳಿಸುವ ಸ್ಥಿತಿ.','WordPress.org plugin directory slug.'=>'WordPress.org ಪ್ಲಗಿನ್ ಡೈರೆಕ್ಟರಿ ಸ್ಲಗ್.','The theme\'s current version.'=>'ಥೀಮ್‌ನ ಪ್ರಸ್ತುತ ಆವೃತ್ತಿ.','The URI of the theme\'s webpage, transformed for display.'=>'ಥೀಮ್‌ನ ವೆಬ್‌ಪುಟದ URI, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The URI of the theme\'s webpage, as found in the theme header.'=>'ಥೀಮ್ ವೆಬ್‌ಪುಟದ URI, ಥೀಮ್ ಶಿರೋಲೇಖದಲ್ಲಿ ಕಂಡುಬಂದಂತೆ.','The URI of the theme\'s webpage.'=>'ಥೀಮ್‌ನ ವೆಬ್‌ಪುಟದ URI.','The theme\'s text domain.'=>'ಥೀಮ್ನ ಪಠ್ಯ ಡೊಮೇನ್.','The theme tags, transformed for display.'=>'ಥೀಮ್ ಟ್ಯಾಗ್‌ಗಳು, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿವೆ.','The theme tags, as found in the theme header.'=>'ಥೀಮ್ ಟ್ಯಾಗ್‌ಗಳು, ಥೀಮ್ ಹೆಡರ್‌ನಲ್ಲಿ ಕಂಡುಬರುವಂತೆ.','Tags indicating styles and features of the theme.'=>'ಥೀಮ್‌ನ ಶೈಲಿಗಳು ಮತ್ತು ವೈಶಿಷ್ಟ್ಯಗಳನ್ನು ಸೂಚಿಸುವ ಟ್ಯಾಗ್‌ಗಳು.','The theme\'s screenshot URL.'=>'ಥೀಮ್‌ನ ಸ್ಕ್ರೀನ್‌ಶಾಟ್ URL.','The minimum WordPress version required for the theme to work.'=>'ಥೀಮ್ ಕೆಲಸ ಮಾಡಲು ಅಗತ್ಯವಿರುವ ಕನಿಷ್ಠ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿ.','The minimum PHP version required for the theme to work.'=>'ಥೀಮ್ ಕೆಲಸ ಮಾಡಲು ಅಗತ್ಯವಿರುವ ಕನಿಷ್ಠ PHP ಆವೃತ್ತಿ.','The theme name, transformed for display.'=>'ಥೀಮ್ ಹೆಸರು, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The theme name, as found in the theme header.'=>'ಥೀಮ್ ಹೆಸರು, ಥೀಮ್ ಹೆಡರ್‌ನಲ್ಲಿ ಕಂಡುಬರುವಂತೆ.','The name of the theme.'=>'ಥೀಮ್ ಹೆಸರು.','The theme description, transformed for display.'=>'ಥೀಮ್ ವಿವರಣೆ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The theme description, as found in the theme header.'=>'ಥೀಮ್ ವಿವರಣೆ, ಥೀಮ್ ಹೆಡರ್‌ನಲ್ಲಿ ಕಂಡುಬರುವಂತೆ.','A description of the theme.'=>'ಥೀಮ್‌ನ ವಿವರಣೆ.','The website of the theme author, transformed for display.'=>'ಥೀಮ್ ಲೇಖಕರ ವೆಬ್‌ಸೈಟ್, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The website of the theme author, as found in the theme header.'=>'ಥೀಮ್ ಲೇಖಕರ ವೆಬ್‌ಸೈಟ್, ಥೀಮ್ ಹೆಡರ್‌ನಲ್ಲಿ ಕಂಡುಬರುವಂತೆ.','The website of the theme author.'=>'ಥೀಮ್ ಲೇಖಕರ ವೆಬ್‌ಸೈಟ್.','HTML for the theme author, transformed for display.'=>'ಥೀಮ್ ಲೇಖಕರಿಗಾಗಿ HTML, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','The theme author\'s name, as found in the theme header.'=>'ಥೀಮ್ ಲೇಖಕರ ಹೆಸರು, ಥೀಮ್ ಹೆಡರ್‌ನಲ್ಲಿ ಕಂಡುಬರುವಂತೆ.','The theme author.'=>'ಥೀಮ್ ಲೇಖಕ.','The theme\'s template. If this is a child theme, this refers to the parent theme, otherwise this is the same as the theme\'s stylesheet.'=>'ಥೀಮ್ ಟೆಂಪ್ಲೇಟ್. ಇದು ಚೈಲ್ಡ್ ಥೀಮ್ ಆಗಿದ್ದರೆ, ಇದು ಪೋಷಕ ಥೀಮ್ ಅನ್ನು ಸೂಚಿಸುತ್ತದೆ, ಇಲ್ಲದಿದ್ದರೆ ಇದು ಥೀಮ್‌ನ ಸ್ಟೈಲ್‌ಶೀಟ್‌ನಂತೆಯೇ ಇರುತ್ತದೆ.','The theme\'s stylesheet. This uniquely identifies the theme.'=>'ಥೀಮ್‌ನ ಸ್ಟೈಲ್‌ಶೀಟ್. ಇದು ಅನನ್ಯವಾಗಿ ಥೀಮ್ ಅನ್ನು ಗುರುತಿಸುತ್ತದೆ.','Block namespace.'=>'ಬ್ಲಾಕ್ ನೇಮ್ ಸ್ಪೇಸ್.','A list of the inner block\'s own inner blocks. This is a recursive definition following the parent innerBlocks schema.'=>'ಒಳ ಬ್ಲಾಕ್‌ನ ಸ್ವಂತ ಒಳ ಬ್ಲಾಕ್‌ಗಳ ಪಟ್ಟಿ. ಇದು ಮೂಲ ಇನ್‌ರ್‌ಬ್ಲಾಕ್ಸ್ ಸ್ಕೀಮಾವನ್ನು ಅನುಸರಿಸಿ ಮರುಕಳಿಸುವ ವ್ಯಾಖ್ಯಾನವಾಗಿದೆ.','The attributes of the inner block.'=>'ಆಂತರಿಕ ಬ್ಲಾಕ್ನ ಗುಣಲಕ್ಷಣಗಳು.','The name of the inner block.'=>'ಒಳ ಬ್ಲಾಕ್ ಹೆಸರು.','The list of inner blocks used in the example.'=>'ಉದಾಹರಣೆಯಲ್ಲಿ ಬಳಸಲಾದ ಒಳ ಬ್ಲಾಕ್‌ಗಳ ಪಟ್ಟಿ.','The attributes used in the example.'=>'ಉದಾಹರಣೆಯಲ್ಲಿ ಬಳಸಿದ ಗುಣಲಕ್ಷಣಗಳು.','Block example.'=>'ಬ್ಲಾಕ್ ಉದಾಹರಣೆ.','Block keywords.'=>'ಬ್ಲಾಕ್ ಕೀವರ್ಡ್‌ಗಳು.','Parent blocks.'=>'ಪೋಷಕ ಬ್ಲಾಕ್ಗಳು.','Public text domain.'=>'ಸಾರ್ವಜನಿಕ ಪಠ್ಯ ಡೊಮೇನ್.','Contains the handle that defines the block style.'=>'ಬ್ಲಾಕ್ ಶೈಲಿಯನ್ನು ವ್ಯಾಖ್ಯಾನಿಸುವ ಹ್ಯಾಂಡಲ್ ಅನ್ನು ಒಳಗೊಂಡಿದೆ.','Inline CSS code that registers the CSS class required for the style.'=>'ಶೈಲಿಗೆ ಅಗತ್ಯವಿರುವ CSS ವರ್ಗವನ್ನು ನೋಂದಾಯಿಸುವ ಇನ್ಲೈನ್ ​​CSS ಕೋಡ್.','The human-readable label for the style.'=>'ಶೈಲಿಗೆ ಮಾನವ-ಓದಬಲ್ಲ ಲೇಬಲ್.','Unique name identifying the style.'=>'ಶೈಲಿಯನ್ನು ಗುರುತಿಸುವ ವಿಶಿಷ್ಟ ಹೆಸರು.','Block style variations.'=>'ಬ್ಲಾಕ್ ಶೈಲಿಯ ವ್ಯತ್ಯಾಸಗಳು.','Public facing style handles.'=>'ಪಬ್ಲಿಕ್ ಫೇಸಿಂಗ್ ಸ್ಟೈಲ್ ಹ್ಯಾಂಡಲ್','Editor style handles.'=>'ಸಂಪಾದಕ ಶೈಲಿಯ ಹಿಡಿಕೆಗಳು.','Public facing script handles.'=>'ಪಬ್ಲಿಕ್ ಫೇಸಿಂಗ್ ಸ್ಕ್ರಿಪ್ಟ್ ಹ್ಯಾಂಡಲ್‌ಗಳು.','Editor script handles.'=>'ಸಂಪಾದಕ ಸ್ಕ್ರಿಪ್ಟ್ ಹ್ಯಾಂಡಲ್‌ಗಳು.','Is the block dynamically rendered.'=>'ಬ್ಲಾಕ್ ಕ್ರಿಯಾತ್ಮಕವಾಗಿ ನಿರೂಪಿಸಲಾಗಿದೆಯೇ.','Block category.'=>'ಬ್ಲಾಕ್ ವರ್ಗ.','Block supports.'=>'ಬ್ಲಾಕ್ ಬೆಂಬಲಿಸುತ್ತದೆ.','Context values inherited by blocks of this type.'=>'ಈ ರೀತಿಯ ಬ್ಲಾಕ್‌ಗಳಿಂದ ಆನುವಂಶಿಕವಾಗಿ ಪಡೆದ ಸನ್ನಿವೇಶ ಮೌಲ್ಯಗಳು.','Context provided by blocks of this type.'=>'ಈ ರೀತಿಯ ಬ್ಲಾಕ್‌ಗಳಿಂದ ಒದಗಿಸಲಾದ ಸಂದರ್ಭ.','Block attributes.'=>'ಬ್ಲಾಕ್ ಗುಣಲಕ್ಷಣಗಳು.','Icon of block type.'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರದ ಐಕಾನ್.','Description of block type.'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರದ ವಿವರಣೆ.','Unique name identifying the block type.'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರವನ್ನು ಗುರುತಿಸುವ ವಿಶಿಷ್ಟ ಹೆಸರು.','Title of block type.'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರದ ಶೀರ್ಷಿಕೆ.','Invalid block type.'=>'ಅಮಾನ್ಯ ಬ್ಲಾಕ್ ಪ್ರಕಾರ.','Sorry, you are not allowed to manage block types.'=>'ಕ್ಷಮಿಸಿ, ಬ್ಲಾಕ್ ಪ್ರಕಾರಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Block name.'=>'ಬ್ಲಾಕ್ ಹೆಸರು. ','When registering a default meta value the data must match the type provided.'=>'ಡೀಫಾಲ್ಟ್ ಮೆಟಾ ಮೌಲ್ಯವನ್ನು ನೋಂದಾಯಿಸುವಾಗ ಡೇಟಾವು ಒದಗಿಸಿದ ಪ್ರಕಾರಕ್ಕೆ ಹೊಂದಿಕೆಯಾಗಬೇಕು.','RSS Feed'=>'RSS ಫೀಡ್','The post types that support thumbnails or true if all post types are supported.'=>'ಥಂಬ್‌ನೇಲ್‌ಗಳನ್ನು ಬೆಂಬಲಿಸುವ ಪೋಸ್ಟ್ ಪ್ರಕಾರಗಳು ಅಥವಾ ಎಲ್ಲಾ ಪೋಸ್ಟ್ ಪ್ರಕಾರಗಳನ್ನು ಬೆಂಬಲಿಸಿದರೆ ನಿಜ.','When registering an "object" feature, the feature\'s schema must include the "properties" keyword.'=>'"ವಸ್ತು" ವೈಶಿಷ್ಟ್ಯವನ್ನು ನೋಂದಾಯಿಸುವಾಗ, ವೈಶಿಷ್ಟ್ಯದ ಸ್ಕೀಮಾವು "ಗುಣಲಕ್ಷಣಗಳು" ಕೀವರ್ಡ್ ಅನ್ನು ಒಳಗೊಂಡಿರಬೇಕು.','When registering an "array" feature, the feature\'s schema must include the "items" keyword.'=>'"ಅರೇ" ವೈಶಿಷ್ಟ್ಯವನ್ನು ನೋಂದಾಯಿಸುವಾಗ, ವೈಶಿಷ್ಟ್ಯದ ಸ್ಕೀಮಾವು "ಐಟಂಗಳು" ಕೀವರ್ಡ್ ಅನ್ನು ಒಳಗೊಂಡಿರಬೇಕು.','When registering an "array" or "object" feature to show in the REST API, the feature\'s schema must also be defined.'=>'REST API ನಲ್ಲಿ ತೋರಿಸಲು "ಅರೇ" ಅಥವಾ "ಆಬ್ಜೆಕ್ಟ್" ವೈಶಿಷ್ಟ್ಯವನ್ನು  ನೋಂದಾಯಿಸುವಾಗ, ವೈಶಿಷ್ಟ್ಯದ ಸ್ಕೀಮಾವನ್ನು ಸಹ ವ್ಯಾಖ್ಯಾನಿಸಬೇಕು.','When registering a "variadic" theme feature, the "type" must be an "array".'=>'"ವೇರಿಯಡಿಕ್" ಥೀಮ್ ವೈಶಿಷ್ಟ್ಯವನ್ನು ನೋಂದಾಯಿಸುವಾಗ, "ಟೈಪ್" ಒಂದು "ಅರೇ" ಆಗಿರಬೇಕು','The feature "type" is not valid JSON Schema type.'=>'"ಟೈಪ್" ವೈಶಿಷ್ಟ್ಯವು ಮಾನ್ಯ JSON ಸ್ಕೀಮಾ ಪ್ರಕಾರವಲ್ಲ.','theme<strong>Error:</strong> Current WordPress version does not meet minimum requirements for %s.'=>'<strong>ದೋಷ:</strong> ಪ್ರಸ್ತುತ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿ %s ಗಾಗಿ ಕನಿಷ್ಠ ಅವಶ್ಯಕತೆಗಳನ್ನು ಪೂರೈಸುವುದಿಲ್ಲ.','theme<strong>Error:</strong> Current PHP version does not meet minimum requirements for %s.'=>'<strong>ದೋಷ:</strong> ಪ್ರಸ್ತುತ PHP ಆವೃತ್ತಿಯು %s ಗಾಗಿ ಕನಿಷ್ಠ ಅವಶ್ಯಕತೆಗಳನ್ನು ಪೂರೈಸುವುದಿಲ್ಲ.','theme<strong>Error:</strong> Current WordPress and PHP versions do not meet minimum requirements for %s.'=>'<strong>Error:</strong> ಪ್ರಸ್ತುತ ವರ್ಡ್ಪ್ರೆಸ್ ಮತ್ತು PHP ಆವೃತ್ತಿಗಳು %s ಗಾಗಿ ಕನಿಷ್ಠ ಅವಶ್ಯಕತೆಗಳನ್ನು ಪೂರೈಸುವುದಿಲ್ಲ.','This image cannot be displayed in a web browser. For best results convert it to JPEG before uploading.'=>'ಈ ಚಿತ್ರವನ್ನು ವೆಬ್ ಬ್ರೌಸರ್‌ನಲ್ಲಿ ಪ್ರದರ್ಶಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ಉತ್ತಮ ಫಲಿತಾಂಶಗಳಿಗಾಗಿ ಅದನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡುವ ಮೊದಲು JPEGಗೆ ಪರಿವರ್ತಿಸಿ.','Edit Profile'=>'ಪ್ರೊಫೈಲ್ ಬದಲಿಸು','Priority'=>'ಆದ್ಯತೆ','Change Frequency'=>'ಆವರ್ತನವನ್ನು ಬದಲಾಯಿಸಿ','Last Modified'=>'ಕೊನೆಯದಾಗಿ ಮಾರ್ಪಡಿಸಿದ','Number of URLs in this XML Sitemap: %s.'=>'ಈ XML ಸೈಟ್‌ಮ್ಯಾಪ್‌ನಲ್ಲಿನ URL ಗಳ ಸಂಖ್ಯೆ: %s.','Learn more about XML sitemaps.'=>'XML ಸೈಟ್‌ಮ್ಯಾಪ್‌ಗಳ ಬಗ್ಗೆ ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ.','https://www.sitemaps.org/'=>'https://www.sitemaps.org/','This XML Sitemap is generated by WordPress to make your content more visible for search engines.'=>'ಈ XML ಸೈಟ್‌ಮ್ಯಾಪ್ ಅನ್ನು ನಿಮ್ಮ ವಿಷಯವನ್ನು ಸರ್ಚ್ ಇಂಜಿನ್‌ಗಳಿಗೆ ಹೆಚ್ಚು ಗೋಚರಿಸುವಂತೆ ಮಾಡಲು ವರ್ಡ್‌ಪ್ರೆಸ್ ರಚಿಸಿದೆ.','XML Sitemap'=>'XML ಸೈಟ್‌ಮ್ಯಾಪ್','Could not generate XML sitemap due to missing %s extension'=>'%s ವಿಸ್ತರಣೆಯು ಕಾಣೆಯಾಗಿರುವುದರಿಂದ XML ಸೈಟ್‌ಮ್ಯಾಪ್ ಅನ್ನು ರಚಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ','Fields other than %s are not currently supported for sitemaps.'=>'ಸೈಟ್‌ಮ್ಯಾಪ್‌ಗಳಿಗೆ %s ಹೊರತುಪಡಿಸಿ ಇತರ ಕ್ಷೇತ್ರಗಳು ಪ್ರಸ್ತುತ ಬೆಂಬಲಿತವಾಗಿಲ್ಲ.','Fields other than %s are not currently supported for the sitemap index.'=>'ಸೈಟ್‌ಮ್ಯಾಪ್ ಸೂಚ್ಯಂಕಕ್ಕೆ %s ಹೊರತುಪಡಿಸಿ ಇತರ ಕ್ಷೇತ್ರಗಳು ಪ್ರಸ್ತುತ ಬೆಂಬಲಿತವಾಗಿಲ್ಲ.','Check your email'=>'ನಿಮ್ಮ ಇಮೇಲ್ ಪರಿಶೀಲಿಸಿ','Registration complete. Please check your email, then visit the <a href="%s">login page</a>.'=>'ನೋಂದಣಿ ಪೂರ್ಣಗೊಂಡಿದೆ. ದಯವಿಟ್ಟು ನಿಮ್ಮ ಇಮೇಲ್ ಪರಿಶೀಲಿಸಿ, ನಂತರ <a href="%s">ಲಾಗಿನ್ ಪುಟಕ್ಕೆ</a> ಭೇಟಿ ನೀಡಿ.','Check your email for the confirmation link, then visit the <a href="%s">login page</a>.'=>'ಧ್ರಡೀಕರಣ ಲಿಂಕ್‌ಗಾಗಿ ನಿಮ್ಮ ಇಮೇಲ್ ಪರಿಶೀಲಿಸಿ, ನಂತರ <a href="%s">ಲಾಗಿನ್ ಪುಟಕ್ಕೆ</a> ಭೇಟಿ ನೀಡಿ.','Password protected'=>'ಪಾಸ್ವರ್ಡ್ ರಕ್ಷಿಸಲಾಗಿದೆ','Sorry, the category could not be created.'=>'ಕ್ಷಮಿಸಿ, ವರ್ಗವನ್ನು ರಚಿಸಲಾಗಲಿಲ್ಲ.','Sorry, the post could not be deleted.'=>'ಕ್ಷಮಿಸಿ, ಪೋಸ್ಟ್ ಅನ್ನು ಅಳಿಸಲಾಗಲಿಲ್ಲ.','Sorry, the post could not be updated.'=>'ಕ್ಷಮಿಸಿ, ಪೋಸ್ಟ್ ಅನ್ನು ನವೀಕರಿಸಲಾಗಲಿಲ್ಲ.','block keywordlinks'=>'ಲಿಂಕ್‌ಗಳು','Select poster image'=>'ಪೋಸ್ಟರ್ ಚಿತ್ರವನ್ನು ಆಯ್ಕೆ ಮಾಡಿ','Matt Mullenweg'=>'ಮ್ಯಾಟ್ ಮುಲೆನ್ವೆಗ್','View post'=>'ಪೋಸ್ಟ್ ವೀಕ್ಷಿಸಿ','Slug'=>'ಸ್ಲಗ್','Small'=>'‍ಸಣ್ಣ','The post status %1$s is not registered, so it may not be reliable to check the capability %2$s against a post with that status.'=>'ಪೋಸ್ಟ್ %1$s ಅನ್ನು ನೋಂದಾಯಿಸಲಾಗಿಲ್ಲ, ಆದ್ದರಿಂದ ಆ ಸ್ಥಿತಿಯೊಂದಿಗೆ ಪೋಸ್ಟ್‌ಗೆ "%2$s" ಸಾಮರ್ಥ್ಯವನ್ನು ಪರಿಶೀಲಿಸುವುದು ವಿಶ್ವಾಸಾರ್ಹವಾಗಿರುವುದಿಲ್ಲ.','In reply to %s.'=>'%s ಗೆ ಪ್ರತ್ಯುತ್ತರವಾಗಿ.','Previous and next months'=>'ಹಿಂದಿನ ಮತ್ತು ಮುಂದಿನ ತಿಂಗಳುಗಳು','When registering an "array" setting to show in the REST API, you must specify the schema for each array item in "show_in_rest.schema.items".'=>'REST API ನಲ್ಲಿ ತೋರಿಸಲು "ಅರೇ" ಸೆಟ್ಟಿಂಗ್ ಅನ್ನು ನೋಂದಾಯಿಸುವಾಗ, ನೀವು "show_in_rest.schema.items" ನಲ್ಲಿ ಪ್ರತಿ ಅರೇ ಐಟಂನ ಸ್ಕೀಮಾವನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸಬೇಕು.','User&#8217;s Session Tokens data.'=>'ಬಳಕೆದಾರರ ಸೆಷನ್ ಟೋಕನ್ ಡೇಟಾ.','Session Tokens'=>'ಸೆಷನ್ ಟೋಕನ್ಗಳು','Last Login'=>'ಕೊನೆಯ ಲಾಗಿನ್','User Agent'=>'ಬಳಕೆದಾರ ಏಜೆಂಟ್','Expiration'=>'ಮುಕ್ತಾಯ','User&#8217;s location data used for the Community Events in the WordPress Events and News dashboard widget.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಈವೆಂಟ್‌ಗಳು ಮತ್ತು ನ್ಯೂಸ್ ಡ್ಯಾಶ್‌ಬೋರ್ಡ್ ವಿಜೆಟ್‌ನಲ್ಲಿ ಸಮುದಾಯ ಈವೆಂಟ್‌ಗಳಿಗಾಗಿ ಬಳಕೆದಾರರ ಸ್ಥಳ ಡೇಟಾವನ್ನು ಬಳಸಲಾಗುತ್ತದೆ.','Community Events Location'=>'ಸಮುದಾಯ ಕಾರ್ಯಕ್ರಮದ ಸ್ಥಳ','IP'=>'IP','Longitude'=>'ರೇಖಾಂಶ','Latitude'=>'ಅಕ್ಷಾಂಶ','Country'=>'ರಾಷ್ಟ್ರ','City'=>'ನಗರ','Filter %s returned items with reserved names.'=>'ಕಾಯ್ದಿರಿಸಿದ ಹೆಸರುಗಳೊಂದಿಗೆ %s ಹಿಂತಿರುಗಿಸಿದ ವಸ್ತುಗಳನ್ನು ಫಿಲ್ಟರ್ ಮಾಡಿ.','Original image:'=>'ಮೂಲ ಚಿತ್ರ:','Once Weekly'=>'ವಾರಕ್ಕೊಮ್ಮೆ','In reply to: %s'=>'ಇದಕ್ಕೆ ಪ್ರತ್ಯುತ್ತರವಾಗಿ: %s','HTTP redirect status code must be a redirection code, 3xx.'=>'HTTP ಮರುನಿರ್ದೇಶನ ಸ್ಥಿತಿ ಕೋಡ್ ಒಂದು ಮರುನಿರ್ದೇಶನ ಕೋಡ್ ಆಗಿರಬೇಕು, 3xx.','Limit result set based on relationship between multiple taxonomies.'=>'ಬಹು ಟ್ಯಾಕ್ಸಾನಮಿಗಳ ನಡುವಿನ ಸಂಬಂಧದ ಆಧಾರದ ಮೇಲೆ ಫಲಿತಾಂಶದ ಸೆಟ್ ಅನ್ನು ಮಿತಿಗೊಳಿಸಿ.','The "%1$s" taxonomy "%2$s" property (%3$s) conflicts with an existing property on the REST API Posts Controller. Specify a custom "rest_base" when registering the taxonomy to avoid this error.'=>'"%1$s" ಟ್ಯಾಕ್ಸಾನಮಿ "%2$s" ಆಸ್ತಿ (%3$s) ಉಳಿದ ಎಪಿಐ ಪೋಸ್ಟ್ಗಳ ನಿಯಂತ್ರಕದಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಆಸ್ತಿಯೊಂದಿಗೆ ಸಂಘರ್ಷಿಸುತ್ತದೆ. ಈ ದೋಷವನ್ನು ತಪ್ಪಿಸಲು ಟ್ಯಾಕ್ಸಾನಮಿಯನ್ನು ನೋಂದಾಯಿಸುವಾಗ "rest_base" ಕಸ್ಟಮ್ ಅನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸಿ.','Whether theme opts in to default WordPress block styles for viewing.'=>'ಥೀಮ್ ವೀಕ್ಷಣೆಗಾಗಿ ಡೀಫಾಲ್ಟ್ ವರ್ಡ್ಪ್ರೆಸ್ ಬ್ಲಾಕ್ ಶೈಲಿಗಳನ್ನು ಆರಿಸಿಕೊಳ್ಳುತ್ತದೆಯೇ.','Whether the theme can manage the document title tag.'=>'ಥೀಮ್ ಡಾಕ್ಯುಮೆಂಟ್ ಶೀರ್ಷಿಕೆ ಟ್ಯಾಗ್ ಅನ್ನು ನಿರ್ವಹಿಸಬಹುದೇ.','Allows use of HTML5 markup for search forms, comment forms, comment lists, gallery, and caption.'=>'ಹುಡುಕಾಟ ಫಾರ್ಮ್‌ಗಳು, ಕಾಮೆಂಟ್ ಫಾರ್ಮ್‌ಗಳು, ಕಾಮೆಂಟ್ ಪಟ್ಟಿಗಳು, ಗ್ಯಾಲರಿ ಮತ್ತು ಶೀರ್ಷಿಕೆಗಳಿಗಾಗಿ HTML5 ಮಾರ್ಕ್ಅಪ್ ಬಳಕೆಯನ್ನು ಅನುಮತಿಸುತ್ತದೆ.','Whether theme opts in to the editor styles CSS wrapper.'=>'ಥೀಮ್ ಸಂಪಾದಕ ಶೈಲಿಗಳು CSS ಹೊದಿಕೆಯನ್ನು ಆರಿಸಿಕೊಳ್ಳುತ್ತದೆಯೇ.','Custom gradient presets if defined by the theme.'=>'ಥೀಮ್ ವ್ಯಾಖ್ಯಾನಿಸಿದರೆ ಕಸ್ಟಮ್ ಗ್ರೇಡಿಯಂಟ್ ಪೂರ್ವನಿಗದಿಗಳು.','Custom font sizes if defined by the theme.'=>'ಥೀಮ್ ವ್ಯಾಖ್ಯಾನಿಸಿದರೆ ಕಸ್ಟಮ್ ಫಾಂಟ್ ಗಾತ್ರಗಳು.','Custom color palette if defined by the theme.'=>'ಥೀಮ್ ವ್ಯಾಖ್ಯಾನಿಸಿದರೆ ಕಸ್ಟಮ್ ಬಣ್ಣದ ಪ್ಯಾಲೆಟ್.','Whether the theme disables custom gradients.'=>'ಥೀಮ್ ಕಸ್ಟಮ್ ಗ್ರೇಡಿಯಂಟ್‌ಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸುತ್ತದೆಯೇ.','Whether the theme disables custom font sizes.'=>'ಥೀಮ್ ಕಸ್ಟಮ್ ಫಾಂಟ್ ಗಾತ್ರಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸುತ್ತದೆಯೇ.','Whether the theme disables custom colors.'=>'ಥೀಮ್ ಕಸ್ಟಮ್ ಬಣ್ಣಗಳನ್ನು ನಿಷ್