ೇಟಾ ಇಲ್ಲ.','Sorry, marking a user as spam is only supported on Multisite.'=>'ಕ್ಷಮಿಸಿ, ಬಳಕೆದಾರರನ್ನು ಸ್ಪ್ಯಾಮ್ ಎಂದು ಗುರುತಿಸುವುದನ್ನು ಮಲ್ಟಿಸೈಟ್‌ನಲ್ಲಿ ಮಾತ್ರ ಬೆಂಬಲಿಸಲಾಗುತ್ತದೆ.','User&#8217;s media data.'=>'ಬಳಕೆದಾರರ ಮಾಧ್ಯಮ ಡೇಟಾ.','No media items found. Try a different search.'=>'ಯಾವುದೇ ಮಾಧ್ಯಮ ವಸ್ತುಗಳು ಕಂಡುಬಂದಿಲ್ಲ. ಬೇರೆ ಹುಡುಕಾಟವನ್ನು ಪ್ರಯತ್ನಿಸಿ.','Number of media items found: %d'=>'ಕಂಡುಬಂದಿರುವ ಮಾಧ್ಯಮ ಐಟಂಗಳ ಸಂಖ್ಯೆ: %d','Archive <span class="count">(%s)</span>'=>'ಆರ್ಕೈವ್ <span class="count">(%s)</span>' . "\0" . 'ಆರ್ಕೈವ್ಗಳು <span class="count">(%s)</span>','Manage Archives'=>'ಆರ್ಕೈವ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಿ','Spreadsheet <span class="count">(%s)</span>'=>'ಸ್ಪ್ರೆಡ್ಶೀಟ್ <span class="count">(%s)</span>' . "\0" . 'ಸ್ಪ್ರೆಡ್‌ಶೀಟ್‌ಗಳು <span class="count">(%s)</span>','Manage Spreadsheets'=>'ಸ್ಪ್ರೆಡ್‌ಶೀಟ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಿ','Spreadsheets'=>'ಸ್ಪ್ರೆಡ್‌ಶೀಟ್‌ಗಳು','Manage Documents'=>'ದಾಖಲೆಗಳನ್ನು ನಿರ್ವಹಿಸಿ','Documents'=>'ದಾಖಲೆಗಳು','Requirements Not Met'=>'ಅವಶ್ಯಕತೆಗಳು ಪೂರೈಸಿಲ್ಲ','The %1$s, %2$s, and %3$s values can be edited to set the video track language and kind.'=>'ವೀಡಿಯೊ ಟ್ರ್ಯಾಕ್ ಭಾಷೆ ಮತ್ತು ರೀತಿಯನ್ನು ಹೊಂದಿಸಲು %1$s, %2$s, ಮತ್ತು %3$s ಮೌಲ್ಯಗಳನ್ನು ಸಂಪಾದಿಸಬಹುದು.','User&#8217;s comment data.'=>'ಬಳಕೆದಾರರ ಕಾಮೆಂಟ್ ಡೇಟಾ.','Unchanged:'=>'ಬದಲಾಗದೆ:','Added:'=>'ಸೇರಿಸಲಾಗಿದೆ:','Whether posts of this status may have floating published dates.'=>'ಈ ಸ್ಥಿತಿಯ ಪೋಸ್ಟ್‌ಗಳು ಫ್ಲೋಟಿಂಗ್ ಪ್ರಕಟಿತ ದಿನಾಂಕಗಳನ್ನು ಹೊಂದಿರಬಹುದೇ','Sorry, you are not allowed to delete revisions of this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪೋಸ್ಟ್‌ನ ಪರಿಷ್ಕರಣೆಗಳನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Could not update the meta value of %s in database.'=>'ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ %s ಮೆಟಾ ಮೌಲ್ಯವನ್ನು ನವೀಕರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','When registering an "array" meta type to show in the REST API, you must specify the schema for each array item in "show_in_rest.schema.items".'=>'REST API ನಲ್ಲಿ ತೋರಿಸಲು "ಅರೇ" ಮೆಟಾ ಪ್ರಕಾರವನ್ನು ನೋಂದಾಯಿಸುವಾಗ, ನೀವು "show_in_rest.schema.items" ನಲ್ಲಿ ಪ್ರತಿ ರಚನೆಯ ಐಟಂಗೆ ಸ್ಕೀಮಾವನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸಬೇಕು.','Comments feed'=>'ಕಾಮೆಂಟ್ ಫೀಡ್','Entries feed'=>'ನಮೂದುಗಳ ಫೀಡ್','Unexpected response from the server. The file may have been uploaded successfully. Check in the Media Library or reload the page.'=>'ಸರ್ವರ್‌ನಿಂದ ಅನಿರೀಕ್ಷಿತ ಪ್ರತಿಕ್ರಿಯೆ. ಫೈಲ್ ಅನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಅಪ್‌ಲೋಡ್ ಮಾಡಿರಬಹುದು. ಮಾಧ್ಯಮ ಲೈಬ್ರರಿಯಲ್ಲಿ ಪರಿಶೀಲಿಸಿ ಅಥವಾ ಪುಟವನ್ನು ಮರುಲೋಡ್ ಮಾಡಿ.','Remind me later'=>'ನನಗೆ ನಂತರ ನೆನಪಿಸು','The email is correct'=>'ಇಮೇಲ್ ಸರಿಯಾಗಿದೆ','This email may be different from your personal email address.'=>'ಈ ಇಮೇಲ್ ನಿಮ್ಮ ವೈಯಕ್ತಿಕ ಇಮೇಲ್ ವಿಳಾಸಕ್ಕಿಂತ ಭಿನ್ನವಾಗಿರಬಹುದು.','Current administration email: %s'=>'ಪ್ರಸ್ತುತ ಆಡಳಿತ ಇಮೇಲ್: %s','Why is this important?'=>'ಇದು ಏಕೆ ಮುಖ್ಯ?','https://wordpress.org/documentation/article/settings-general-screen/#email-address'=>'https://wordpress.org/documentation/article/settings-general-screen/#email-address','Please verify that the <strong>administration email</strong> for this website is still correct.'=>'ಈ ವೆಬ್‌ಸೈಟ್‌ನ <strong>ಆಡಳಿತ ಇಮೇಲ್</strong> ಇನ್ನೂ ಸರಿಯಾಗಿದೆಯೇ ಎಂದು ಪರಿಶೀಲಿಸಿ.','Administration email verification'=>'ಆಡಳಿತ ಇಮೇಲ್ ಪರಿಶೀಲನೆ','Confirm your administration email'=>'ನಿಮ್ಮ ಆಡಳಿತ ಇಮೇಲ್ ದೃಡೀಕರಿಸಿ','excerpt_length55'=>'೫೫','Original SizeOriginal'=>'ಮೂಲ','comment_excerpt_length20'=>'೨೦','Cannot resize the image. Both width and height are not set.'=>'ಚಿತ್ರವನ್ನು ಮರುಗಾತ್ರಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ಅಗಲ ಮತ್ತು ಎತ್ತರ ಎರಡನ್ನೂ ಹೊಂದಿಸಲಾಗಿಲ್ಲ.','Image size in pixels'=>'ಪಿಕ್ಸೆಲ್‌ಗಳಲ್ಲಿ ಚಿತ್ರದ ಗಾತ್ರ ','Media title&hellip;'=>'ಮಾಧ್ಯಮ ಶೀರ್ಷಿಕೆ&hellip;','Media title'=>'ಮಾಧ್ಯಮ ಶೀರ್ಷಿಕೆ','Audio title&hellip;'=>'ಆಡಿಯೋ ಶೀರ್ಷಿಕೆ&hellip;','Audio title'=>'ಆಡಿಯೋ ಶೀರ್ಷಿಕೆ','Video title&hellip;'=>'ವೀಡಿಯೊ ಶೀರ್ಷಿಕೆ&hellip;','Video title'=>'ವೀಡಿಯೊ ಶೀರ್ಷಿಕೆ','Caption&hellip;'=>'ಶೀರ್ಷಿಕೆ&hellip;','Details'=>'ವಿವರಗಳು ','Attachment Preview'=>'ಲಗತ್ತು ಪೂರ್ವವೀಕ್ಷಣೆ','Your browser cannot upload files'=>'ನಿಮ್ಮ ಬ್ರೌಸರ್ ಗೆ ಫೈಲ್‌ಗಳನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ','Allow people to submit comments on new posts.'=>'ಹೊಸ ಪೋಸ್ಟ್‌ಗಳಲ್ಲಿ ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಸಲ್ಲಿಸಲು ಜನರಿಗೆ ಅನುಮತಿಸಿ.','<strong>Error:</strong> The email could not be sent. Your site may not be correctly configured to send emails. <a href="%s">Get support for resetting your password</a>.'=>'<strong>ದೋಷ:</strong> ಇಮೇಲ್ ಕಳುಹಿಸಲಾಗಲಿಲ್ಲ. ಇಮೇಲ್‌ಗಳನ್ನು ಕಳುಹಿಸಲು ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಸರಿಯಾಗಿ ಕಾನ್ಫಿಗರ್ ಮಾಡದೇ ಇರಬಹುದು. <a href="%s">ನಿಮ್ಮ ಪಾಸ್‌ವರ್ಡ್ ಮರುಹೊಂದಿಸಲು ಬೆಂಬಲವನ್ನು ಪಡೆಯಿರಿ</a>.','New version available.'=>'ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ','Could not insert term taxonomy into the database.'=>'ಟ್ಯಾಕ್ಸಾನಮಿ ಪದವನ್ನು ಡೇಟಾಬೇಸ್‌ಗೆ ಸೇರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','<a href="%1$s" %2$s>Learn how to describe the purpose of the image%3$s</a>. Leave empty if the image is purely decorative.'=>'<a href="%1$s" %2$s>ಚಿತ್ರದ ಉದ್ದೇಶವನ್ನು ವಿವರಿಸಲು ತಿಳಿಯಿರಿ%3$s</a>. ಚಿತ್ರವು ಸಂಪೂರ್ಣವಾಗಿ ಅಲಂಕಾರಿಕವಾಗಿದ್ದರೆ ಖಾಲಿ ಬಿಡಿ.','In this case, WordPress caught an error with your theme, %s.'=>'ಈ ಸಂದರ್ಭದಲ್ಲಿ, ವರ್ಡ್ಪ್ರೆಸ್ ನಿಮ್ಮ ಥೀಮ್ ನೊಂದಿಗೆ ದೋಷವನ್ನು ಹಿಡಿದಿದೆ, %s.','In this case, WordPress caught an error with one of your plugins, %s.'=>'ಈ ಸಂದರ್ಭದಲ್ಲಿ, ವರ್ಡ್ಪ್ರೆಸ್ ನಿಮ್ಮ ಪ್ಲಗ್‌ಇನ್‌ಗಳಲ್ಲಿ ಒಂದಾದ %s ನೊಂದಿಗೆ ದೋಷವನ್ನು ಹಿಡಿದಿದೆ.','Howdy!

WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
