###DETAILS###'=>'ನಮಸ್ಕಾರ!

ವರ್ಡ್ಪ್ರೆಸ್ 5.2 ರಿಂದ ಒಂದು ಅಂತರ್ನಿರ್ಮಿತ ವೈಶಿಷ್ಟ್ಯವು ಪ್ಲಗಿನ್ ಅಥವಾ ಥೀಮ್ ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ ಮಾರಕ ದೋಷವನ್ನು ಉಂಟುಮಾಡಿದಾಗ ಪತ್ತೆ ಮಾಡುತ್ತದೆ ಮತ್ತು ಈ ಸ್ವಯಂಚಾಲಿತ ಇಮೇಲ್ ಮೂಲಕ ನಿಮಗೆ ತಿಳಿಸುತ್ತದೆ.

###CAUSE###
ಮೊದಲು, ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್‌ಗೆ ಭೇಟಿ ನೀಡಿ (###SITEURL###) ಮತ್ತು ಯಾವುದೇ ಗೋಚರ ಸಮಸ್ಯೆಗಳಿವೆಯೇ ಎಂದು ಪರಿಶೀಲಿಸಿ. ಮುಂದೆ, ದೋಷವನ್ನು ಹಿಡಿದಿರುವ ಪುಟಕ್ಕೆ ಭೇಟಿ ನೀಡಿ (###PAGEURL###) ಮತ್ತು ಯಾವುದೇ ಗೋಚರ ಸಮಸ್ಯೆಗಳಿವೆಯೇ ಎಂದು ಪರಿಶೀಲಿಸಿ.

###SUPPORT###

ನಿಮ್ಮ ಸೈಟ್ ಮುರಿದಂತೆ ಕಂಡುಬಂದರೆ ಮತ್ತು ನಿಮ್ಮ ಡ್ಯಾಶ್‌ಬೋರ್ಡ್ ಅನ್ನು ನೀವು ಸಾಮಾನ್ಯವಾಗಿ ಪ್ರವೇಶಿಸಲು ಸಾಧ್ಯವಾಗದಿದ್ದರೆ, ವರ್ಡ್‌ಪ್ರೆಸ್ ಈಗ ವಿಶೇಷ "ರಿಕವರಿ ಮೋಡ್" ಅನ್ನು ಹೊಂದಿದೆ. ಇದು ನಿಮ್ಮ ಡ್ಯಾಶ್‌ಬೋರ್ಡ್‌ಗೆ ಸುರಕ್ಷಿತವಾಗಿ ಲಾಗಿನ್ ಮಾಡಲು ಮತ್ತು ಮತ್ತಷ್ಟು ತನಿಖೆ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ.

