se try again.'=>'ಈ ಫಾರ್ಮ್ ಅನ್ನು ಸಲ್ಲಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ, ದಯವಿಟ್ಟು ಮತ್ತೆ ಪ್ರಯತ್ನಿಸಿ.','post formatFormats'=>'ಸ್ವರೂಪಗಳು','%1$s, %2$s'=>'%1$s, %2$s','This resource is provided by your web host, and is specific to your site. For more information, <a href="%s" target="_blank">see the official WordPress documentation</a>.'=>'ಈ ಸಂಪನ್ಮೂಲವನ್ನು ನಿಮ್ಮ ವೆಬ್ ಹೋಸ್ಟ್ ಒದಗಿಸಿದೆ ಮತ್ತು ನಿಮ್ಮ ಸೈಟ್‌ಗೆ ನಿರ್ದಿಷ್ಟವಾಗಿದೆ. ಹೆಚ್ಚಿನ ಮಾಹಿತಿಗಾಗಿ, <a href="%s" target="_blank">ಅಧಿಕೃತ ವರ್ಡ್ಪ್ರೆಸ್ ದಸ್ತಾವೇಜನ್ನು ನೋಡಿ</a>.','localized PHP upgrade information pagehttps://wordpress.org/support/update-php/'=>'https://wordpress.org/support/update-php/','%s second'=>'%s ಸೆಕೆಂಡ್' . "\0" . '%s ಸೆಕೆಂಡುಗಳು','%s minute'=>'%s ನಿಮಿಷ' . "\0" . '%s ನಿಮಿಷಗಳು','%1$s by %2$s pixels'=>'%1$s ಮೂಲಕ %2$s ಪಿಕ್ಸೆಲ್‌ಗಳು','This theme failed to load properly and was paused within the admin backend.'=>'ಈ ಥೀಮ್ ಸರಿಯಾಗಿ ಲೋಡ್ ಮಾಡಲು ವಿಫಲವಾಗಿದೆ ಮತ್ತು ನಿರ್ವಾಹಕ ಬ್ಯಾಕೆಂಡ್‌ನಲ್ಲಿ ವಿರಾಮಗೊಳಿಸಲಾಗಿದೆ','Whether to show the taxonomy in the quick/bulk edit panel.'=>'ತ್ವರಿತ/ಬೃಹತ್ ಸಂಪಾದನಾ ಫಲಕದಲ್ಲಿ ವರ್ಗೀಕರಣವನ್ನು ತೋರಿಸಬೇಕೆ.','Whether to make the taxonomy available for selection in navigation menus.'=>'ನ್ಯಾವಿಗೇಷನ್ ಮೆನುಗಳಲ್ಲಿ ಆಯ್ಕೆಗೆ ಟ್ಯಾಕ್ಸಾನಮಿ ಲಭ್ಯವಾಗುವಂತೆ ಮಾಡಬೇಕೆ','Whether to allow automatic creation of taxonomy columns on associated post-types table.'=>'ಸಂಬಂಧಿತ ಪೋಸ್ಟ್-ಟೈಪ್ ಟೇಬಲ್‌ನಲ್ಲಿ ಟ್ಯಾಕ್ಸಾನಮಿ ಕಾಲಮ್‌ಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ರಚಿಸಲು ಅನುಮತಿಸಬೇಕೆ.','Whether to generate a default UI for managing this taxonomy.'=>'ಈ ವರ್ಗೀಕರಣವನ್ನು ನಿರ್ವಹಿಸಲು ಡೀಫಾಲ್ಟ್ UI ಅನ್ನು ರಚಿಸಬೇಕೆ','Whether the taxonomy is publicly queryable.'=>'ವರ್ಗೀಕರಣವು ಸಾರ್ವಜನಿಕವಾಗಿ ಪ್ರಶ್ನಾರ್ಹವಾಗಿದೆಯೇ.','Whether a taxonomy is intended for use publicly either via the admin interface or by front-end users.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಯನ್ನು ಅಡ್ಮಿನ್ ಇಂಟರ್ಫೇಸ್ ಮೂಲಕ ಅಥವಾ ಫ್ರಂಟ್-ಎಂಡ್ ಬಳಕೆದಾರರಿಂದ ಸಾರ್ವಜನಿಕವಾಗಿ ಬಳಸಲು ಉದ್ದೇಶಿಸಲಾಗಿದೆಯೇ','<strong>Error:</strong> There is no account with that username or email address.'=>'<strong>ದೋಷ:</strong> ಆ ಬಳಕೆದಾರಹೆಸರು ಅಥವಾ ಇಮೇಲ್ ವಿಳಾಸದೊಂದಿಗೆ ಯಾವುದೇ ಖಾತೆ ಇಲ್ಲ.','A variable mismatch has been detected.'=>'ವೇರಿಯಬಲ್ ಅಸಾಮರಸ್ಯ ಪತ್ತೆಯಾಗಿದೆ.','A key value mismatch has been detected. Please follow the link provided in your activation email.'=>'ಒಂದು ಕೀ-ಮೌಲ್ಯ ಹೊಂದಾಣಿಕೆ ಪತ್ತೆಯಾಗಿಲ್ಲ. ದಯವಿಟ್ಟು ನಿಮ್ಮ ಸಕ್ರಿಯಗೊಳಿಸುವ ಇಮೇಲ್‌ನಲ್ಲಿ ನೀಡಿರುವ ಲಿಂಕ್ ಅನ್ನು ಅನುಸರಿಸಿ.','Classic Block Keyboard Shortcuts'=>'ಕ್ಲಾಸಿಕ್ ಬ್ಲಾಕ್ ಕೀಬೋರ್ಡ್ ಶಾರ್ಟ್ಕಟ್ಗಳು','Sorry, you are not allowed to view autosaves of this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಲೇಖನದ ಸ್ವಉಳಿಕೆಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Scheduled'=>'ನಿಗದಿಪಡಿಸಲಾಗಿದೆ','Create'=>'ಸೃಷ್ಟಿಸು','block descriptionGive quoted text visual emphasis. "In quoting others, we cite ourselves." — Julio Cortázar'=>'ಉಲ್ಲೇಖಿಸಲಾದ ಪಠ್ಯ‌ಕ್ಕೆ ದೃಶ್ಯ ಮಹತ್ವವನ್ನು ನೀಡಿ. "ಇತರರನ್ನು ಉಲ್ಲೇಖಿಸುವಾಗ, ನಾವು ನಮ್ಮನ್ನು ಉಲ್ಲೇಖಿಸುತ್ತೇವೆ." - ಜೂಲಿಯೊ ಕಾರ್ಟಜಾರ್','Pagination'=>'ಪೇಜಿನೇಷನ್','Edit image'=>'ಚಿತ್ರ ಸಂಪಾದಿಸು','block descriptionIntroduce new sections and organize content to help visitors (and search engines) understand the structure of your content.'=>'ನಿಮ್ಮ ವಿಷಯದ ರಚನೆಯನ್ನು ಅರ್ಥಮಾಡಿಕೊಳ್ಳಲು ಭೇಟಿ ನೀಡುವವರಿಗೆ ಮತ್ತು ಹುಡುಕಾಟ ಎಂಜಿನ್ಗಳಿಗೆ ಹೊಸ ವಿಭಾಗಗಳನ್ನು ಪರಿಚಯಿಸಿ ಮತ್ತು ವಿಷಯವನ್ನು ಸಂಘಟಿಸಿ.','Copy URL'=>'URL ನಕಲಿಸು','block descriptionAdd a block that displays content pulled from other sites, like Twitter or YouTube.'=>'ಟ್ವಿಟರ್ ಅಥವಾ ಯೂಟ್ಯೂಬ್‌ನಂತಹ ಇತರ ಸೈಟ್‌ಗಳಿಂದ ಎಳೆಯಲ್ಪಟ್ಟ ವಿಷಯವನ್ನು ಪ್ರದರ್ಶಿಸುವ ಬ್ಲಾಕ್ ಅನ್ನು ಸೇರಿಸಿ.','block titleEmbed'=>'ಹುದುಗಿಸು','block titleClassic'=>'‍‍ಕ್ಲಾಸಿಕ್','Embeds'=>'ಎಂಬೆಡ್(ಹುದುಗಿಸುವಿಕೆ)ಗಳು','Discussion'=>'ಚರ್ಚೆ','Add title'=>'ಶೀರ್ಷಿಕೆ ಸೇರಿಸಿ','Visibility:'=>'ಗೋಚರತೆ:','Copied!'=>'‍ನಕಲಿಸಲಾಗಿದೆ!','Submit for Review'=>'ವಿಮರ್ಶೆಗಾಗಿ ಸಲ್ಲಿಸಿ','Replace image'=>'ಚಿತ್ರವನ್ನು ಬದಲಾಯಿಸಿ','Order'=>'ಜೋಡಿಸುವಿಕೆ','Item added.'=>'ಐಟಂ ಸೇರಿಸಲಾಗಿದೆ.','(opens in a new tab)'=>'(ಹೊಸ ಟ್ಯಾಬ್‌ನಲ್ಲಿ ತೆರೆಯುತ್ತದೆ)','M j, Y g:i a'=>'M j, Y g:i a','The rendered block.'=>'ಪ್ರದರ್ಶಿತವಾದ ಬ್ಲಾಕ್.','Invalid block.'=>'ಅಮಾನ್ಯ ಬ್ಲಾಕ್.','Sorry, you are not allowed to read blocks as this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರರಂತೆ ಬ್ಲಾಕ್‌ಗಳನ್ನು ಓದಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to read blocks of this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪೋಸ್ಟ್‌ನ ಬ್ಲಾಕ್‌ಗಳನ್ನು ಓದಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','ID of the post context.'=>'ಪೋಸ್ಟ್ ಸಂದರ್ಭದ ID.','Attributes for the block.'=>'ಬ್ಲಾಕ್ನ ಗುಣಲಕ್ಷಣಗಳು.','Unique registered name for the block.'=>'ಬ್ಲಾಕ್‌ಗಾಗಿ ವಿಶಿಷ್ಟ ನೋಂದಾಯಿತ ಹೆಸರು.','Whether the theme supports responsive embedded content.'=>'ಥೀಮ್ ರೆಸ್ಪಾನ್ಸಿವ್ ಎಂಬೆಡೆಡ್ ವಿಷಯವನ್ನು ಬೆಂಬಲಿಸುತ್ತದೆಯೇ.','%s from now'=>'ಈಗಿನಿಂದ %s','Limit result set to themes assigned one or more statuses.'=>'ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ಸ್ಥಿತಿಗಳನ್ನು ನಿಗದಿಪಡಿಸಿದ ಥೀಮ್‌ಗಳಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಸೀಮಿತಗೊಳಿಸಿ.','Post formats supported.'=>'ಪೋಸ್ಟ್ ಸ್ವರೂಪಗಳು ಬೆಂಬಲಿತವಾಗಿದೆ.','Features supported by this theme.'=>'ಈ ಥೀಮ್ ಬೆಂಬಲಿಸುವ ವೈಶಿಷ್ಟ್ಯಗಳು.','The visibility settings for the taxonomy.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಗೆ ಗೋಚರತೆ ಸೆಟ್ಟಿಂಗ್‌ಗಳು.','Invalid type parameter.'=>'ಅಮಾನ್ಯ ಪ್ರಕಾರದ ನಿಯತಾಂಕ.','Limit results to items of one or more object subtypes.'=>'ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ವಸ್ತು ಉಪವಿಭಾಗಗಳ ಐಟಂಗಳಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Limit results to items of an object type.'=>'ವಸ್ತು ಪ್ರಕಾರದ ಐಟಂಗಳಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Object subtype.'=>'ವಸ್ತು ಉಪ ಪ್ರಕಾರ.','Object type.'=>'ವಸ್ತು ಪ್ರಕಾರ.','Internal search handler error.'=>'ಆಂತರಿಕ ಹುಡುಕಾಟ ಹ್ಯಾಂಡ್ಲರ್ ದೋಷ.','REST search handlers must extend the %s class.'=>'REST ಹುಡುಕಾಟ ಹ್ಯಾಂಡ್ಲರ್ಗಳು %s ವರ್ಗವನ್ನು ವಿಸ್ತರಿಸಬೇಕು.','The current user can post unfiltered HTML markup and JavaScript.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರು ಫಿಲ್ಟರ್ ಮಾಡದ HTML ಮಾರ್ಕ್ಅಪ್ ಮತ್ತು ಜಾವಾಸ್ಕ್ರಿಪ್ಟ್ ಅನ್ನು ಪೋಸ್ಟ್ ಮಾಡಬಹುದು.','Version of the content block format used by the post.'=>'ಪೋಸ್ಟ್ ಬಳಸಿದ ವಿಷಯ ಬ್ಲಾಕ್ ಸ್ವರೂಪದ ಆವೃತ್ತಿ.','Slug automatically generated from the post title.'=>'ಸ್ಲಗ್ ಪೋಸ್ಟ್ ಶೀರ್ಷಿಕೆಯಿಂದ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಉತ್ಪತ್ತಿಯಾಗುತ್ತದೆ.','Permalink template for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ಪರ್ಮಾಲಿಂಕ್ ಟೆಂಪ್ಲೇಟ್.','Preview link for the post.'=>'ಪೋಸ್ಟ್ಗಾಗಿ ಪೂರ್ವವೀಕ್ಷಣೆ ಲಿಂಕ್.','There is no autosave revision for this post.'=>'ಈ ಪೋಸ್ಟ್ಗೆ ಆಟೋಸೇವ್ ಪರಿಷ್ಕರಣೆ ಇಲ್ಲ.','Page updated.'=>'ಪುಟವನ್ನು ಪರಿಷ್ಕರಿಸಲಾಗಿದೆ.','Post updated.'=>'‍ಲೇಖನವನ್ನು ಪರಿಷ್ಕರಿಸಲಾಗಿದೆ.','Page scheduled.'=>'ಪುಟ ನಿಗದಿಪಡಿಸಲಾಗಿದೆ.','Post scheduled.'=>'ಪೋಸ್ಟ್ ನಿಗದಿಯಾಗಿದೆ.','Page reverted to draft.'=>'ಪುಟ ಡ್ರಾಫ್ಟ್ಗೆ ಹಿಂತಿರುಗಿಸಲಾಗಿದೆ.','Post reverted to draft.'=>'ಪೋಸ್ಟ್ ಡ್ರಾಫ್ಟ್ಗೆ ಮರಳಿದೆ.','Page published privately.'=>'ಪುಟವನ್ನು ಖಾಸಗಿಯಾಗಿ ಪ್ರಕಟಿಸಲಾಗಿದೆ.','Post published privately.'=>'ಪೋಸ್ಟ್ ಖಾಸಗಿಯಾಗಿ ಪ್ರಕಟವಾಗಿದೆ.','Page published.'=>'ಪುಟ ಪ್ರಕಟಿಸಲಾಗಿದೆ.','Post published.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಟಿಸಲಾಗಿದೆ.','Block type "%s" is not registered.'=>'ಬ್ಲಾಕ್ ರೀತಿಯ  " %s " ನೋಂದಣಿಯಾಗಿಲ್ಲ.','Block type "%s" is already registered.'=>'ಬ್ಲಾಕ್ ರೀತಿಯ  " %s " ಈಗಾಗಲೇ ನೋಂದಾಯಿಸಲಾಗಿದೆ.','Block type names must contain a namespace prefix. Example: my-plugin/my-custom-block-type'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರ ಹೆಸರುಗಳು ಒಂದು ನೇಮ್ಸ್ಪೇಸ್ ಪೂರ್ವಪ್ರತ್ಯಯವನ್ನು ಹೊಂದಿರಬೇಕು. ಉದಾಹರಣೆ: ನನ್ನ-ಪ್ಲಗಿನ್ / ನನ್ನ-ಕಸ್ಟಮ್ ಬ್ಲಾಕ್-ಪ್ರಕಾರ','Block type names must not contain uppercase characters.'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರದ ಹೆಸರುಗಳು ದೊಡ್ಡ ಅಕ್ಷರಗಳನ್ನು ಹೊಂದಿರಬಾರದು.','Block type names must be strings.'=>'ಬ್ಲಾಕ್ ಪ್ರಕಾರ ಹೆಸರುಗಳು ತಂತಿಗಳಾಗಿರಬೇಕು.','No comments to show.'=>'ತೋರಿಸಲು ಕಾಮೆಂಟ್ಗಳಿಲ್ಲ.','%1$s on %2$s'=>'%1$s ರಲ್ಲಿ %2$s','No archives to show.'=>'ತೋರಿಸಲು ಯಾವುದೇ ಆರ್ಕೈವ್‌ಗಳಿಲ್ಲ.','The offset number requested is larger than or equal to the number of available revisions.'=>'ವಿನಂತಿಸಲಾದ ಆಫ್ಸೆಟ್ ಸಂಖ್ಯೆಯು ಲಭ್ಯವಿರುವ ಪರಿಷ್ಕರಣೆಗಳ ಸಂಖ್ಯೆಗಿಂತ ದೊಡ್ಡದಾಗಿದೆ ಅಥವಾ ಸಮನಾಗಿರುತ್ತದೆ.','Unable to send personal data export confirmation email.'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು ದೃಡೀಕರಣ ಇಮೇಲ್ ಕಳುಹಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','[%1$s] Action Confirmed: %2$s'=>'[ %1$s ] ಕ್ರಿಯೆ ದೃಢೀಕರಿಸಲಾಗಿದೆ: %2$s','The current user can create terms in the %s taxonomy.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರು %s ಟ್ಯಾಕ್ಸಾನಮಿ ಪದಗಳನ್ನು ರಚಿಸಬಹುದು.','The current user can assign terms in the %s taxonomy.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರು %s ಟ್ಯಾಕ್ಸಾನಮಿ ಪದಗಳನ್ನು ನಿಯೋಜಿಸಬಹುದು.','The current user can change the author on this post.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರು ಈ ಪೋಸ್ಟ್ನಲ್ಲಿ ಲೇಖಕನನ್ನು ಬದಲಾಯಿಸಬಹುದು.','The current user can sticky this post.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರು ಈ ಪೋಸ್ಟ್ ಅನ್ನು ಸ್ಟಿಕಿ ಮಾಡಬಹುದು.','The current user can publish this post.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರು ಈ ಪೋಸ್ಟ್ ಅನ್ನು ಪ್ರಕಟಿಸಬಹುದು.','You have used 