earch.'=>'ಯಾವುದೇ ಥೀಮ್ಗಳು ಕಂಡುಬಂದಿಲ್ಲ. ಬೇರೆಯ ಹುಡುಕಾಟವನ್ನು ಪ್ರಯತ್ನಿಸಿ.','Your theme can display menus in one location. Select which menu you would like to use.'=>'ನಿಮ್ಮ ಥೀಮ್ ಒಂದೇ ಸ್ಥಳದಲ್ಲಿ ಮೆನುಗಳನ್ನು ಪ್ರದರ್ಶಿಸಬಹುದು. ನೀವು ಯಾವ ಮೆನುವನ್ನು ಬಳಸಲು ಬಯಸುತ್ತೀರಿ ಎಂಬುದನ್ನು ಆಯ್ಕೆ ಮಾಡಿ.','Site Name: %s'=>'ತಾಣದ ಹೆಸರು: %s','%1$s &lsaquo; %2$s &#8212; WordPress'=>'%1$s &lsaquo; %2$s &#8212; ವರ್ಡ್ಪ್ರೆಸ್','The query does not contain the correct number of placeholders (%1$d) for the number of arguments passed (%2$d).'=>'ಪ್ರಶ್ನೆಯು ರವಾನಿಸಲಾದ ವಾದಗಳ ಸಂಖ್ಯೆಗೆ (%2$d) ಸರಿಯಾದ ಸಂಖ್ಯೆಯ ಪ್ಲೇಸ್‌ಹೋಲ್ಡರ್‌ಗಳನ್ನು (%1$d) ಒಳಗೊಂಡಿರುವುದಿಲ್ಲ.','Unsupported value type (%s).'=>'ಬೆಂಬಲಿಸದ ಮೌಲ್ಯದ ಪ್ರಕಾರ (%s).','Widgets need to be registered using %s, before they can be displayed.'=>'ವಿಜೆಟ್‌ಗಳನ್ನು ಪ್ರದರ್ಶಿಸುವ ಮೊದಲು, %s ಬಳಸಿ ನೋಂದಾಯಿಸಿಕೊಳ್ಳಬೇಕು.','Link to:'=>'ಇದಕ್ಕೆ ಲಿಂಕ್ ಮಾಡಿ:','No images selected'=>'ಯಾವುದೇ ಚಿತ್ರಗಳನ್ನು ಆಯ್ಕೆ ಮಾಡಲಾಗಿಲ್ಲ','Displays an image gallery.'=>'ಒಂದು ಚಿತ್ರ ಗ್ಯಾಲರಿಯನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','Gallery'=>'ಗ್ಯಾಲರಿ','Custom HTML Widget'=>'ಅಗತ್ಯಾನುಗುಣಗೊಳಿಸಿದ HTML ವಿಜೆಟ್','Use the Custom HTML widget to add arbitrary HTML code to your widget areas.'=>'ನಿಮ್ಮ ವಿಜೆಟ್ ಪ್ರದೇಶಗಳಿಗೆ ಅನಿಯಂತ್ರಿತ HTML ಕೋಡ್ ಸೇರಿಸಲು ಕಸ್ಟಮ್ HTML ವಿಜೆಟ್ ಬಳಸಿ.','Your email address has not been updated yet. Please check your inbox at %s for a confirmation email.'=>'ನಿಮ್ಮ ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ಇನ್ನೂ ನವೀಕರಿಸಲಾಗಿಲ್ಲ. ದೃಢೀಕರಣ ಇಮೇಲ್ಗಾಗಿ ದಯವಿಟ್ಟು ನಿಮ್ಮ ಇನ್ಬಾಕ್ಸ್ ಅನ್ನು %s ನಲ್ಲಿ ಪರಿಶೀಲಿಸಿ.','Howdy ###USERNAME###,

