###SITEURL###','Only UUID V4 is supported at this time.'=>'ಈ ಸಮಯದಲ್ಲಿ UUID V4 ಮಾತ್ರ ಬೆಂಬಲಿತವಾಗಿದೆ.','The Press This plugin is required.'=>'ಪ್ರೆಸ್ ದಿಸ್ ಈ ಪ್ಲಗಿನ್ ಅಗತ್ಯವಿದೆ.','%s themes'=>'%s ಥೀಮ್ಗಳು','Filter themes (%s)'=>'ಫಿಲ್ಟರ್ ಥೀಮ್ಗಳು ( %s )','Go to theme sources'=>'ಥೀಮ್ ಮೂಲಗಳಿಗೆ ಹಿಂತಿರುಗಿ','Search WordPress.org themes'=>'WordPress.org ಥೀಮ್‌ಗಳನ್ನು ಹುಡುಕಿ','Install &amp; Preview'=>'ಸ್ಥಾಪಿಸಿ ಮತ್ತು ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡಿ','Invalid URL.'=>'ಅಮಾನ್ಯವಾದ URL.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'ಕೆಲವು ಲಿಂಕ್‌ಗಳನ್ನು ಸೇರಿಸುವ ಸಮಯ! ಕ್ಲಿಕ್ ಮಾಡಿ &#8220;%s &#8221; ನಿಮ್ಮ ಮೆನುವಿನಲ್ಲಿ ಪುಟಗಳು, ವರ್ಗಗಳು ಮತ್ತು ಕಸ್ಟಮ್ ಲಿಂಕ್‌ಗಳನ್ನು ಹಾಕಲು ಆರಂಭಿಸಲು. ನೀವು ಇಷ್ಟಪಡುವಷ್ಟು ವಿಷಯಗಳನ್ನು ಸೇರಿಸಿ.','Choose image'=>'ಚಿತ್ರವನ್ನು ಆಯ್ಕೆಮಾಡಿ‍','Choose audio'=>'ಆಡಿಯೊ ಆಯ್ಕೆಮಾಡಿ‍ ‍‍','Change audio'=>'ಆಡಿಯೋ ಬದಲಿಸಿ','Select audio'=>'‍ಆಡಿಯೊ ಆಯ್ಕೆಮಾಡಿ‍ ‍‍','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'&#8220; ಹೊಸ ಚಿತ್ರವನ್ನು ಸೇರಿಸಿ &#8221; ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ನಿಂದ ಇಮೇಜ್ ಫೈಲ್ ಅನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು. %s ಪಿಕ್ಸೆಲ್‌ಗಳ ಹೆಡರ್ ಎತ್ತರವಿರುವ ಚಿತ್ರದೊಂದಿಗೆ ನಿಮ್ಮ ಥೀಮ್ ಉತ್ತಮವಾಗಿ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತದೆ &#8212; ಪರಿಪೂರ್ಣ ಫಿಟ್‌ಗಾಗಿ ನೀವು ಒಮ್ಮೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಿದ ನಂತರ ನಿಮ್ಮ ಚಿತ್ರವನ್ನು ಕ್ರಾಪ್ ಮಾಡಲು ನಿಮಗೆ ಸಾಧ್ಯವಾಗುತ್ತದೆ.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ನಿಂದ ಇಮೇಜ್ ಫೈಲ್ ಅಪ್‌ಲೋಡ್ ಮಾಡಲು &#8220;ಹೊಸ ಇಮೇಜ್ ಸೇರಿಸಿ&#8221; ಕ್ಲಿಕ್ ಮಾಡಿ. ನಿಮ್ಮ ಥೀಮ್ %s ಪಿಕ್ಸೆಲ್‌ಗಳ ಶಿರೋನಾಮೆ ಗಾತ್ರದ ಚಿತ್ರದೊಂದಿಗೆ ಉತ್ತಮವಾಗಿ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತದೆ &#8212; ಒಮ್ಮೆ ನೀವು ಅದನ್ನು ಸೂಕ್ತವಾಗಿ ಅಪ್‌ಲೋಡ್ ಮಾಡಿದ ನಂತರ ನಿಮ್ಮ ಚಿತ್ರವನ್ನು ಕ್ರಾಪ್ ಮಾಡಲು ನಿಮಗೆ ಸಾಧ್ಯವಾಗುತ್ತದೆ.','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'ಮೆರಿಡಿಯನ್','Minute'=>'ನಿಮಿಷ','Hour'=>'‍ಗಂಟೆ','Time'=>'‍ಸಮಯ','Day'=>'‍ದಿನ','Month'=>'‍ತಿಂಗಳು','Date'=>'ದಿನಾಂಕ','Usage of user levels is deprecated. Use capabilities instead.'=>'ಬಳಕೆದಾರ ಮಟ್ಟಗಳ ಬಳಕೆ ಅಸಮ್ಮತಿಗೊಂಡಿದೆ. ಬದಲಿಗೆ ಸಾಮರ್ಥ್ಯಗಳನ್ನು ಬಳಸಿ.','The theme defines itself as its parent theme. Please check the %s header.'=>'ಥೀಮ್ ತನ್ನ ಮೂಲ ಥೀಮ್ ಎಂದು ಸ್ವತಃ ವ್ಯಾಖ್ಯಾನಿಸುತ್ತದೆ. ದಯವಿಟ್ಟು %s ಹೆಡರ್ ಅನ್ನು ಪರಿಶೀಲಿಸಿ.','Name for the Visual editor tabVisual'=>'ದೃಶ್ಯ','Create New Menu'=>'ಹೊಸ ಮೆನು ರಚಿಸಿ‍','New Menu'=>'ಹೊಸ ಮೆನು','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'ನಿಮ್ಮ ಥೀಮ್ ವಿಜೆಟ್ ಪ್ರದೇಶಗಳನ್ನು ಹೊಂದಿದ್ದರೆ, ನೀವು ಅಲ್ಲಿ ಮೆನುಗಳನ್ನು ಕೂಡ ಸೇರಿಸಬಹುದು. <a href="%s">ವಿಜೆಟ್‌ಗಳ ಫಲಕ</a>ಕ್ಕೆ ಭೇಟಿ ನೀಡಿ ಮತ್ತು ಸೈಡ್‌ಬಾರ್ ಅಥವಾ ಅಡಿಟಿಪ್ಪಣಿಯಲ್ಲಿ ಮೆನುವನ್ನು ಪ್ರದರ್ಶಿಸಲು &#8220;ನ್ಯಾವಿಗೇಷನ್ ಮೆನು ವಿಜೆಟ್&#8221; ಅನ್ನು ಸೇರಿಸಿ.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'ನಿಮ್ಮ ಥೀಮ್ ಬಹು ಮೆನುಗಳನ್ನು ಹೊಂದಿದ್ದರೆ, ಅವುಗಳಿಗೆ ಸ್ಪಷ್ಟವಾದ ಹೆಸರುಗಳನ್ನು ನೀಡುವ ಮೂಲಕ ಅವುಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಸಹಾಯ ಮಾಡುತ್ತದೆ.','Your theme can display menus in %s location.'=>'ನಿಮ್ಮ ಥೀಮ್ %s ಸ್ಥಳದಲ್ಲಿ ಮೆನುಗಳನ್ನು ಪ್ರದರ್ಶಿಸಬಹುದು.' . "\0" . 'ನಿಮ್ಮ ಥೀಮ್ %s ಸ್ಥಳಗಳಲ್ಲಿ ಮೆನುಗಳನ್ನು ಪ್ರದರ್ಶಿಸಬಹುದು.','Your theme can display menus in one location.'=>'ನಿಮ್ಮ ಥೀಮ್ ಒಂದೇ ಸ್ಥಳದಲ್ಲಿ ಮೆನುಗಳನ್ನು ಪ್ರದರ್ಶಿಸಬಹುದು.','CSS code'=>'CSS ಸಂಕೇತ','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'ಸಂಪಾದನೆ ಕ್ಷೇತ್ರವು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಕೋಡ್ ಸಿಂಟ್ಯಾಕ್ಸ್ ಅನ್ನು ಎತ್ತಿ ತೋರಿಸುತ್ತದೆ. ಸರಳ ಪಠ್ಯ ಕ್ರಮದಲ್ಲಿ ಕೆಲಸ ಮಾಡಲು ನೀವು ಇದನ್ನು ನಿಮ್ಮ <a href="%1$s" %2$s>ಬಳಕೆದಾರರ ಪ್ರೊಫೈಲ್‌%3$s</a>ನಲ್ಲಿ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಬಹುದು.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'ಸ್ಕ್ರೀನ್ ರೀಡರ್ ಬಳಕೆದಾರರು: ಫಾರ್ಮ್ ಮೋಡ್‌ನಲ್ಲಿರುವಾಗ, ನೀವು Esc ಕೀಲಿಯನ್ನು ಎರಡು ಬಾರಿ ಒತ್ತಬೇಕಾಗುತ್ತದೆ.','To move away from this area, press the Esc key followed by the Tab key.'=>'ಈ ಪ್ರದೇಶದಿಂದ ದೂರವಿರಲು, Tab ಕೀ ನಂತರ Esc ಕೀಲಿಯನ್ನು ಒತ್ತಿರಿ.','In the editing area, the Tab key enters a tab character.'=>'ಸಂಪಾದನೆ ಪ್ರದೇಶದಲ್ಲಿ, ಟ್ಯಾಬ್ ಕೀ ಟ್ಯಾಬ್ ಅಕ್ಷರವನ್ನು ಪ್ರವೇಶಿಸುತ್ತದೆ.','When using a keyboard to navigate:'=>'ನ್ಯಾವಿಗೇಟ್ ಮಾಡಲು ಕೀಬೋರ್ಡ್ ಬಳಸುವಾಗ:','Add your own CSS code here to customize the appearance and layout of your site.'=>'ನಿಮ್ಮ ಸೈಟ್‌ನ ನೋಟ ಮತ್ತು ವಿನ್ಯಾಸವನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡಲು ನಿಮ್ಮ ಸ್ವಂತ CSS ಕೋಡ್ ಅನ್ನು ಇಲ್ಲಿ ಸೇರಿಸಿ.','Your homepage displays'=>'ನಿಮ್ಮ ಮುಖಪುಟ ಪ್ರದರ್ಶನಗಳು','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'ನಿಮ್ಮ ಸೈಟ್ ನ ಮುಖಪುಟದಲ್ಲಿ ಏನನ್ನು ಪ್ರದರ್ಶಿಸಲಾಗಿದೆ ಎಂಬುದನ್ನು ನೀವು ಆಯ್ಕೆ ಮಾಡಬಹುದು. ಇದು ಹಿಮ್ಮುಖ ಕಾಲಾನುಕ್ರಮದ (ಕ್ಲಾಸಿಕ್ ಬ್ಲಾಗ್), ಅಥವಾ ಸ್ಥಿರ/ಸ್ಥಿರ ಪುಟದಲ್ಲಿ ಪೋಸ್ಟ್ ಗಳಾಗಿರಬಹುದು. ಸ್ಥಿರ ಮುಖಪುಟವನ್ನು ಹೊಂದಿಸಲು, ನೀವು ಮೊದಲು ಎರಡು ಪುಟಗಳನ್ನು ರಚಿಸಬೇಕು. ಒಂದು ಮುಖಪುಟವಾಗುತ್ತದೆ, ಮತ್ತು ಇನ್ನೊಂದು ನಿಮ್ಮ ಪೋಸ್ಟ್ ಗಳನ್ನು ಪ್ರದರ್ಶಿಸುವ ಸ್ಥಳವಾಗಿರುತ್ತದೆ.','Homepage Settings'=>'ಮುಖಪುಟ ಸೆಟ್ಟಿಂಗ್ಗಳು','WordPress.org themes'=>'WordPress.org ಥೀಮ್‌ಗಳು','Installed themes'=>'ಸ್ಥಾಪಿಸಲಾದ ಥೀಮ್‌ಗಳು','Publish Settings'=>'ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು ಪ್ರಕಟಿಸಿ','Copied'=>'ನಕಲಿಸಲಾಗಿದೆ','Preview Link'=>'ಪೂರ್ವವೀಕ್ಷಣೆ ಲಿಂಕ್','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್‌ನಲ್ಲಿ ಬದಲಾವಣೆಗಳು ಹೇಗೆ ಲೈವ್ ಆಗಿ ಕಾಣುತ್ತವೆ ಎಂಬುದನ್ನು ನೋಡಿ ಮತ್ತು ಕಸ್ಟಮೈಜರ್ ಅನ್ನು ಪ್ರವೇಶಿಸಲು ಸಾಧ್ಯವಾಗದ ಜನರೊಂದಿಗೆ ಪೂರ್ವವೀಕ್ಷಣೆಯನ್ನು ಹಂಚಿಕೊಳ್ಳಿ.','Share Preview Link'=>'ಪೂರ್ವವೀಕ್ಷಣೆ ಲಿಂಕ್ ಹಂಚಿಕೊಳ್ಳಿ','Changes trashed successfully.'=>'ಬದಲಾವಣೆಗಳನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಟ್ರ್ಯಾಶ್ ಮಾಡಲಾಗಿದೆ.','Changes have already been trashed.'=>'ಬದಲಾವಣೆಗಳನ್ನು ಈಗಾಗಲೇ ಟ್ರ್ಯಾಶ್ ಮಾಡಲಾಗಿದೆ.','Unable to trash changes.'=>'ಬದಲಾವಣೆಗಳನ್ನು ಟ್ರ್ಯಾಶ್ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ.','No changes saved yet, so there is nothing to trash.'=>'ಯಾವುದೇ ಬದಲಾವಣೆಗಳನ್ನು ಇನ್ನೂ ಉಳಿಸಲಾಗಿಲ್ಲ, ಆದ್ದರಿಂದ ಟ್ರಾಶ್ ಮಾಡಲು ಏನೂ ಇಲ್ಲ.','There was an authentication problem. Please reload and try again.'=>'ದೃಢೀಕರಣ ಸಮಸ್ಯೆ ಕಂಡುಬಂದಿದೆ. ದಯವಿಟ್ಟು ಮರುಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಮತ್ತೆ ಪ್ರಯತ್ನಿಸಿ.','Unable to save due to %s invalid setting.'=>'%s ಅಮಾನ್ಯ ಸೆಟ್ಟಿಂಗ್‌ನಿಂದಾಗಿ ಉಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.' . "\0" . '%s ಅಮಾನ್ಯ ಸೆಟ್ಟಿಂಗ್‌ಗಳಿಂದಾಗಿ ಉಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','You must supply a future date to schedule.'=>'ನೀವು ವೇಳಾಪಟ್ಟಿಗಾಗಿ ಭವಿಷ್ಯದ ದಿನಾಂಕವನ್ನು ಪೂರೈಸಬೇಕು.','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'ಬದಲಾವಣೆಗಳ ಹಿಂದಿನ ಸೆಟ್ ಅನ್ನು ಈಗಾಗಲೇ ಪ್ರಕಟಿಸಲಾಗಿದೆ. ದಯವಿಟ್ಟು ನಿಮ್ಮ ಪ್ರಸ್ತುತ ಬದಲಾವಣೆಗಳನ್ನು ಉಳಿಸಲು ಪ್ರಯತ್ನಿಸಿ.','Edit User'=>'ಬಳಕೆದಾರರನ್ನು ಸಂಪಾದಿಸಿ','View User'=>'ಬಳಕೆದಾರರನ್ನು ವೀಕ್ಷಿಸಿ','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'ಹೇ ಅಲ್ಲಿ, ನೀವು ಪಠ್ಯ ವಿಜೆಟ್ ನ "ವಿಷುವಲ್" ಟ್ಯಾಬ್ ಗೆ ಎಚ್ ಟಿಎಂಎಲ್ ಅನ್ನು ಅಂಟಿಸಿದಂತೆ ಕಾಣುತ್ತದೆ. ಅದರ ಬದಲು ನೀವು ನಿಮ್ಮ ಕೋಡ್ ಅನ್ನು "ಪಠ್ಯ" ಟ್ಯಾಬ್ ಗೆ ಅಂಟಿಸಲು ಬಯಸಬಹುದು. ಪರ್ಯಾಯವಾಗಿ, ಹೊಸ "ಕಸ್ಟಮ್ ಎಚ್ ಟಿಎಮ್ ಎಲ್" ವಿಜೆಟ್ ಅನ್ನು ಪ್ರಯತ್ನಿಸಿ!','Did you just paste HTML?'=>'ನೀವು HTML ಅನ್ನು ಅಂಟಿಸಿದ್ದೀರಾ?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'ಈಗ "ಕಸ್ಟಮ್ ಎಚ್ ಟಿಎಮ್ ಎಲ್" ವಿಜೆಟ್ ಇದೆ ಎಂದು ನಿಮಗೆ ತಿಳಿದಿದೆಯೇ? ಈ ಪರದೆಯಲ್ಲಿ ಲಭ್ಯವಿರುವ ವಿಜೆಟ್ ಗಳ ಪಟ್ಟಿಯನ್ನು ಸ್ಕ್ಯಾನ್ ಮಾಡುವ ಮೂಲಕ ನೀವು ಅದನ್ನು ಕಂಡುಕೊಳ್ಳಬಹುದು. ನಿಮ್ಮ ಸೈಟ್ ಗೆ ಕೆಲವು ಕಸ್ಟಮ್ ಕೋಡ್ ಸೇರಿಸಲು ಅದನ್ನು ಪರಿಶೀಲಿಸಿ!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'ಈಗ "ಕಸ್ಟಮ್ ಎಚ್ ಟಿಎಮ್ ಎಲ್" ವಿಜೆಟ್ ಇದೆ ಎಂದು ನಿಮಗೆ ತಿಳಿದಿದೆಯೇ? <a class="add-widget" href="#">"ವಿಜೆಟ್ ಸೇರಿಸಿ"</a>ಬಟನ್ ಒತ್ತಿ ಮತ್ತು "ಎಚ್ ಟಿಎಂಎಲ್" ಗಾಗಿ ಹುಡುಕುವ ಮೂಲಕ ನೀವು ಅದನ್ನು ಕಂಡುಕೊಳ್ಳಬಹುದು. ನಿಮ್ಮ ಸೈಟ್ ಗೆ ಕೆಲವು ಕಸ್ಟಮ್ ಕೋಡ್ ಸೇರಿಸಲು ಅದನ್ನು ಪರಿಶೀಲಿಸಿ!','New Custom HTML Widget'=>'ಹೊಸ ಅಗತ್ಯಾನುಗೊಳಿಸಿದ HTML ವಿಜೆಟ್','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'ಈ ವಿಜೆಟ್ &#8220;Custom HTML&#8221; ವಿಜೆಟ್ನಲ್ಲಿ ಉತ್ತಮವಾಗಿ ಕಾರ್ಯನಿರ್ವಹಿಸಬಹುದಾದ ಕೋಡ್ ಅನ್ನು ಹೊಂದಿರಬಹುದು. ಬದಲಾಗಿ ಆ ವಿಜೆಟ್ ಅನ್ನು ಪ್ರಯತ್ನಿಸಿದರೆ ಹೇಗೆ?','Arbitrary text.'=>'ಅನಿಯಂತ್ರಿತ ಪಠ್ಯ.','Some HTML tags are not permitted, including:'=>'ಕೆಲವು HTML ಟ್ಯಾಗ್‌ಗಳನ್ನು ಅನುಮತಿಸಲಾಗುವುದಿಲ್ಲ, ಅವುಗಳೆಂದರೆ:','Custom HTML'=>'ಕಸ್ಟಮ್ HTML','Arbitrary HTML code.'=>'ನಿರಂಕುಶ HTML ಕೋಡ್.','Show tag counts'=>'ಟ್ಯಾಗ್ ಎಣಿಕೆಗಳನ್ನು ತೋರಿಸಿ','%s item'=>'%s ಐಟಂ' . "\0" . '%s ಐಟಂಗಳು','label for button in the media widgetAdd Media'=>'ಮಾಧ್ಯಮವನ್ನು ಸೇರಿಸಿ','label for button in the video widgetAdd Video'=>'ವೀಡಿಯೊ ಸೇರಿಸಿ','label for button in the image widgetAdd Image'=>'ಚಿತ್ರವನ್ನು ಸೇರಿಸಿ','label for button in the audio widgetAdd Audio'=>'ಆಡಿಯೋ ಸೇರಿಸಿ','(no author)'=>'(ಲೇಖಕರಿಲ್ಲ)','To change or disable registration go to your <a href="%s">Options page</a>.'=>'ನೋಂದಣಿ ಬದಲಾಯಿಸಲು ಅಥವಾ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು ನಿಮ್ಮ <a href="%s">ಆಯ್ಕೆಗಳು ಪುಟ</a> ಕ್ಕೆ ಹೋಗಿ.','The network currently allows both site and user registrations.'=>'ನೆಟ್ವರ್ಕ್ ಪ್ರಸ್ತುತ ತಾಣ ಮತ್ತು ಬಳಕೆದಾರರ ದಾಖಲಾತಿಗಳನ್ನು ಅನುಮತಿಸುತ್ತದೆ.','The network currently allows user registrations.'=>'ನೆಟ್ವರ್ಕ್ ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರ ದಾಖಲಾತಿಗಳನ್ನು ಅನುಮತಿಸುತ್ತದೆ.','The network currently allows site registrations.'=>'ನೆಟ್ವರ್ಕ್ ಪ್ರಸ್ತುತ ತಾಣ ನೋಂದಣಿಗಳನ್ನು ಅನುಮತಿಸುತ್ತದೆ.','The network currently disallows registrations.'=>'ನೆಟ್ವರ್ಕ್ ಪ್ರಸ್ತುತ ನೋಂದಣಿಗಳನ್ನು ಅನುಮತಿಸುವುದಿಲ್ಲ.','Greetings Network Administrator!'=>'ಶುಭಾಶಯಗಳು ನೆಟ್ವರ್ಕ್ ನಿರ್ವಾಹಕ!','Title for the widget'=>'ವಿಜೆಟ್ಗಾಗಿ ಶೀರ್ಷಿಕೆ','URL to the media file'=>'ಮಾಧ್ಯಮ ಕಡತಕ್ಕೆ URL','Attachment post ID'=>'ಲಗತ್ತ