ut this particular page does not display it.'=>'ನಿಮ್ಮ ಥೀಮ್ 1 ವಿಜೆಟ್ ಪ್ರದೇಶವನ್ನು ಹೊಂದಿದೆ, ಆದರೆ ಈ ನಿರ್ದಿಷ್ಟ ಪುಟವು ಅದನ್ನು ಪ್ರದರ್ಶಿಸುವುದಿಲ್ಲ.','Your theme has %s other widget area, but this particular page does not display it.'=>'ನಿಮ್ಮ ಥೀಮ್ %s ಇತರ ವಿಜೆಟ್ ಪ್ರದೇಶವನ್ನು ಹೊಂದಿದೆ, ಆದರೆ ಈ ನಿರ್ದಿಷ್ಟ ಪುಟವು ಅದನ್ನು ಪ್ರದರ್ಶಿಸುವುದಿಲ್ಲ.' . "\0" . 'ನಿಮ್ಮ ಥೀಮ್ %s ಇತರ ವಿಜೆಟ್ ಪ್ರದೇಶಗಳನ್ನು ಹೊಂದಿದೆ, ಆದರೆ ಈ ನಿರ್ದಿಷ್ಟ ಪುಟವು ಅದನ್ನು ಪ್ರದರ್ಶಿಸುವುದಿಲ್ಲ.','Your theme has 1 other widget area, but this particular page does not display it.'=>'ನಿಮ್ಮ ಥೀಮ್ 1 ಇತರ ವಿಜೆಟ್ ಪ್ರದೇಶವನ್ನು ಹೊಂದಿದೆ, ಆದರೆ ಈ ನಿರ್ದಿಷ್ಟ ಪುಟವು ಅದನ್ನು ಪ್ರದರ್ಶಿಸುವುದಿಲ್ಲ.','This address is used for admin purposes, like new user notification.'=>'ಹೊಸ ಬಳಕೆದಾರರ ಅಧಿಸೂಚನೆಯಂತಹ ನಿರ್ವಾಹಕ ಉದ್ದೇಶಗಳಿಗಾಗಿ ಈ ವಿಳಾಸವನ್ನು ಬಳಸಲಾಗುತ್ತದೆ.','Unique identifier for the term.'=>'ಪದಕ್ಕಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','Required to be true, as terms do not support trashing.'=>'ನಿಯಮಗಳು ಕಸದ ಬುಟ್ಟಿಗೆ ಬೆಂಬಲ ನೀಡದ ಕಾರಣ, ಸತ್ಯವಾಗಿರಬೇಕು.','An alphanumeric identifier for the taxonomy.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಗಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಐಡೆಂಟಿಫಯರ್.','Required to be true, as revisions do not support trashing.'=>'ಸತ್ಯವಾಗಿರಬೇಕು, ಏಕೆಂದರೆ ಪರಿಷ್ಕರಣೆಗಳು ಕಸದ ಬುಟ್ಟಿಗೆ ಬೆಂಬಲ ನೀಡುವುದಿಲ್ಲ.','REST base route for the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕೆ REST ಮೂಲ ಮಾರ್ಗ.','An alphanumeric identifier for the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಐಡೆಂಟಿಫೈಯರ್.','Human-readable labels for the post type for various contexts.'=>'ವಿವಿಧ ಸಂದರ್ಭಗಳಿಗಾಗಿ ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕಾಗಿ ಮಾನವ-ಓದಬಲ್ಲ ಲೇಬಲ್‌ಗಳು.','Whether or not the post type should have children.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರವು ಮಕ್ಕಳನ್ನು ಹೊಂದಿರಬೇಕೆ ಅಥವಾ ಬೇಡವೇ.','A human-readable description of the post type.'=>'ಪೋಸ್ಟ್ ರೀತಿಯ ಮಾನವನ ಓದಬಹುದಾದ ವಿವರಣೆ.','All capabilities used by the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರದಿಂದ ಬಳಸಲಾದ ಎಲ್ಲಾ ಸಾಮರ್ಥ್ಯಗಳು.','An alphanumeric identifier for the status.'=>'ಸ್ಥಿತಿಗಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಐಡೆಂಟಿಫಯರ್.','Limit response to comments published before a given ISO8601 compliant date.'=>'ನೀಡಿರುವ ISO8601 ಅನುಸರಣಾ ದಿನಾಂಕದ ಮೊದಲು ಪ್ರಕಟಿಸಿದ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Limit response to comments published after a given ISO8601 compliant date.'=>'ನೀಡಿರುವ ISO8601 ಅನುಸರಣಾ ದಿನಾಂಕದ ನಂತರ ಪ್ರಕಟಿಸಿದ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Avatar URLs for the user.'=>'ಬಳಕೆದಾರರಿಗೆ ಅವತಾರ್ URL ಗಳು.','Roles assigned to the user.'=>'ಬಳಕೆದಾರನಿಗೆ ನಿಯೋಜಿಸಲಾದ ಪಾತ್ರಗಳು.','The nickname for the user.'=>'ಬಳಕೆದಾರರಿಗಾಗಿ ಅಡ್ಡಹೆಸರು.','Locale for the user.'=>'ಬಳಕೆದಾರರಿಗಾಗಿ ಸ್ಥಳ.','Author URL of the user.'=>'ಬಳಕೆದಾರರ ಲೇಖಕರ URL.','Description of the user.'=>'ಬಳಕೆದಾರರ ವಿವರಣೆ.','URL of the user.'=>'ಬಳಕೆದಾರರ URL.','Last name for the user.'=>'ಬಳಕೆದಾರರಿಗಾಗಿ ಕೊನೆಯ ಹೆಸರು.','First name for the user.'=>'ಬಳಕೆದಾರರಿಗೆ ಮೊದಲ ಹೆಸರು.','Display name for the user.'=>'ಬಳಕೆದಾರರ ಹೆಸರನ್ನು ಪ್ರದರ್ಶಿಸಿ.','Login name for the user.'=>'ಬಳಕೆದಾರರ ಲಾಗಿನ್ ಹೆಸರು.','The user cannot be deleted.'=>'ಬಳಕೆದಾರರನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Error creating new user.'=>'ಹೊಸ ಬಳಕೆದಾರರನ್ನು ಸೃಷ್ಟಿಸುವಾಗ ದೋಷ ಕಂಡುಬಂದಿದೆ.','The parent term ID.'=>'ಮೂಲ ಪದದ ID.','HTML title for the term.'=>'ಪದಕ್ಕಾಗಿ HTML ಶೀರ್ಷಿಕೆ.','URL of the term.'=>'ಪದದ URL.','The term cannot be deleted.'=>'ಪದವನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Sorry, you are not allowed to view themes.'=>'ಕ್ಷಮಿಸಿ, ಥೀಮ್‌ಗಳನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Cannot set parent term, taxonomy is not hierarchical.'=>'ಪೋಷಕ ಪದವನ್ನು ಹೊಂದಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ, ಟ್ಯಾಕ್ಸಾನಮಿ ಕ್ರಮಾನುಗತವಾಗಿಲ್ಲ.','Term does not exist.'=>'ಪದ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Types associated with the taxonomy.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಗೆ ಸಂಬಂಧಿಸಿದ ವಿಧಗಳು.','The title for the taxonomy.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಗೆ ಶೀರ್ಷಿಕೆ.','The title for the post type.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಾರದ ಶೀರ್ಷಿಕೆ.','Cannot view post type.'=>'ಲೇಖನದ ಪ್ರಕಾರವನ್ನು ವೀಕ್ಷಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','The title for the status.'=>'ಸ್ಥಿತಿಗಾಗಿ ಶೀರ್ಷಿಕೆ.','Cannot view status.'=>'ಸ್ಥಿತಿಯನ್ನು ವೀಕ್ಷಿಸಲಾಗುವುದಿಲ್ಲ.','Invalid status.'=>'ಸ್ಥಿತಿ ಸಿಂಧುವಲ್ಲ.','URL to the original attachment file.'=>'ಮೂಲ ಲಗತ್ತು ಕಡತಕ್ಕೆ URL.','The attachment MIME type.'=>'ಲಗತ್ತಿಸುವಿಕೆ MIME ಪ್ರಕಾರ.','Attachment type.'=>'ಲಗತ್ತು ಪ್ರಕಾರ.','The attachment description.'=>'ಲಗತ್ತು ವಿವರಣೆ.','The attachment caption.'=>'ಲಗತ್ತು ಶೀರ್ಷಿಕೆ.','Default post category.'=>'ಅಗತ್ಯಾನುಗುಣಗೊಳಿಸಿದ ಲೇಖನದ ವರ್ಗ.','Site tagline.'=>'ತಾಣದ ಅಡಿಬರಹ.','theme authorBy %s'=>'‍%s ಮೂಲಕ','New user notification email subject[%1$s] Activate %2$s'=>'[%1$s ]%2$s ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿ','New site notification email subject[%1$s] Activate %2$s'=>'[%1$s] ಸಕ್ರಿಯಗೊಳಿಸಿ %2$s','RSS Error:'=>'RSS ದೋಷ:','Cannot create a comment with that type.'=>'ಆ ರೀತಿಯೊಂದಿಗೆ ಪ್ರತಿಕ್ರಿಯೆ ಸೃಷ್ಟಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Invalid slug.'=>'ಅಮಾನ್ಯ ಸ್ಲಗ್.','Invalid email address.'=>'ಅಮಾನ್ಯವಾದ ಇಮೇಲ್ ವಿಳಾಸ.','Invalid comment content.'=>'ಅಮಾನ್ಯವಾದ ಪ್ರತಿಕ್ರಿಯೆ ವಿಷಯ.','Invalid JSONP callback function.'=>'ಅಮಾನ್ಯ JSONP ಕಾಲ್‌ಬ್ಯಾಕ್ ಕಾರ್ಯ.','Invalid page template.'=>'ಅಮಾನ್ಯ ಪುಟ ಟೆಂಪ್ಲೇಟ್.','Invalid date.'=>'ಅಮಾನ್ಯವಾದ ದಿನಾಂಕ.','Video is playing.'=>'ವೀಡಿಯೊ ಪ್ಲೇ ಆಗುತ್ತಿದೆ.','Video is paused.'=>'ವೀಡಿಯೊವನ್ನು ವಿರಾಮಗೊಳಿಸಲಾಗಿದೆ.','Theme starter contentArchives'=>'ಸಂಗ್ರಹಗಳು','Theme starter contentThis is an example of a homepage section. Homepage sections can be any page other than the homepage itself, including the page that shows your latest blog posts.'=>'ಇದು ಮುಖಪುಟ ವಿಭಾಗಕ್ಕೆ ಉದಾಹರಣೆಯಾಗಿದೆ. ಮುಖಪುಟ ವಿಭಾಗಗಳು ನಿಮ್ಮ ಇತ್ತೀಚಿನ ಬ್ಲಾಗ್ ಪೋಸ್ಟ್‌ಗಳನ್ನು ತೋರಿಸುವ ಪುಟವನ್ನು ಒಳಗೊಂಡಂತೆ ಮುಖಪುಟವನ್ನು ಹೊರತುಪಡಿಸಿ ಯಾವುದೇ ಪುಟವಾಗಿರಬಹುದು.','Theme starter contentNews'=>'ಸುದ್ದಿ','Theme starter contentThis is a page with some basic contact information, such as an address and phone number. You might also try a plugin to add a contact form.'=>'ಇದು ವಿಳಾಸ ಮತ್ತು ಫೋನ್ ಸಂಖ್ಯೆಯಂತಹ ಕೆಲವು ಮೂಲ ಸಂಪರ್ಕ ಮಾಹಿತಿಯಿರುವ ಪುಟವಾಗಿದೆ. ಸಂಪರ್ಕ ಫಾರ್ಮ್ ಅನ್ನು ಸೇರಿಸಲು ನೀವು ಪ್ಲಗಿನ್ ಅನ್ನು ಸಹ ಪ್ರಯತ್ನಿಸಬಹುದು.','Theme starter contentYou might be an artist who would like to introduce yourself and your work here or maybe you are a business with a mission to describe.'=>'ನೀವು ಇಲ್ಲಿ ನಿಮ್ಮನ್ನು ಮತ್ತು ನಿಮ್ಮ ಕೆಲಸವನ್ನು ಪರಿಚಯಿಸಲು ಬಯಸುವ ಕಲಾವಿದರಾಗಿರಬಹುದು ಅಥವಾ ನೀವು ವಿವರಿಸುವ ಉದ್ದೇಶವನ್ನು ಹೊಂದಿರುವ ವ್ಯವಹಾರವಾಗಿರಬಹುದು.','Theme starter contentWelcome to your site! This is your homepage, which is what most visitors will see when they come to your site