ಕ್ಕೆ ಹೊಂದಿಕೆಯಾಗುವ ಬಳಕೆದಾರರಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಸೀಮಿತಗೊಳಿಸಿ. CSV ಪಟ್ಟಿ ಅಥವಾ ಒಂದೇ ಪಾತ್ರವನ್ನು ಸ್ವೀಕರಿಸುತ್ತದೆ.','Any extra capabilities assigned to the user.'=>'ಬಳಕೆದಾರನಿಗೆ ನಿಯೋಜಿಸಲಾದ ಯಾವುದೇ ಹೆಚ್ಚುವರಿ ಸಾಮರ್ಥ್ಯಗಳು.','All capabilities assigned to the user.'=>'ಬಳಕೆದಾರರಿಗೆ ನಿಯೋಜಿಸಲಾದ ಎಲ್ಲಾ ಸಾಮರ್ಥ್ಯಗಳು.','Password for the user (never included).'=>'ಬಳಕೆದಾರರಿಗೆ ಗುಪ್ತಪದ (ಸೇರಿಸಲಾಗಿಲ್ಲ).','Registration date for the user.'=>'ಬಳಕೆದಾರರಿಗಾಗಿ ನೋಂದಣಿ ದಿನಾಂಕ.','The email address for the user.'=>'ಬಳಕೆದಾರರ ಮಿಂಚಂಚೆ ವಿಳಾಸ.','The role %s does not exist.'=>'ಪಾತ್ರ %s ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Invalid user ID for reassignment.'=>'ಪುನರ್ವಿತರಣೆಗಾಗಿ ಅಮಾನ್ಯವಾದ ಬಳಕೆದಾರ ID.','Sorry, you are not allowed to delete this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರನನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Username is not editable.'=>'ಬಳಕೆದಾರ ಹೆಸರನ್ನು ಸಂಪಾದಿಸಲಾಗುವುದಿಲ್ಲ.','Sorry, you are not allowed to edit roles of this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರರ ಪಾತ್ರಗಳನ್ನು ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to delete this revision.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪರಿಷ್ಕರಣೆಯನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Cannot create existing user.'=>'ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಬಳಕೆದಾರರನ್ನು ಸೃಷ್ಟಿಸಲಾಗುವುದಿಲ್ಲ.','You are not currently logged in.'=>'ನೀವು ಪ್ರಸ್ತುತ ಲಾಗ್‍ಇನ್ ಆಗಿಲ್ಲ.','Limit result set to terms assigned to a specific post.'=>'ನಿರ್ದಿಷ್ಟ ಹುದ್ದೆಗೆ ನಿಗದಿಪಡಿಸಿದ ಫಲಿತಾಂಶಗಳನ್ನು ಟರ್ಮ್ಸ್ಗಳಿಗೆ ಸೀಮಿತಗೊಳಿಸಿ.','Limit result set to terms assigned to a specific parent.'=>'ನಿರ್ದಿಷ್ಟ ಪೋಷಕರಿಗೆ ನಿಯೋಜಿಸಲಾದ ನಿಯಮಗಳಿಗೆ ಮಿತಿಗೊಳಿಸಿದ ಫಲಿತಾಂಶ.','Whether to hide terms not assigned to any posts.'=>'ಯಾವುದೇ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ನಿಯೋಜಿಸದ ಪದಗಳನ್ನು ಮರೆಮಾಡಬೇಕೆ.','Sort collection by term attribute.'=>'ಪದ ಗುಣಲಕ್ಷಣದ ಪ್ರಕಾರ ಸಂಗ್ರಹವನ್ನು ವಿಂಗಡಿಸಿ.','The ID for the parent of the revision.'=>'ಪರಿಷ್ಕರಣೆಯ ಪೋಷಕರಿಗೆ ID.','Type attribution for the term.'=>'ಪದಕ್ಕಾಗಿ ಗುಣಲಕ್ಷಣ ಟೈಪ್ ಮಾಡಿ.','An alphanumeric identifier for the term unique to its type.'=>'ಅದರ ಪ್ರಕಾರದ ವಿಶಿಷ್ಟವಾದ ಪದಕ್ಕೆ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಗುರುತಿಸುವಿಕೆ.','HTML description of the term.'=>'ಪದದ HTML ವಿವರಣೆ.','Number of published posts for the term.'=>'ಪದಕ್ಕಾಗಿ ಪ್ರಕಟವಾದ ಲೇಖನಗಳ ಸಂಖ್ಯೆ.','Unique identifier for the user.'=>'ಬಳಕೆದಾರರಿಗೆ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','The template cannot be deleted.'=>'ಟೆಂಪ್ಲೇಟ್ ಅನ್ನು ಅಳಿಸಲಾಗುವುದಿಲ್ಲ.','Required to be true, as users do not support trashing.'=>'ಬಳಕೆದಾರರು ಅನುಪಯುಕ್ತವನ್ನು ಬೆಂಬಲಿಸದ ಕಾರಣ, ಇದು ನಿಜವಾಗಲು ಅಗತ್ಯವಿದೆ.','Limit results to taxonomies associated with a specific post type.'=>'ನಿರ್ದಿಷ್ಟ ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕೆ ಸಂಬಂಧಿಸಿದ ಟ್ಯಾಕ್ಸಾನಮಿಗಳಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Whether or not the term cloud should be displayed.'=>'ಟರ್ಮ್ ಕ್ಲೌಡ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸಬೇಕೇ ಅಥವಾ ಇಲ್ಲವೇ.','The %s property has an invalid stored value, and cannot be updated to null.'=>'%s ಆಸ್ತಿಯು ಅಮಾನ್ಯವಾದ ಸಂಗ್ರಹಿಸಿದ ಮೌಲ್ಯವನ್ನು ಹೊಂದಿದೆ ಮತ್ತು ಅದನ್ನು ಶೂನ್ಯಕ್ಕೆ ನವೀಕರಿಸಲಾಗುವುದಿಲ್ಲ.','Invalid revision ID.'=>'ಅಮಾನ್ಯ ಪರಿಷ್ಕರಣೆ ID.','Status is forbidden.'=>'ಸ್ಥಿತಿಯನ್ನು ನಿಷೇಧಿಸಲಾಗಿದೆ.','Limit result set to items that are sticky.'=>'ಫಲಿತಾಂಶವನ್ನು ಸ್ಟಿಕಿ ಐಟಂಗಳಿಗೆ ಸೀಮಿತಗೊಳಿಸಿ.','Limit result set to items except those with specific terms assigned in the %s taxonomy.'=>'%s ಟ್ಯಾಕ್ಸಾನಮಿಗೆ ನಿಗದಿಪಡಿಸಲಾದ ನಿಗದಿತ ಅವಧಿಯನ್ನು ಹೊಂದಿರುವ ಎಲ್ಲಾ ಐಟಂಗಳಿಗೆ ಸೀಮಿತ ಫಲಿತಾಂಶವನ್ನು ನಿಗದಿಪಡಿಸಲಾಗಿದೆ.','Limit result set to all items except those of a particular parent ID.'=>'ನಿರ್ದಿಷ್ಟ ಮೂಲ ID ಯ ಹೊರತುಪಡಿಸಿ ಎಲ್ಲಾ ಐಟಂಗಳಿಗೆ ಸೀಮಿತ ಫಲಿತಾಂಶವನ್ನು ನಿಗದಿಪಡಿಸಲಾಗಿದೆ.','Limit result set to items with particular parent IDs.'=>'ನಿರ್ದಿಷ್ಟ ಪೋಷಕ ID ಗಳೊಂದಿಗೆ ಐಟಂಗಳಿಗೆ ಹೊಂದಿಸಲಾದ ಮಿತಿ ಫಲಿತಾಂಶ.','Offset the result set by a specific number of items.'=>'ನಿರ್ದಿಷ್ಟ ಸಂಖ್ಯೆಯ ಐಟಂಗಳನ್ನು ಹೊಂದಿಸಿದ ಫಲಿತಾಂಶವನ್ನು ಸರಿದೂಗಿಸಿ.','Limit result set to posts with a specific menu_order value.'=>'ಫಲಿತಾಂಶವನ್ನು ನಿರ್ದಿಷ್ಟ menu_order ಮೌಲ್ಯದೊಂದಿಗೆ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ಸೀಮಿತಗೊಳಿಸಿ.','Ensure result set excludes posts assigned to specific authors.'=>'ಫಲಿತಾಂಶದ ಸೆಟ್ ನಿರ್ದಿಷ್ಟ ಲೇಖಕರಿಗೆ ನಿಯೋಜಿಸಲಾದ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಹೊರತುಪಡಿಸಿರುವುದನ್ನು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ.','Limit result set to posts assigned to specific authors.'=>'ನಿಶ್ಚಿತ ಲೇಖಕರ ನಿಯೋಜಿಸಲಾದ ಪೋಸ್ಟ್ಗಳಿಗೆ ಸೀಮಿತ ಫಲಿತಾಂಶವನ್ನು ನಿಗದಿಪಡಿಸಲಾಗಿದೆ.','The terms assigned to the post in the %s taxonomy.'=>'%s ವರ್ಗೀಕರಣದಲ್ಲಿ ವಸ್ತುವಿಗೆ ನಿಯೋಜಿಸಲಾದ ಪದಗಳು','The theme file to use to display the post.'=>'ಪೋಸ್ಟ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸಲು ಬಳಸಲು ಥೀಮ್ ಫೈಲ್.','A password to protect access to the content and excerpt.'=>'ವಿಷಯ ಮತ್ತು ಆಯ್ದ ಭಾಗಕ್ಕೆ ಪ್ರವೇಶವನ್ನು ರಕ್ಷಿಸಲು ಪಾಸ್‌ವರ್ಡ್.','Whether or not the post should be treated as sticky.'=>'ಪೋಸ್ಟ್ ಅನ್ನು ಸ್ಟಿಕಿ ಎಂದು ಪರಿಗಣಿಸಬೇಕೇ ಅಥವಾ ಇಲ್ಲವೇ.','The format for the post.'=>'ವಸ್ತುವಿನ ಸ್ವರೂಪ.','Whether or not the post can be pinged.'=>'ವಸ್ತುವನ್ನು ಪಿಂಗ್ ಮಾಡಬಹುದೇ ಅಥವಾ ಇಲ್ಲವೇ.','Whether or not comments are open on the post.'=>'ಪೋಸ್ಟ್‌ನಲ್ಲಿ ಕಾಮೆಂಟ್‌ಗಳು ತೆರೆದಿವೆಯೋ ಇಲ್ಲವೋ.','The ID of the featured media for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ವೈಶಿಷ್ಟ್ಯಗೊಳಿಸಿದ ಮಾಧ್ಯಮದ ID.','Whether the excerpt is protected with a password.'=>'ಆಯ್ದ ಭಾಗಗಳು ಪಾಸ್ವರ್ಡ್ನೊಂದಿಗೆ ಸಂರಕ್ಷಿತವಾಗಿದೆಯೇ.','HTML excerpt for the post, transformed for display.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ HTML ಆಯ್ದ ಭಾಗ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','Excerpt for the post, as it exists in the database.'=>'ಡೇಟಾಬೇಸ್ನಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವುದರಿಂದ ವಸ್ತುವಿನ ಆಯ್ದ ಭಾಗಗಳು.','The excerpt for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ಆಯ್ದ ಭಾಗ.','The ID for the author of the post.'=>'ಪೋಸ್ಟ್‌ ಲೇಖಕನ ID.','Whether the content is protected with a password.'=>'ವಿಷಯವು ಪಾಸ್ವರ್ಡ್ನೊಂದಿಗೆ ಸಂರಕ್ಷಿತವಾಗಿದೆಯೇ.','HTML title for the post, transformed for display.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ HTML ಶೀರ್ಷಿಕೆ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','Title for the post, as it exists in the database.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ಶೀರ್ಷಿಕೆ, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿರುವಂತೆ.','The title for the object.'=>'ವಸ್ತುವಿನ ಶೀರ್ಷಿಕೆ.','A named status for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ಹೆಸರಿಸಲಾದ ಸ್ಥಿತಿ.','An alphanumeric identifier for the revision unique to its type.'=>'ಅದರ ಪ್ರಕಾರಕ್ಕೆ ವಿಶಿಷ್ಟವಾದ ಪರಿಷ್ಕರಣೆಗಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಐಡೆಂಟಿಫೈಯರ್.','The date the revision was last modified, as GMT.'=>'GMT ಯಂತೆ ಪರಿಷ್ಕರಣೆಯನ್ನು ಕೊನೆಯದಾಗಿ ಮಾರ್ಪಡಿಸಿದ ದಿನಾಂಕ.','The date the revision was last modified, in the site\'s timezone.'=>'ಪರಿಷ್ಕರಣೆಯನ್ನು ಕೊನೆಯದಾಗಿ ಮಾರ್ಪಡಿಸಿದ ದಿನಾಂಕ, ಸೈಟ್‌ನ ಸಮಯವಲಯದಲ್ಲಿ.','GUID for the post, transformed for display.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ GUID, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','GUID for the revision, as it exists in the database.'=>'ಪರಿಷ್ಕರಣೆಗಾಗಿ GUID, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿರುವಂತೆ.','The globally unique identifier for the post.'=>'ಪೋಸ್ಟ್‌ನ ಜಾಗತಿಕವಾಗಿ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','The date the revision was published, as GMT.'=>'ಪರಿಷ್ಕರಣೆಯನ್ನು ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ, GMT ಯಂತೆ.','The date the revision was published, in the site\'s timezone.'=>'ಪರಿಷ್ಕರಣೆಯನ್ನು ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ, ಸೈಟ್‌ನ ಸಮಯವಲಯದಲ್ಲಿ.','Invalid featured media ID.'=>'ಅಮಾನ್ಯ ವೈಶಿಷ್ಟ್ಯಗೊಳಿಸಿದ ಮಾಧ್ಯಮ ID.','Invalid post parent ID.'=>'ಅಮಾನ್ಯವಾದ ಪೋಸ್ಟ್ ಪೋಷಕ ID.','A password protected post can not be set to sticky.'=>'ಪಾಸ್ವರ್ಡ್ ರಕ್ಷಿತ ಪೋಸ್ಟ್ ಅನ್ನು ಸ್ಟಿಕಿಯಂತೆ ಹೊಂದಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','A sticky post can not be password protected.'=>'ಜಿಗುಟಾದ ಪೋಸ್ಟ್ ಅನ್ನು ಪಾಸ್ವರ್ಡ್ ರಕ್ಷಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','A post can not be sticky and have a password.'=>'ಒಂದು ಪೋಸ್ಟ್ ಜಿಗುಟಾದ ಮತ್ತು ಪಾಸ್ವರ್ಡ್ ಹೊಂದಲು ಸಾಧ್ಯವಿಲ್ಲ.','The post has already been deleted.'=>'ಪೋಸ್ಟ್ ಅನ್ನು ಈಗಾಗಲೇ ಅಳಿಸಲಾಗಿದೆ.','Sorry, you are not allowed to edit comments.'=>'ಕ್ಷಮಿಸಿ, ಕಾಮೆಂಟ್ಗಳನ್ನು ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to manage this plugin.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Cannot create existing post.'=>'ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಪೋಸ್ಟ್ ಅನ್ನು ರಚಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Sorry, you are not allowed to create new users.'=>'ಕ್ಷಮಿಸಿ, ಹೊಸ ಬಳಕೆದಾರರನ್ನು ರಚಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Incorrect post password.'=>'ತಪ್ಪಾದ ಪೋಸ್ಟ್ ಪಾಸ್ವರ್ಡ್.','You need to define a search term to order by relevance.'=>'ಪ್ರಸ್ತುತತೆ ಮೂಲಕ ಆದೇಶಕ್ಕೆ ಹುಡುಕಾಟ ಪದವನ್ನು ನೀವು ವ್ಯಾಖ್ಯಾನಿಸಬೇಕಾಗಿದೆ.','The password for the post if it is password protected.'=>'ಪಾಸ್ವರ್ಡ್ ಅನ್ನು ರಕ್ಷಿಸಿದರೆ ಪೋಸ್ಟ್ಗೆ ಪಾಸ್ವರ್ಡ್.','Human-readable labels for the taxonomy for various contexts.'=>'ವಿವಿಧ ಸಂದರ್ಭಗಳಲ್ಲಿ ಟ್ಯಾಕ್ಸಾನಮಿಗಾಗಿ ಮಾನವ-ಓದಬಲ್ಲ ಲೇಬಲ್ಗಳು.','Whether or not the taxonomy should have children.'=>'ಟ್ಯಾಕ್ಸಾನಮಿಗೆ ಮಕ್ಕಳು ಇರಬೇಕೇ ಅಥವಾ ಬೇಡವೇ?','A human-readable description of the taxonomy.'=>'ಜೀವಿವರ್ಗೀಕರಣ ಶಾಸ್ತ್ರದ ಮಾನವ-ಓದಬಲ್ಲ ವಿವರಣೆ.','All capabilities used by the taxonomy.'=>'ಟ್ಯಾಕ್ಸಾನಮಿ ಬಳಸುವ ಎಲ್ಲಾ ಸಾಮರ್ಥ್ಯಗಳು.','Sorry, you are not allowed to manage post statuses.'=>'ಕ್ಷಮಿಸಿ, ಪೋಸ್ಟ್ ಸ್ಥಾನಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','An alphanumeric identifier for the user.'=>'ಬಳಕೆದಾರರಿಗಾಗಿ ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಐಡೆಂಟಿಫಯರ್.','Whether to include posts in the edit listing for their post type.'=>'ಅವರ ಪೋಸ್ಟ್ ಪ್ರಕಾರಕ್ಕಾಗಿ ಸಂಕಲನ ಪಟ್ಟಿಯಲ್ಲಿ ಪೋಸ್ಟ್ ಗಳನ್ನು ಸೇರಿಸಬೇಕೆ.','Whether posts with this status should be publicly-queryable.'=>'ಈ ಸ್ಥಿತಿಯೊಂದಿಗೆ ಪೋಸ್ಟ್ಗಳು ಸಾರ್ವಜನಿಕವಾಗಿ ಪ್ರಶ್ನಾರ್ಹವಾಗಬೇಕೇ.','Whether posts of this status should be shown in the front end of the site.'=>'ಈ ಸ್ಥಿತಿಯ ಪೋಸ್ಟ್ಗಳು ಸೈಟ್ನ ಮುಂಭಾಗದ ತುದಿಯಲ್ಲಿ ತೋರಿಸಬೇಕೇ.','Whether posts with this status should be protected.'=>'ಈ ಸ್ಥಿತಿಯನ್ನು ಹೊಂದಿರುವ ಪೋಸ್ಟ್ಗಳನ್ನು ರಕ್ಷಿಸಬೇಕು.','Whether posts with this status should be private.'=>'ಈ ಸ್ಥಿತಿಯೊಂದಿಗೆ ಪೋಸ್ಟ್ಗಳು ಖಾಸಗಿಯಾಗಿರಬೇಕು.','Scope under which the request is made; determines fields present in response.'=>'ವಿನಂತಿಯನ್ನು ಮಾಡುವ ವ್ಯಾಪ್ತಿ; ಪ್ರತಿಕ್ರಿಯೆಯಾಗಿ ಕ್ಷೇತ್ರಗಳನ್ನು ನಿರ್ಧರಿಸುತ್ತದೆ.','Limit results to those matching a string.'=>'ಸ್ಟ್ರಿಂಗ್ಗೆ ಹೊಂದಿಕೆಯಾಗುವವರಿಗೆ ಫಲಿತಾಂಶಗಳನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Maximum number of items to be returned in result set.'=>'ಫಲಿತಾಂಶ ಸೆಟ್ ನಲ್ಲಿ ಹಿಂತಿರುಗಿಸಬೇಕಾದ ಗರಿಷ್ಠ ಸಂಖ್ಯೆಯ ಐಟಂಗಳು.','Current page of the collection.'=>'ಸಂಗ್ರಹಣೆಯ ಪ್ರಸ್ತುತ ಪುಟ.','Method \'%s\' not implemented. Must be overridden in subclass.'=>'\'%s\' ವಿಧಾನವು ಕಾರ್ಯಗತಗೊಂಡಿಲ್ಲ. ಉಪವರ್ಗದಲ್ಲಿ ಅತಿಕ್ರಮಿಸಬೇಕು.','Limit result set to comments assigned a specific type. Requires authorization.'=>'ಫಲಿತಾಂಶವನ್ನು ನಿರ್ದಿಷ್ಟ ರೀತಿಯ ನಿಯೋಜಿತ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಸೀಮಿತಗೊಳಿಸಿ. ದೃಢೀಕರಣದ ಅಗತ್ಯವಿದೆ.','Limit result set to comments assigned a specific status. Requires authorization.'=>'ನಿರ್ದಿಷ್ಟ ಸ್ಥಿತಿಯನ್ನು ನಿಗದಿಪಡಿಸಿದ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಫಲಿತಾಂಶವನ್ನು ಮಿತಿಗೊಳಿಸಿ. ದೃಢೀಕರಣದ ಅಗತ್ಯವಿದೆ.','Limit result set to comments assigned to specific post IDs.'=>'ಫಲಿತಾಂಶವನ್ನು ನಿರ್ದಿಷ್ಟ ಪೋಸ್ಟ್ IDಗಳಿಗೆ ನಿಗದಿಪಡಿಸಿದ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಸೀಮಿತಗೊಳಿಸಿ.','Ensure result set excludes specific parent IDs.'=>'ನಿರ್ದಿಷ್ಟ ಪೋಷಕ ID ಗಳನ್ನು ಹೊರತುಪಡಿಸಿ ಫಲಿತಾಂಶದ ಸೆಟ್ ಅನ್ನು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ.','Limit result set to comments of specific parent IDs.'=>'ಫಲಿತಾಂಶವನ್ನು ನಿರ್ದಿಷ್ಟ ಪೋಷಕ IDಗಳ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಸೀಮಿತಗೊಳಿಸಿ.','Sort collection by object attribute.'=>'ಆಬ್ಜೆಕ್ಟ್ ಗುಣಲಕ್ಷಣಗಳಿಂದ ಸಂಗ್ರಹಣೆಯನ್ನು ವಿಂಗಡಿಸಿ.','Order sort attribute ascending or descending.'=>'ಆರ್ಡರ್ ರೀತಿಯ ಗುಣಲಕ್ಷಣ ಆರೋಹಣ ಅಥವಾ ಅವರೋಹಣ.','Limit result set to specific IDs.'=>'ಸೀಮಿತ ಫಲಿತಾಂಶವನ್ನು ನಿರ್ದಿಷ್ಟ ID ಗೆ ಹೊಂದಿಸಲಾಗಿದೆ.','Ensure result set excludes specific IDs.'=>'ನಿರ್ದಿಷ್ಟ ID ಗಳನ್ನು ಹೊರತುಪಡಿಸಿ ಫಲಿತಾಂಶದ ಸೆಟ್ ಅನ್ನು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ.','Limit response to posts published before a given ISO8601 compliant date.'=>'ನೀಡಿರುವ ISO8601 ಅನುಸರಣಾ ದಿನಾಂಕದ ಮೊದಲು ಪ್ರಕಟಿಸಿದ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Limit result set to that from a specific author email. Requires authorization.'=>'ನಿರ್ದಿಷ್ಟ ಲೇಖಕ ಇಮೇಲ್ನಿಂದ ನಿಗದಿಪಡಿಸಲಾದ ಮಿತಿ ಫಲಿತಾಂಶ. ದೃಢೀಕರಣದ ಅಗತ್ಯವಿದೆ.','Ensure result set excludes comments assigned to specific user IDs. Requires authorization.'=>'ಫಲಿತಾಂಶದ ಸೆಟ್ ನಿರ್ದಿಷ್ಟ ಬಳಕೆದಾರ ID ಗಳಿಗೆ ನಿಯೋಜಿಸಲಾದ ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಹೊರತುಪಡಿಸುತ್ತದೆ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ. ದೃಢೀಕರಣದ ಅಗತ್ಯವಿದೆ.','Limit result set to comments assigned to specific user IDs. Requires authorization.'=>'ನಿರ್ದಿಷ್ಟ ಬಳಕೆದಾರ ID ಗಳಿಗೆ ನಿಗದಿಪಡಿಸಿದ ಕಾಮೆಂಟ್‌ಗಳಿಗೆ ಫಲಿತಾಂಶದ ಸೆಟ್ ಅನ್ನು ಮಿತಿಗೊಳಿಸಿ. ದೃಢೀಕರಣದ ಅಗತ್ಯವಿದೆ.','Limit response to posts published after a given ISO8601 compliant date.'=>'ನೀಡಿರುವ ISO8601 ಅನುಸರಣಾ ದಿನಾಂಕದ ನಂತರ ಪ್ರಕಟಿಸಿದ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಮಿತಿಗೊಳಿಸಿ.','Avatar URLs for the comment author.'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರಿಗಾಗಿ ಅವತಾರ್ URL ಗಳು.','Avatar URL with image size of %d pixels.'=>'%d ಪಿಕ್ಸೆಲ್ಗಳ ಚಿತ್ರದ ಗಾತ್ರದೊಂದಿಗೆ ಅವತಾರ್ URL.','State of the comment.'=>'ಕಾಮೆಂಟ್ ಸ್ಥಿತಿ.','The ID of the associated post object.'=>'ಸಂಬಂಧಿತ ಪೋಸ್ಟ್ ವಸ್ತುವಿನ ID.','The ID for the parent of the post.'=>'ಪೋಸ್ಟ್‌ನ ಪೋಷಕಕಾಗಿ ID.','URL to the object.'=>'ಆಬ್ಜೆಕ್ಟ್ಗೆ URL.','The date the post was published, as GMT.'=>'ಪೋಸ್ಟ್ ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ, GMT ಯಾಗಿ.','HTML content for the post, transformed for display.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ HTML ವಿಷಯ, ಪ್ರದರ್ಶನಕ್ಕಾಗಿ ರೂಪಾಂತರಗೊಂಡಿದೆ.','Content for the post, as it exists in the database.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ವಿಷಯ, ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿರುವಂತೆ.','The content for the post.'=>'ಪೋಸ್ಟ್‌ಗಾಗಿ ವಿಷಯ.','User agent for the comment author.'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರ ಬಳಕೆದಾರ ಏಜೆಂಟ್.','URL for the comment author.'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರ URL.','Display name for the comment author.'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರ ಹೆಸರು ಪ್ರದರ್ಶಿಸಿ.','IP address for the comment author.'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರಿಗೆ IP ವಿಳಾಸ.','Email address for the comment author.'=>'ಕಾಮೆಂಟ್ ಲೇಖಕರಿಗೆ ಇಮೇಲ್ ವಿಳಾಸ.','The ID of the user object, if author was a user.'=>'ಲೇಖಕರು ಬಳಕೆದಾರರಾಗಿದ್ದರೆ, ಬಳಕೆದಾರ ವಸ್ತುವಿನ ID.','Unique identifier for the object.'=>'ವಸ್ತುವಿನ ವಿಶಿಷ್ಟ ಗುರುತಿಸುವಿಕೆ.','Invalid comment author ID.'=>'ಅಮಾನ್ಯವಾದ ಕಾಮೆಂಟ್ ಲೇಖಕ ID.','The comment cannot be deleted.'=>'ಕಾಮೆಂಟ್ ಅನ್ನು ಅಳಿಸಲಾಗುವುದಿಲ್ಲ.','The comment has already been trashed.'=>'ಕಾಮೆಂಟ್ ಅನ್ನು ಈಗಾಗಲೇ ಟ್ರ್ಯಾಶ್ ಮಾಡಲಾಗಿದೆ.','Updating comment failed.'=>'ಕಾಮೆಂಟ್ ನವೀಕರಿಸುವುದು ವಿಫಲವಾಗಿದೆ.','Updating comment status failed.'=>'ಕಾಮೆಂಟ್ ಸ್ಥಿತಿಯನ್ನು ನವೀಕರಿಸುವುದು ವಿಫಲವಾಗಿದೆ.','Creating comment failed.'=>'ಕಾಮೆಂಟ್ ರಚಿಸುವುದು ವಿಫಲವಾಗಿದೆ.','Creating a comment requires valid author name and email values.'=>'ಕಾಮೆಂಟ್ ರಚಿಸುವುದರಿಂದ ಮಾನ್ಯ ಲೇಖಕರ ಹೆಸರು ಮತ್ತು ಇಮೇಲ್ ಮೌಲ್ಯಗಳು ಅಗತ್ಯವಿದೆ.','Cannot create existing comment.'=>'ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಕಾಮೆಂಟ್ ಅನ್ನು ರಚಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Sorry, you must be logged in to comment.'=>'ಕ್ಷಮಿಸಿ, ಕಾಮೆಂಟ್ ಮಾಡಲು ನೀವು ಲಾಗ್ ಇನ್ ಆಗಿರಬೇಕು.','Query parameter not permitted: %s'=>'ಪ್ರಶ್ನೆ ಪ್ಯಾರಾಮೀಟರ್ ಅನುಮತಿಸಲಾಗಿಲ್ಲ: %s','Whether to bypass Trash and force deletion.'=>'ಅನುಪಯುಕ್ತವನ್ನು ಬೈಪಾಸ್ ಮಾಡಬೇಕೇ ಮತ್ತು ಅಳಿಸಲು ಒತ್ತಾಯಿಸಬೇಕೇ.','Limit result set to attachments of a particular MIME type.'=>'ನಿರ್ದಿಷ್ಟ MIME ಪ್ರಕಾರದ ಲಗತ್ತುಗಳಿಗೆ ಸೀಮಿತವಾದ ಫಲಿತಾಂಶವನ್ನು ಹೊಂದಿಸಲಾಗಿದೆ.','Limit result set to attachments of a particular media type.'=>'ಮಿತಿಮೀರಿದ ಫಲಿತಾಂಶವು ನಿರ್ದಿಷ್ಟ ಮಾಧ್ಯಮ ಪ್ರಕಾರದ ಲಗತ್ತುಗಳಿಗೆ ಹೊಂದಿಸಲಾಗಿದೆ.','Could not open file handle.'=>'ಫೈಲ್ ಹ್ಯಾಂಡಲ್ ತೆರೆಯಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Content hash did not match expected.'=>'ವಿಷಯದ ಹ್ಯಾಶ್ ನಿರೀಕ್ಷೆಗೆ ಹೊಂದಿಕೆಯಾಗಲಿಲ್ಲ.','Invalid Content-Disposition supplied. Content-Disposition needs to be formatted as `attachment; filename="image.png"` or similar.'=>'ಅಮಾನ್ಯ ವಿಷಯ-ಸ್ಥಿತಿ ಒದಗಿಸಲಾಗಿದೆ. ವಿಷಯ-ಸ್ವಭಾವವನ್ನು \'ಜೋಡಣೆ\' ಎಂದು ಸ್ವರೂಪಿಸಬೇಕಾಗಿದೆ; ಫೈಲ್ ನೇಮ್="ಇಮೇಜ್.png"ಅಥವಾ ಅದೇ ರೀತಿಯದು.','No Content-Disposition supplied.'=>'ಯಾವುದೇ ವಿಷಯ-ವಿತರಣೆಯನ್ನು ಒದಗಿಸಲಾಗಿಲ್ಲ.','No Content-Type supplied.'=>'ಯಾವುದೇ ವಿಷಯ-ಪ್ರಕಾರವನ್ನು ಒದಗಿಸಲಾಗಿಲ್ಲ.','No data supplied.'=>'ಯಾವುದೇ ಡೇಟಾವನ್ನು ಒದಗಿಸಲಾಗಿಲ್ಲ.','The ID for the associated post of the attachment.'=>'ಲಗತ್ತಿನ ಸಂಬಂಧಿತ ಪೋಸ್ಟ್‌ಗಾಗಿ ID.','Details about the media file, specific to its type.'=>'ಮಾಧ್ಯಮ ಫೈಲ್ ಬಗ್ಗೆ ವಿವರಗಳು, ಅದರ ಪ್ರಕಾರಕ್ಕೆ ನಿರ್ದಿಷ್ಟವಾಗಿ.','Alternative text to display when attachment is not displayed.'=>'ಲಗತ್ತನ್ನು ಪ್ರದರ್ಶಿಸದಿದ್ದಾಗ ಪ್ರದರ್ಶಿಸಲು ಪರ್ಯಾಯ ಪಠ್ಯ.','Invalid parent type.'=>'ಅಮಾನ್ಯವಾದ ಪೋಷಕ ಪ್ರಕಾರ.','Sorry, you are not allowed to upload media to this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪೋಸ್ಟ್‌ಗೆ ಮಾಧ್ಯಮವನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to upload media on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ಮಾಧ್ಯಮವನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The REST API can no longer be completely disabled, the %s filter can be used to restrict access to the API, instead.'=>'ಉಳಿದ ಎಪಿಐ ಅನ್ನು ಇನ್ನು ಮುಂದೆ ಸಂಪೂರ್ಣವಾಗಿ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ, ಬದಲಿಗೆ ಎಪಿಐಗೆ ಪ್ರವೇಶವನ್ನು ನಿರ್ಬಂಧಿಸಲು %s ಫಿಲ್ಟರ್ ಅನ್ನು ಬಳಸಬಹುದು.','Page Attributes'=>'ಪುಟ ಗುಣಲಕ್ಷಣಗಳು','Post Attributes'=>'ಗುಣಲಕ್ಷಣಗಳನ್ನು ಪೋಸ್ಟ್ ಮಾಡಿ','View Pages'=>'ಪುಟಗಳು ವೀಕ್ಷಿಸಿ','View Posts'=>'ಪೋಸ್ಟ್ಗಳನ್ನು ವೀಕ್ಷಿಸಿ','No changesets found in Trash.'=>'ಅನುಪಯುಕ್ತದಲ್ಲಿ ಬದಲಾವಣೆಗಳಿಲ್ಲ.','No changesets found.'=>'ಯಾವುದೇ ಬದಲಾವಣೆಗಳಿಲ್ಲ.','Search Changesets'=>'ಬದಲಾವಣೆಗಳನ್ನು ಹುಡುಕಿ','All Changesets'=>'ಎಲ್ಲಾ ಬದಲಾವಣೆಗಳನ್ನು','View Changeset'=>'ಬದಲಾವಣೆಗಳನ್ನು ವೀಕ್ಷಿಸಿ','Edit Changeset'=>'ಬದಲಾವಣೆಗಳನ್ನು ಸಂಪಾದಿಸಿ','New Changeset'=>'ಹೊಸ ಬದಲಾವಣೆ','Add New Changeset'=>'ಹೊಸ ಬದಲಾವಣೆಗಳನ್ನು ಸೇರಿಸಿ','post type singular nameChangeset'=>'ಬದಲಾವಣೆ','post type general nameChangesets'=>'ಬದಲಾವಣೆಗಳನ್ನು','Custom CSS'=>'ಕಸ್ಟಮ್ CSS','Attachment Attributes'=>'ಲಗತ್ತು ಗುಣಲಕ್ಷಣಗಳು','%1$s %2$s, %3$s ago (%4$s)'=>'%1$s %2$s , %3$s ಹಿಂದೆ ( %4$s )','The "%s" options group has been removed. Use another settings group.'=>' " %s " ಆಯ್ಕೆಗಳ ಗುಂಪನ್ನು ತೆಗೆದುಹಾಕಲಾಗಿದೆ. ಮತ್ತೊಂದು ಸೆಟ್ಟಿಂಗ್ಗಳ ಗುಂಪನ್ನು ಬಳಸಿ.','Allow link notifications from other blogs (pingbacks and trackbacks) on new articles.'=>'ಹೊಸ ಲೇಖನಗಳಲ್ಲಿ ಇತರ ಬ್ಲಾಗ್ಗಳಿಂದ (ಪಿಂಗ್ಬ್ಯಾಕ್ಗಳು ಮತ್ತು ಟ್ರ್ಯಾಕ್ಬ್ಯಾಕ್ಗಳು) ಲಿಂಕ್ ಅಧಿಸೂಚನೆಗಳನ್ನು ಅನುಮತಿಸಿ.','Blog pages show at most.'=>'ಬ್ಲಾಗ್ ಪುಟಗಳು ಹೆಚ್ಚು ತೋರಿಸುತ್ತವೆ.','Default post format.'=>'ಡೀಫಾಲ್ಟ್ ಪೋಸ್ಟ್ ಸ್ವರೂಪ.','Convert emoticons like :-) and :-P to graphics on display.'=>':-) ಮತ್ತು :-P ನಂತಹ ಎಮೋಟಿಕಾನ್‌ಗಳನ್ನು ಪ್ರದರ್ಶನದಲ್ಲಿರುವ ಗ್ರಾಫಿಕ್ಸ್‌ಗೆ ಪರಿವರ್ತಿಸಿ.','WordPress locale code.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಲೊಕೇಲ್ ಕೋಡ್.','A day number of the week that the week should start on.'=>'ವಾರ ಆರಂಭವಾಗಬೇಕಾದ ವಾರದ ಒಂದು ದಿನದ ಸಂಖ್ಯೆ.','A time format for all time strings.'=>'ಸಾರ್ವಕಾಲಿಕ ಸ್ಟ್ರಿಂಗ್‌ಗಳಿಗೆ ಸಮಯ ಸ್ವರೂಪ.','A date format for all date strings.'=>'ಎಲ್ಲಾ ದಿನಾಂಕದ ಸ್ಟ್ರಿಂಗ್‌ಗಳಿಗೆ ದಿನಾಂಕ ಸ್ವರೂಪ.','A city in the same timezone as you.'=>'ನೀವು ಅದೇ ಕಾಲವಲಯದಲ್ಲಿರುವ ನಗರ.','Site title.'=>'ಸೈಟ್ ಶೀರ್ಷಿಕೆ.','Search media items...'=>'ಮಾಧ್ಯಮ ಐಟಂಗಳನ್ನು ಹುಡುಕಿ ...','next set of postsNext'=>'ಮುಂದಿನ','previous set of postsPrevious'=>'ಹಿಂದಿನ','Username or Email Address'=>'ಬಳಕೆದಾರ ಹೆಸರು ಅಥವಾ ಇಮೇಲ್ ವಿಳಾಸ','No themes found. Try a different search, or %s.'=>'ಯಾವುದೇ ಥೀಮ್ಗಳು ಕಂಡುಬಂದಿಲ್ಲ. ಬೇರೆಯ ಹುಡುಕಾಟ, ಅಥವಾ %s ಪ್ರಯತ್ನಿಸಿ.','You are browsing %s'=>'ನೀವು %s ಅನ್ನು ಬ್ರೌಸ್ ಮಾಡುತ್ತಿದ್ದೀರಿ','Filter themes'=>'ಫಿಲ್ಟರ್ ಥೀಮ್ಗಳು','Change theme'=>'ಥೀಮ್ ಬದಲಿಸಿ','Update now'=>'ಈಗ ಅಪ್ಡೇಟ್ ಮಾಡು','New version available. %s'=>'ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ. %s','Install and preview theme: %s'=>'ಸ್ಥಾಪಿಸಿ ಮತ್ತು ಪೂರ್ವವೀಕ್ಷಣೆ ಥೀಮ್: %s','Live preview theme: %s'=>'ಲೈವ್ ಪೂರ್ವವೀಕ್ಷಣೆ ಥೀಮ್: %s','Customize theme: %s'=>'ಥೀಮ್ ಕಸ್ಟಮೈಸ್ ಮಾಡಿ: %s','Details for theme: %s'=>'ಥೀಮ್ಗಾಗಿ ವಿವರಗಳು: %s','Click to edit this element.'=>'ಈ ಅಂಶವನ್ನು ಸಂಪಾದಿಸಲು ಕ್ಲಿಕ್ ಮಾಡಿ.','Click to edit the site title.'=>'ಸೈಟ್ ಶೀರ್ಷಿಕೆಯನ್ನು ಸಂಪಾದಿಸಲು ಕ್ಲಿಕ್ ಮಾಡಿ.','Click to edit this widget.'=>'ಈ ವಿಜೆಟ್ ಸಂಪಾದಿಸಲು ಕ್ಲಿಕ್ ಮಾಡಿ.','Click to edit this menu.'=>'ಈ ಮೆನು ಸಂಪಾದಿಸಲು ಕ್ಲಿಕ್ ಮಾಡಿ.','Markup is not allowed in CSS.'=>'ಮಾರ್ಕಪ್ ಅನ್ನು ಸಿಎಸ್ಎಸ್ನಲ್ಲಿ ಅನುಮತಿಸಲಾಗುವುದಿಲ್ಲ.','Sorry, the comment could not be updated.'=>'ಕ್ಷಮಿಸಿ, ಕಾಮೆಂಟ್ ಸಂಪಾದಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Invalid role.'=>'ಅಮಾನ್ಯ ಪಾತ್ರ.','Sorry, you are not allowed to assign this term.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪದವನ್ನು ನಿಯೋಜಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to delete this term.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪದವನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to edit this term.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪದವನ್ನು ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, the term could not be created.'=>'ಕ್ಷಮಿಸಿ, ನಿಮ್ಮ ಪದವನ್ನು ರಚಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','No widgets found.'=>'ಯಾವುದೇ ವಿಜೆಟ್‌ಗಳು ಕಂಡುಬಂದಿಲ್ಲ.','Number of widgets found: %d'=>'ಕಂಡುಬಂದ ವಿಜೆಟ್‌ಗಳ ಸಂಖ್ಯೆ: %d','%1$s could not be created: %2$s'=>'%1$s ರಚಿಸಲಾಗಲಿಲ್ಲ: %2$s','Post'=>'ಪೋಸ್ಟ್','Only %1$s or %2$s files may be used for header video. Please convert your video file and try again, or, upload your video to YouTube and link it with the option below.'=>'ಹೆಡರ್ ವೀಡಿಯೊಗಾಗಿ ಮಾತ್ರ %1$s ಅಥವಾ %2$s ಫೈಲ್ಗಳನ್ನು ಬಳಸಬಹುದು. ದಯವಿಟ್ಟು ನಿಮ್ಮ ವೀಡಿಯೊ ಫೈಲ್ ಅನ್ನು ಪರಿವರ್ತಿಸಿ ಮತ್ತೆ ಪ್ರಯತ್ನಿಸಿ ಅಥವಾ YouTube ಗೆ ನಿಮ್ಮ ವೀಡಿಯೊವನ್ನು ಅಪ್ಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಕೆಳಗಿನ ಆಯ್ಕೆಯನ್ನು ಲಿಂಕ್ ಮಾಡಿ.','This video file is too large to use as a header video. Try a shorter video or optimize the compression settings and re-upload a file that is less than 8MB. Or, upload your video to YouTube and link it with the option below.'=>'ಈ ವೀಡಿಯೊ ಫೈಲ್ ತಲೆಬರಹ ವೀಡಿಯೊಆಗಿ ಬಳಸಲು ತುಂಬಾ ದೊಡ್ಡದಾಗಿದೆ. ಚಿಕ್ಕ ವೀಡಿಯೊ ಪ್ರಯತ್ನಿಸಿ ಅಥವಾ ಸಂಕೋಚನ ಸೆಟ್ಟಿಂಗ್ ಗಳನ್ನು ಆಪ್ಟಿಮೈಜ್ ಮಾಡಿ ಮತ್ತು 8ಎಂಬಿಗಿಂತ ಕಡಿಮೆ ಇರುವ ಫೈಲ್ ಅನ್ನು ಮರು ಅಪ್ ಲೋಡ್ ಮಾಡಿ. ಅಥವಾ, ನಿಮ್ಮ ವೀಡಿಯೊವನ್ನು ಯೂಟ್ಯೂಬ್ ಗೆ ಅಪ್ ಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಕೆಳಗಿನ ಆಯ್ಕೆಯೊಂದಿಗೆ ಲಿಂಕ್ ಮಾಡಿ.','Unrecognized background setting.'=>'ಗುರುತಿಸಲಾಗದ ಹಿನ್ನೆಲೆ ಸೆಟ್ಟಿಂಗ್.','Invalid value for background size.'=>'ಹಿನ್ನೆಲೆ ಗಾತ್ರಕ್ಕೆ ಅಮಾನ್ಯ ಮೌಲ್ಯ.','Invalid value for background position Y.'=>'ಹಿನ್ನೆಲೆ ಸ್ಥಾನ Y ಗೆ ಅಮಾನ್ಯವಾದ ಮೌಲ್ಯ.','