ಲ.','genitiveDecember'=>'ಡಿಸೆಂಬರ್','genitiveNovember'=>'ನವೆಂಬರ್','genitiveOctober'=>'ಅಕ್ಟೋಬರ್','genitiveSeptember'=>'ಸೆಪ್ಟಂಬರ್','genitiveAugust'=>'ಆಗಸ್ಟ್','genitiveJuly'=>'ಜುಲೈ','genitiveJune'=>'ಜೂನ್','genitiveMay'=>'ಮೇ','genitiveApril'=>'ಏಪ್ರಿಲ್','genitiveMarch'=>'ಮಾರ್ಚ್','genitiveFebruary'=>'ಫೆಬ್ರವರಿ','genitiveJanuary'=>'ಜನವರಿ','Sharing options'=>'ಹಂಚಿಕೊಳ್ಳುವ ಆಯ್ಕೆಗಳು','Medium-Large size image height'=>'ಮಧ್ಯಮ ದೊಡ್ಡ ಗಾತ್ರದ ಚಿತ್ರದ ಎತ್ತರ','Medium-Large size image width'=>'ಮಧ್ಯಮ ದೊಡ್ಡ ಗಾತ್ರದ ಚಿತ್ರ ಅಗಲ','You are currently browsing the %s blog archives.'=>'ನೀವು ಸದ್ಯದಲ್ಲಿ %s ಬ್ಲಾಗ್ ಆರ್ಕೈವ್‌ಗಳನ್ನು ಜಾಲಾಡುತ್ತಿದ್ದೀರಿ.','You are currently browsing the %1$s blog archives for the year %2$s.'=>'ನೀವು ಸದ್ಯದಲ್ಲಿ %1$s ಬ್ಲಾಗ್ ಆರ್ಕೈವ್‌ಗಳನ್ನು %2$s ವರ್ಷಕ್ಕಾಗಿ ಜಾಲಾಡುತ್ತಿದ್ದೀರಿ.','You are currently browsing the %1$s blog archives for %2$s.'=>'ನೀವು ಸದ್ಯದಲ್ಲಿ %1$s ಬ್ಲಾಗ್ ಆರ್ಕೈವ್‌ಗಳನ್ನು %2$s ಗಾಗಿ ಜಾಲಾಡುತ್ತಿದ್ದೀರಿ.','You are currently browsing the %1$s blog archives for the day %2$s.'=>'ನೀವು ಸದ್ಯದಲ್ಲಿ %1$s ಬ್ಲಾಗ್ ಆರ್ಕೈವ್‌ಗಳನ್ನು %2$s ದಿನಕ್ಕಾಗಿ ಜಾಲಾಡುತ್ತಿದ್ದೀರಿ.','This site has not been activated yet. If you are having problems activating your site, please contact %s.'=>'ಈ ತಾಣವು ಇನ್ನೂ ಸಕ್ರಿಯವಾಗಿಲ್ಲ. ನಿಮ್ಮ ತಾಣವನ್ನು ಸಕ್ರಿಯವಾಗಿಸುವಲ್ಲಿ ಏನಾದರು ತೊಂದರೆ ಇದ್ದಲ್ಲಿ, ದಯವಿಟ್ಟು %s ರನ್ನು ಸಂಪರ್ಕಿಸಿ.','The menu name %s conflicts with another menu name. Please try another.'=>'ಮೆನು ಹೆಸರು %s ಮತ್ತೊಂದು ಮೆನು ಹೆಸರಿನೊಂದಿಗೆ ಘರ್ಷಿಸುತ್ತದೆ. ದಯವಿಟ್ಟು ಇನ್ನೊಂದನ್ನು ಪ್ರಯತ್ನಿಸಿ.','The site you were looking for, %s, does not exist.'=>'ನೀವು %s ಕ್ಕಾಗಿ ಹುಡುಕುತ್ತಿದ್ದೀರಿ, ಇದು ಅಸ್ತಿತ್ವದಲ್ಲಿ ಇಲ್ಲ.','It looks like nothing was found at this location. Maybe try visiting %s directly?'=>'ಈ ಸ್ಥಳದಲ್ಲಿ ಏನೂ ಕಂಡುಬಂದಿಲ್ಲ ಎಂದು ತೋರುತ್ತಿದೆ. ಬಹುಶಃ %s ನೇರವಾಗಿ ಭೇಟಿ ಮಾಡಲು ಪ್ರಯತ್ನಿಸಿ?','Oops! That embed cannot be found.'=>'ಅಯ್ಯೋ! ಆ ಎಂಬೆಡ್ ಕಂಡುಬಂದಿಲ್ಲ.','Continue reading %s'=>'%s ಓದಲು ಮುಂದುವರೆಸಿ','Site Language:'=>'ತಾಣದ ಭಾಷೆ:','Mission complete. Message %s deleted.'=>'ಕಾರ್ಯ ಮುಗಿದಿದೆ. %s ಸಂದೇಶವನ್ನು ಅಳಿಸಲಾಗಿದೆ.','Posted title:'=>'ಪ್ರಕಟಿಸಲಾದ ಶೀರ್ಷಿಕೆ:','Author:'=>'ಲೇಖಕರು:','Are you sure the database server is not under particularly heavy load?'=>'ಡೇಟಾಬೇಸ್ ಸರ್ವರ್ ಭಾರೀ ಹೊರೆಯ ಮೇಲಿಲ್ಲ ಎಂದು ನಿಮಗೆ ಖಚಿತವಾಗಿದೆಯೇ?','This means that the contact with the database server at %s was lost. This could mean your host&#8217;s database server is down.'=>'ಇದರರ್ಥ %s ನಲ್ಲಿನ ಡೇಟಾಬೇಸ್ ಸರ್ವರ್‌ನೊಂದಿಗಿನ ಸಂಪರ್ಕವು ಕಳೆದುಹೋಗಿದೆ. ಇದರರ್ಥ ನಿಮ್ಮ ಹೋಸ್ಟ್ ಡೇಟಾಬೇಸ್ ಸರ್ವರ್ ಡೌನ್ ಆಗಿದೆ.','Error reconnecting to the database'=>'ಡೇಟಾಬೇಸ್ಗೆ ಮರುಸಂಪರ್ಕಿಸುವಲ್ಲಿ ದೋಷ ಕಂಡುಬಂದಿದೆ','If you are unsure what these terms mean you should probably contact your host. If you still need help you can always visit the <a href="%s">WordPress support forums</a>.'=>'ಈ ನಿಯಮಗಳ ಅರ್ಥವೇನೆಂದು ನಿಮಗೆ ಖಚಿತವಿಲ್ಲದಿದ್ದರೆ ನೀವು ಬಹುಶಃ ನಿಮ್ಮ ಹೋಸ್ಟ್ ಅನ್ನು ಸಂಪರ್ಕಿಸಬೇಕು. ನಿಮಗೆ ಇನ್ನೂ ಸಹಾಯದ ಅಗತ್ಯವಿದ್ದರೆ ನೀವು ಯಾವಾಗಲೂ <a href="%s">ವರ್ಡ್ಪ್ರೆಸ್ ಬೆಂಬಲ ವೇದಿಕೆಗಳಿಗೆ</a> ಭೇಟಿ ನೀಡಬಹುದು.','Are you sure the database server is running?'=>'ಡೇಟಾಬೇಸ್ ಸರ್ವರ್ ಚಾಲನೆಯಲ್ಲಿರುವುದು ಖಚಿತವೇ?','Are you sure you have typed the correct hostname?'=>'‍ನೀವು ಸರಿಯಾದ ಸರ್ವರ್ ಹೆಸರನ್ನು ‌ಟೈಪಿಸಿರುವಿರಾ?','Are you sure you have the correct username and password?'=>'ನೀವು ಸರಿಯಾದ ಬಳಕೆದಾರ ಹೆಸರು ಮತ್ತು ಗುಪ್ತಪದ ಹೊಂದಿರುವಿರಾ?','If you do not know how to set up a database you should <strong>contact your host</strong>. If all else fails you may find help at the <a href="%s">WordPress support forums</a>.'=>'ಡೇಟಾಬೇಸ್ ಅನ್ನು ಹೇಗೆ ಹೊಂದಿಸುವುದು ಎಂದು ನಿಮಗೆ ತಿಳಿದಿಲ್ಲದಿದ್ದರೆ ನೀವು <strong>ನಿಮ್ಮ ಹೋಸ್ಟ್ ಅನ್ನು ಸಂಪರ್ಕಿಸಬೇಕು</strong>. ಉಳಿದೆಲ್ಲವೂ ವಿಫಲವಾದರೆ ನೀವು <a href="%s">WordPress ಬೆಂಬಲ ವೇದಿಕೆಗಳಲ್ಲಿ</a> ಸಹಾಯವನ್ನು ಪಡೆಯಬಹುದು.','On some systems the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?'=>'‍ಕೆಲವು ವ್ಯವಸ್ಥೆಗಳಲ್ಲಿ ನಿಮ್ಮ ಡೇಟಾಬೇಸ್‍ನ ಹೆಸರು ನಿಮ್ಮ ಬಳಕೆದಾರ ಹೆಸರಿನೊಂದಿಗೆ ಪೂರ್ವಪ್ರತ್ಯಯಗೊಂಡಿದೆ, ಆದ್ದರಿಂದ ಇದು <code>username_%1$s</code> ನಂತೆ ಇರುತ್ತದೆ. ಅದು ಸಮಸ್ಯೆಯಾಗಬಹುದೇ?','Does the user %1$s have permission to use the %2$s database?'=>'%2$s ಡೇಟಾಬೇಸ್ ಬಳಸಲು %1$s ಬಳಕೆದಾರರಿಗೆ ಅನುಮತಿ ಇದೆಯೇ?','Are you sure it exists?'=>'ಇದು ಅಸ್ತಿತ್ವದಲ್ಲಿರುವುದು ನಿಮಗೆ ಖಚಿತವೇ?','The tag cloud will not be displayed since there are no taxonomies that support the tag cloud widget.'=>'ಟ್ಯಾಗ್‍ಕೌಡ್ ವಿಜೆಟ್ ಬೆಂಬಲಿಸುವ ವರ್ಗೀಕರಣ ಇಲ್ಲದಿರುವುದರಿಂದ ಟ್ಯಾಗ್‍ಕ್ಲೌಡ ಅನ್ನು ಪ್ರದರ್ಶಿಸಲಾಗುವುದಿಲ್ಲ.','Nicename may not be longer than 50 characters.'=>'ನಿಕ್ನಮೇಮ್ 50 ಅಕ್ಷರಗಳಿಗಿಂತ ಹೆಚ್ಚು ಇರಬಹುದು.','<strong>Error:</strong> The password you entered for the username %s is incorrect.'=>'<strong>ದೋಷ:</strong> ಬಳಕೆದಾರಹೆಸರು %s ಗಾಗಿ ನೀವು ನಮೂದಿಸಿದ ಪಾಸ್‌ವರ್ಡ್ ತಪ್ಪಾಗಿದೆ.','Categories list'=>'ವರ್ಗಗಳ ಪಟ್ಟಿ','Tags list'=>'ಟ್ಯಾಗ್‌ಗಳ ಪಟ್ಟಿ','Categories list navigation'=>'ವರ್ಗಗಳ ಪಟ್ಟಿ ಸಂಚರಣೆ','Tags list navigation'=>'ಟ್ಯಾಗ್ಗಳು ಪಟ್ಟಿ ಸಂಚರಣೆ','Invalid shortcode name: %1$s. Do not use spaces or reserved characters: %2$s'=>'ಅಮಾನ್ಯವಾದ SHORTCODE ಹೆಸರು: %1$s . ಸ್ಥಳಗಳು ಅಥವಾ ಕಾಯ್ದಿರಿಸಿದ ಅಕ್ಷರಗಳನ್ನು ಬಳಸಬೇಡಿ: %2$s','Invalid shortcode name: Empty name given.'=>'ಅಮಾನ್ಯವಾದ SHORTCODE ಹೆಸರು: ಖಾಲಿ ಹೆಸರು ನೀಡಲಾಗಿದೆ.','%1$s (since %2$s; %3$s)'=>'%1$s (ಇಂದ %2$s; %3$s)','%1$s (since %2$s; no alternative available)'=>'%1$s ( %2$s ರಿಂದ; ಪರ್ಯಾಯವಾಗಿ ಲಭ್ಯವಿಲ್ಲ)','%1$s (since %2$s; use %3$s instead)'=>'%1$s (ಇಂದ %2$s; ಬದಲಿಗೆ %3$s ಬಳಸು)','The specified namespace could not be found.'=>'ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ನೇಮ್ ಸ್ಪೇಸ್ ಕಂಡುಬಂದಿಲ್ಲ.','No route was found matching the URL and request method.'=>'URL ಮತ್ತು ವಿನಂತಿ ವಿಧಾನಕ್ಕೆ ಹೊಂದಿಕೆಯಾಗುವ ಯಾವುದೇ ಮಾರ್ಗ ಕಂಡುಬಂದಿಲ್ಲ','The handler for the route is invalid'=>'ಮಾರ್ಗಕ್ಕಾಗಿ ಹ್ಯಾಂಡ್ಲರ್ ಅಮಾನ್ಯವಾಗಿದೆ','JSONP support is disabled on this site.'=>'ಈ ಸೈಟ್ನಲ್ಲಿ JSONP ಬೆಂಬಲವನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','Invalid parameter(s): %s'=>'ಅಮಾನ್ಯವಾದ ನಿಯತಾಂಕ(ಗಳು): %s','Missing parameter(s): %s'=>'ಕಾಣೆಯಾದ ನಿಯತಾಂಕ(ಗಳು): %s','In %1$s, use the %2$s method, not the %3$s function. See %4$s.'=>'%1$s ನಲ್ಲಿ, %2$s ವಿಧಾನವನ್ನು ಬಳಸಿ, %3$s ಕಾರ್ಯವನಲ್ಲ. %4$s ನೋಡಿ.','Pages list'=>'ಪುಟಗಳ ಪಟ್ಟಿ','Posts list'=>'ಲೇಖನಗಳ ಪಟ್ಟಿ','Pages list navigation'=>'ಪುಟಗಳು ಪಟ್ಟಿ ಸಂಚರಣೆ','Posts list navigation'=>'ಪೋಸ್ಟ್ಗಳ ಪಟ್ಟಿ ಸಂಚರಣೆ','Filter pages list'=>'ಪುಟಗಳ ಪಟ್ಟಿಯನ್ನು ಫಿಲ್ಟರ