ef="%2$s">Log in</a> as &#8220;%3$s&#8221; using your existing password.'=>'%1$s ನಿಮ್ಮ ಹೊಸ ಸೈಟ್ <a href="%2$s">ಲಾಗ್ಇನ್ </a> ಆಗಿ  &#8220;%3$s&#8221; ನಿಮ್ಮಲ್ಲಿರುವ ಗುಪ್ರಪದವನ್ನು ಬಳಸಿ.','Your site at %1$s is active. You may now log in to your site using your chosen username of &#8220;%2$s&#8221;. Please check your email inbox at %3$s for your password and login instructions. If you do not receive an email, please check your junk or spam folder. If you still do not receive an email within an hour, you can <a href="%4$s">reset your password</a>.'=>'ನಿಮ್ಮ ತಾಣ %1$s ನಲ್ಲಿ ಸಕ್ರಿಯವಾಗಿದೆ. ನೀವು ಆಯ್ದುಕೊಂಡಿರುವ %2$s ಬಳಕೆದಾರರ ಹೆಸರನ್ನು ಬಳಸಿಈ ತಾಣಕ್ಕೆ ಲಾಗಿನ್ ಆಗಬಹುದು. ದಯವಿಟ್ಟು ಲಾಗಿನ್ ಮಾಹಿತಿ ಮತ್ತು ಪ್ರವೇಶಪದಕ್ಕಾಗಿ %3$s ನಲ್ಲಿ ಮಿಂಚೆಯನ್ನು ನೋಡಿ. ಮಿಂಚೆ ಇರದಿದ್ದಲ್ಲಿ ಒಮ್ಮೆ ಜಂಕ್ ಅಥವಾ ಸ್ಪಾಮ್ ಫೋಲ್ಡರ್ ಗಳಲ್ಲಿ ನೋಡಿ. ಮುಂದಿನ ಒಂದು ಗಂಟೆಯೊಳಗೆ ಇನ್ನೂ ನಿಮಗೆ ಮಿಂಚೆ ತಲುಪದಿದ್ದಲ್ಲಿ , ನೀವು ಇಲ್ಲಿ <a href="%4$s">ಪ್ರವೇಶಪದವನ್ನು ಬದಲಿಸಿ</a>.','Your account has been activated. You may now <a href="%1$s">log in</a> to the site using your chosen username of &#8220;%2$s&#8221;. Please check your email inbox at %3$s for your password and login instructions. If you do not receive an email, please check your junk or spam folder. If you still do not receive an email within an hour, you can <a href="%4$s">reset your password</a>.'=>'ನಿಮ್ಮ ಖಾತೆ ಸಕ್ರಿಯವಾಗಿದೆ.  &#8220;%2$s&#8221; ದ ಬಳಕೆದಾರರ ಹೆಸರನ್ನು ಬಳಸಿ ನೀವು ಈ ಜಾಲತಾಣಕ್ಕೆ ಈಗ <a href="%1$s">ಲಾಗಿನ್</a> ಆಗಬಹುದು. ಲಾಗಿನ್ ಮಾಹಿತಿ ಮತ್ತು ಪ್ರವೇಶಪದಕ್ಕಾಗಿ %3$s ದಲ್ಲಿ ನಿಮ್ಮ ಮಿಂಚೆಯನ್ನು ನೋಡಿ. ಮಿಂಚೆ ಇರದಿದ್ದಲ್ಲಿ ಒಮ್ಮೆ ಜಂಕ್ ಅಥವಾ ಸ್ಪಾಮ್ ಫೋಲ್ಡರ್ ಗಳಲ್ಲಿ ನೋಡಿ. ಮುಂದಿನ ಒಂದು ಗಂಟೆಯೊಳಗೆ ಇನ್ನೂ ನಿಮಗೆ ಮಿಂಚೆ ತಲುಪದಿದ್ದಲ್ಲಿ , ನೀವು ಇಲ್ಲಿ <a href="%4$s">ಪ್ರವೇಶಪದವನ್ನು ಬದಲಿಸಿ</a>.','One or more database tables are unavailable. The database may need to be <a href="%s">repaired</a>.'=>'ಒಂದು ಅಥವಾ ಅದಕ್ಕೂ ಹೆಚ್ಚಿನ ಸಂಖ್ಯೆಯ ಡೇಟಾಬೇಸ್ ಟೇಬಲ್ ಗಳು ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ. ಡೇಟಾಬೇಸ್ <a href="%s">ರಿಪೇರಿ</a> ಅಗತ್ಯವೆನಿಸುತ್ತದೆ.','You are posting comments too quickly. Slow down.'=>'ನೀವು ಪ್ರತಿಕ್ರಿಯೆಗಳನ್ನು ತುಂಬಾ ಆತುರವಾಗಿ ಬರೆಯುತ್ತಿದ್ದೀರ. ಸ್ವಲ್ಪ ನಿಧಾನಿಸ