%2$s','That site is currently reserved but may be available in a couple days.'=>'ಈ ಜಾಲತಾಣವನ್ನು ಸಧ್ಯಕ್ಕೆ ಕಾದಿರಿಸಲಾಗಿದೆ. ಆದರೆ ಕೆಲವು ದಿನಗಳ ನಂತರ ಅದು ಮತ್ತೆ ದೊರೆಯಬಹುದು.','Sorry, that site is reserved!'=>'ಕ್ಷಮಿಸಿ, ಈ ಜಾಲತಾಣವನ್ನು ಕಾಯ್ದಿರಿಸಲಾಗಿದೆ!','Sorry, that site already exists!'=>'ಕ್ಷಮಿಸಿ, ಈ ತಾಣ ಈಗಾಗಲೇ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ!','Sorry, site names must have letters too!'=>'ಕ್ಷಮಿಸಿ, ತಾಣದ ಹೆಸರು ಅಕ್ಷರಗಳನ್ನು ಒಳಗೊಂಡಿರಬೇಕು!','Sorry, you may not use that site name.'=>'ಕ್ಷಮಿಸಿ, ಈ ಜಾಲತಾಣದ ಹೆಸರನ್ನು ಬಳಸುವಂತಿಲ್ಲ.','This site has been archived or suspended.'=>'ಈ ತಾಣವನ್ನು ಸಂಗ್ರಹಾಗಾರಕ್ಕೆ ಕಳುಹಿಸಲಾಗಿದೆ ಅಥವಾ ತಡೆಹಿಡಿಯಲಾಗಿದೆ.','The site you have requested is not installed properly. Please contact the system administrator.'=>'ನೀವು ಬಯಸುತ್ತಿರುವ ಜಾಲತಾಣ ಸರಿಯಾಗಿ ಸ್ಥಾಪನೆಯಾಗಿಲ್ಲ. ದಯವಿಟ್ಟು ಸಿಸ್ಟಮ್ ನಿರ್ವಹಣೆಗಾರರನ್ನು ಸಂಪರ್ಕಿಸಿ.','The given object ID is not that of a menu item.'=>'ಕೊಟ್ಟಿರುವ object ID ಯು ಮೆನು ಅಂಶದ್ದಾಗಿಲ್ಲ.','The Site address you entered did not appear to be a valid URL. Please enter a valid URL.'=>'ನೀವು ನಮೂದಿಸಿರುವ ಜಾಲತಾಣದ ವಿಳಾಸ ಸಮಂಜಸವಾಗದ URL ಅಲ್ಲ ಎನಿಸುತ್ತಿದೆ. ದಯವಿಟ್ಟು ಸರಿಯಾದ URL ಅನ್ನು ನಮೂದಿಸಿ.','The WordPress address you entered did not appear to be a valid URL. Please enter a valid URL.'=>'ನೀವು ನಮೂದಿಸಿರುವ WordPress  ವಿಳಾಸ ಸಮಂಜಸವಾದ URL ಅಲ್ಲ ಎನಿಸುತ್ತಿದೆ. ದಯವಿಟ್ಟು ಸರಿಯಾದ  URL ಅನ್ನು ನಮೂದಿಸಿ.','The email address entered did not appear to be a valid email address. Please enter a valid email address.'=>'ನಮೂದಿಸಿರುವ ಮಿಂಚೆ ವಿಳಾಸ ಸಮಂಜಸವಾಗಿಲ್ಲ ಎನಿಸುತ್ತಿದೆ. ದಯವಿಟ್ಟು ಸರಿಯಾದ ಮಿಂಚೆ ವಿಳಾಸ ವನ್ನು ನಮೂದಿಸಿ.','A term with the name provided already exists with this parent.'=>'ನಮೂದಿಸಿರುವ ಪದವು ಈಗಾಗಲೇ ಇದರ ಮಾತೃವಿನ ಜೊತೆ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ.','An error occurred adding you to this site. Go to the <a href="%s">homepage</a>.'=>'ನಿಮ್ಮನ್ನು ಈ ಜಾಲತಾಣಕ್ಕೆ ಸೇರಿಸುವಲ್ಲಿ ದೋಷ ಉಂಟಾಗಿದೆ.  <a href="%s">ಮುಖಪುಟ</a>ಕ್ಕೆ ಮರಳಿ.','Your email address will not be published.'=>'ನಿಮ್ಮ ಮಿಂಚೆ ವಿಳಾಸ ಎಲ್ಲೂ ಪ್ರಕಟವಾಗುವುದಿಲ್ಲ.','A valid URL was not provided.'=>'ಸಮಂಜಸವಾದ URL ಅನ್ನು ಒದಗಿಸಿಲ್ಲ.','Could not calculate resized image dimensions'=>'ಮರುಗಾತ್ರಿಸಿದ ಚಿತ್ರದ ಅಳತೆಗಳನ್ನು ಲೆಕ್ಕಹಾಕಲಾಗಲಿಲ್ಲ','Completed <span class="count">(%s)</span>'=>'ಮುಗಿದಿದೆ <span class="count">(%s)</span>' . "\0" . 'ಮುಗಿದಿವೆ <span class="count">(%s)</span>','You are logged in already. No need to register again!'=>'ನೀವು ಈಗಾಗಲೇ ಲಾಗ್ ಇನ್ ಆಗಿದ್ದೀರಿ. ಮತ್ತೊಮ್ಮೆ ನೋಂದಣಿಯಾಗುವ ಅವಶ್ಯಕತೆ ಇಲ್ಲ!','You must first <a href="%s">log in</a>, and then you can create a new site.'=>'ನೀವು ಮೊದಲು <a href="%s">ಲಾಗ್ ಇನ್</a> ಆಗಬೇಕು, ನಂತರ ನೀವು ಹೊಸ ಜಾಲತಾಣವನ್ನು ರಚಿಸಬಹುದು.','Welcome back, %s. By filling out the form below, you can <strong>add another site to your account</strong>. There is no limit to the number of sites you can have, so create to your heart&#8217;s content, but write responsibly!'=>'ಮತ್ತೊಮ್ಮೆ ಸುಸ್ವಾಗತ, %s ಅವರೆ. ಈ ಕೆಳಗಿನ ನಮೂನೆಯನ್ನು ತುಂಬುವುದರ ಮೂಲಕ, ನೀವು <strong>ನಿಮ್ಮ ಖಾತೆಗೆ ಇನ್ನೊಂದು ತಾಣವನ್ನು </strong> ಸೇರಿಸಬಹುದು. ತಾಣಗಳ ಸಂಖ್ಯೆಗೆ ಯಾವುದೇ ಮಿತಿ ಇರುವುದಿಲ್ಲ, ಆದ್ದರಿಂದ ನಿಮ್ಮ ಮನಮೆಚ್ಚಿನ ಸಂಗತಿಗಳನ್ನು ರಚಿಸಿ, ಆದರೆ ಹೊಣೆಯರಿತು ಬರೆಯಿರಿ!','Must be at least 4 characters, letters and numbers only. It cannot be changed, so choose carefully!'=>'ಕನಿಷ್ಟ 4 ಅಕ್ಷರಗಳಿರಬೇಕು, ಅಕ್ಷರ ಮತ್ತು ಅಂಕೆಗಳು ಮಾತ್ರ. ಇದನ್ನು ಬದಲಾಯಿಸಲಾಗುವುದಿಲ್ಲ, ಎಚ್ಚರಿಕೆಯಿಂದ ಆರಿಸಿರಿ!','This action has been disabled by the administrator.'=>'ಈ ಕಾರ್ಯವನ್ನು ನಿರ್ವಾಹಕರು ನಿರ್ಬಂಧಿಸಿಧ್ದಾರೆ.','Page %s'=>'ಪುಟ %s','Briefly unavailable for scheduled maintenance. Check back in a minute.'=>'ನಿಗದಿತ ನಿರ್ವಹಣೆಗಾಗಿ ಸ್ವಲ್ಪ ತಡೆಹಿಡಿಯಲಾಗಿದೆ. ಕೆಲ ಸಮಯದ ನಂತರ ಪ್ರಯತ್ನಿಸಿ.','Maintenance'=>'ನಿರ್ವಹಣೆ','Navigation Menus'=>'ಸಂಚರಣಾ ಆಯ್ಕೆಪಟ್ಟಿಗಳು','Navigation Menu Item'=>'ಸಂಚರಣಾ ಆಯ್ಕೆಪಟ್ಟಿಯ ಅಂಶ','Navigation Menu Items'=>'ಸಂಚರಣಾ ಆಯ್ಕೆಪಟ್ಟಿಯ ಅಂಶಗಳು','Links for %s'=>'%s ಗೆ ಲಿಂಕ್ ಗಳು','No menus have been created yet. <a href="%s">Create some</a>.'=>'ಇನ್ನೂ ಯಾವುದೇ ಮೆನು ರಚನೆಯಾಗಿಲ್ಲ <a href="%s">ಕೆಲವನ್ನು ರಚಿಸಿ</a>.','This is the short link.'=>'ಇದು ಚಿಕ್ಕ ಲಿಂಕ್.','%d Theme Update'=>'%d ಥೀಮ್ ಉನ್ನತೀಕರಣ' . "\0" . '%d ಥೀಮ್ ಉನ್ನತೀಕರಣಗಳು','%d Plugin Update'=>'%d ಪ್ಲಗ್ ಇನ್ ಉನ್ನತೀಕರಣ' . "\0" . '%d ಪ್ಲಗ್ ಇನ್ ಉನ್ನತೀಕರಣಗಳು','%d WordPress Update'=>'%d WordPress ಉನ್ನತೀಕರಣ','Site registration has been disabled.'=>'ಜಾಲತಾಣದ ನೋಂದಣಿಯನ್ನು ನಿರ್ಬಂಧಿಸಲಾಗಿದೆ.','If you do not activate your site within two days, you will have to sign up again.'=>'ನಿಮ್ಮ ಜಾಲತಾಣವನ್ನು ಇನ್ನು ಎರಡು ದಿನದೊಳಗೆ ಸಕ್ರಿಯಗೊಳಿಸದಿದ್ದಲ್ಲಿ, ನೀವು ಮತ್ತೊಮ್ಮೆ ನೋಂದಾಯಿಸಿಕೊಳ್ಳಬೇಕಾಗುತ್ತದೆ.','But, before you can start using your site, <strong>you must activate it</strong>.'=>'ನಿಮ್ಮ ಜಾಲತಾಣ ಬಳಸುವುದಕ್ಕೆ ಆರಂಭಿಸುವ ಮುನ್ನ, <strong>ನೀವು ಅದನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಬೇಕು</strong>.','Congratulations! Your new site, %s, is almost ready.'=>'ಅಭಿನಂದನೆಗಳು! ನಿಮ್ಮ ಹೊಸ ಜಾಲತಾಣ, %s, ಬಹುಪಾಲು ತಯಾರಾಗಿದೆ.','Gimme a site!'=>'ನನಗೊಂದು ಜಾಲತಾಣ ಕೊಡಿ!','The site %s is yours.'=>'ಈ ಜಾಲತಾಣ %s ನಿಮ್ಮದು.','Create Site'=>'ಜಾಲತಾಣವನ್ನು ರಚಿಸಿ','If you are not going to use a great site domain, leave it for a new user. Now have at it!'=>'ನೀವು ಉತ್ತಮ ಸೈಟ್ ಡೊಮೇನ್ ಅನ್ನು ಬಳಸಲು ಹೋಗದಿದ್ದರೆ, ಅದನ್ನು ಹೊಸ ಬಳಕೆದಾರರಿಗೆ ಬಿಡಿ. ಈಗ ಅದನ್ನು ಹೊಂದಿರಿ!','Sites you are already a member of:'=>'ನೀವು ಈಗಾಗಲೇ ಚಂದಾದಾರರಾಗಿರುವ ಜಾಲತಾಣಗಳು:','Get <em>another</em> %s site in seconds'=>'<em>ಇನ್ನೊಂದು</em> %s ತಾಣವನ್ನು ಕ್ಷಣಗಳಲ್ಲಿ ಪಡೆಯಿರಿ.‍‍','Site Title:'=>'ಜಾಲತಾಣದ ಶೀರ್ಷಿಕೆ :','sitename'=>'ಜಾಲತಾಣದ ಹೆಸರು','File canceled.'=>'ಕಡತವನ್ನು ರದ್ದುಪಡಿಸಲಾಗಿದೆ.','A new comment on the post "%s" is waiting for your approval'=>'"%s" ಲೇಖನಕ್ಕೆ ಒಂದು ಹೊಸ ಪ್ರತಿಕ್ರಿಯೆ ನಿಮ್ಮ ಅನುಮೋದನೆಗೆ ಕಾಯುತ್ತಿದೆ.‍‍','A new pingback on the post "%s" is waiting for your approval'=>'ಲೇಖನ "%s" ದ ಮೇಲೆ ಹೊಸ ಮರುಕೋರಿಕೆ (Pingback) ನಿಮ್ಮ ಅನುಮೊದನೆಗಾಗಿ ಕಾಯುತ್ತಿದೆ.','A new trackback on the post "%s" is waiting for your approval'=>'"%s" ಲೇಖನಕ್ಕೆ ಹೊಸ ಮರುಚಾರಣವು (trackback) ನಿಮ್ಮ ಅನುಮೋದನೆಗೆ ಕಾಯುತ್ತಿದೆ.','New pingback on your post "%s"'=>'ನಿಮ್ಮ ಲೇಖನ "%s" ದ ಮೇಲೆ ಹೊಸ ಮರುಕೋರಿಕೆ (Pingback):','New trackback on your post "%s"'=>'ಲೇಖನ : "%s" ಕ್ಕೆ ಹೊಸ ಮರುಚಾರಣ (trackback)','New comment on your post "%s"'=>'ನಿಮ್ಮ ಲೇಖನ "%s" ಕ್ಕೆ ಹೊಸ ಟಿಪ್ಪಣಿ','If your site does not display, please contact the owner of this network.'=>'ನಿಮ್ಮ ಜಾಲತಾಣವು ಪ್ರದರ್ಶಿತವಾಗದಿದ್ದಲ್ಲಿ, ದಯವಿಟ್ಟು ಈ ನೆಟ್ ವರ್ಕಿನ ಮಾಲೀಕರನ್ನು ಸಂಪರ್ಕಿಸಿ.','Select Menu:'=>'ಮೆನು ಆಯ್ಕೆ ಮಾಡಿ:','Navigation Menu'=>'ಸಂಚರಣಾ ಮೆನು','Taxonomy:'=>'ವರ್ಗೀಕರಣ:','Search results for: "%s"'=>'"%s" ಗೆ ಶೋಧನೆಯ ಫಲಿತಾಂಶಗಳು','One response to %s'=>'%s ಗೆ ಒಂದು ಪ್ರತಿಕ್ರಿಯೆ','Menus'=>'ಮೆನುಗಳು','Your PHP installation appears to be missing the MySQL extension which is required by WordPress.'=>'WordPress ಗೆ ಅಗತ್ಯವಿರುವ MySQL ವಿಸ್ತರಣಿಕೆ (extension) ನಿಮ್ಮ PHP ಸ್ಥಾಪನೆಯಲ್ಲಿ ಕಾಣೆಯಾಗಿರುವಂತಿದೆ.','The specified target URL does not exist.'=>'ನಮೂದಿಸಿರುವ ಗಮ್ಯತಾಣದ URL ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Pingback from %1$s to %2$s registered. Keep the web talking! :-)'=>'%1$s ಇಂದ %2$s ಕ್ಕೆ ಮರುಕೋರಿಕೆ (Pingback) ಯನ್ನು ನೋಂದಾಯಿಸಲಾಗಿದೆ. ಜಾಲಗಳನ್ನು ಸಕ್ರಿಯವಾಗಿಡಿ :-)','The source URL does not contain a link to the target URL, and so cannot be used as a source.'=>'ಮೂಲ URL, ಗಮ್ಯತಾಣದ URL ಅನ್ನು ಒಳಗೊಂಡಿಲ್ಲ, ಆದುದರಿಂದ ಇದನ್ನು ಸಂಪನ್ಮೂಲದಂತೆ ಉಪಯೋಗಿಸುವಂತಿಲ್ಲ. ','The source URL does not exist.'=>'ಮೂಲ URL ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','The pingback has already been registered.'=>'ಈ ಮರುಕೋರಿಕೆ (Pingback) ಯನ್ನು ಈಗಾಗಲೇ ನೋಂದಾಯಿಸಲಾಗಿದೆ.','The source URL and the target URL cannot both point to the same resource.'=>'ಮೂಲ URL ಮತ್ತು ಗಮ್ಯತಾಣದ URL ಗಳೆರಡನ್ನೂ ಒಂದೇ ಸಂಪನ್ಮೂಲಕ್ಕೆ ಹೊಂದಿಸುವಂತಿಲ್ಲ.','The specified target URL cannot be used as a target. It either does not exist, or it is not a pingback-enabled resource.'=>'ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ಗುರಿ URL ಅನ್ನು ಗುರಿಯಾಗಿ ಬಳಸಲಾಗುವುದಿಲ್ಲ. ಇದು ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ, ಅಥವಾ ಇದು ಪಿಂಗ್‌ಬ್ಯಾಕ್-ಸಕ್ರಿಯಗೊಳಿಸಿದ ಸಂಪನ್ಮೂಲವಲ್ಲ.','Is there no link to us?'=>'ನಮಗೆ ಯಾವುದೇ ಲಿಂಕ್ ಇಲ್ಲವೇ?','Could not write file %1$s (%2$s).'=>'%1$s (%2$s) ಕಡತವನ್ನು ಬರೆಯಲು ಆಗಿಲ್ಲ.','Sorry, you are not allowed to change the page author as this user.'=>'ಕ್ಷಮಿಸಿ,, ಈ ಬಳಕೆದಾರರಂತೆ ನಿಮಗೆ ಪುಟದ ಲೇಖಕರನ್ನು ಬದಲಾಯಿಸಲು ಅನುಮತಿ ಇಲ್ಲ. ','Sorry, you are not allowed to change the post author as this user.'=>'ಕ್ಷಮಿಸಿ,, ಈ ಬಳಕೆದಾರರಂತೆ ನಿಮಗೆ ಲೇಖನದ ಲೇಖಕರನ್ನು ಬದಲಾಯಿಸಲು ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to update posts as this user.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರರಂತೆ ಪೋಸ್ಟ್ಗಳನ್ನು ನವೀಕರಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Invalid post type.'=>'ಅಸಿಂಧು ಲೇಖನ ಬಗೆ.','Sorry, you are not allowed to publish posts in this post type.'=>'ಕ್ಷಮಿಸಿ, ಈ ಲೇಖನ ಪ್ರಕಾರದಲ್ಲಿ ಲೇಖನಗಳನ್ನು ಪ್ರಕಟಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, no such post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಗೆಯ ಲೇಖನ ಇಲ್ಲ.','Sorry, you are not allowed to publish this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಲೇಖನವನ್ನು ಪ್ರಕಟಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Either there are no posts, or something went wrong.'=>'ಬಹುಷಃ ಯಾವುದೇ ಲೇಖನಗಳು ಇಲ್ಲವೆನಿಸುತ್ತದೆ. ಅಥವಾ ಏನಾದರೂ ತೊಂದರೆ ಆಗಿರಬಹುದು.','Sorry, you are not allowed to update options.'=>'ಕ್ಷಮಿಸಿ,, ಆಯ್ಕೆಗಳನ್ನು ಉನ್ನತೀಕರಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to access details of this post.'=>'ಕ್ಷಮಿಸಿ,, ಈ ಲೇಖನದ ವಿವರಗಳನ್ನು ನೋಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','A valid email address is required.'=>'ಸರಿಯಾದ ಮಿಂಚೆ ವಿಳಾಸದ ಅಗತ್ಯವಿದೆ.','Comment author name and email are required.'=>'‍ಪ್ರತಿಕ್ರಿಯಿಸಿದವರ ಹೆಸರು ಮತ್ತು ಮಿಂಚೆ ವಿಳಾಸ ಖಡ್ಡಾಯ.','Invalid post ID.'=>'ಅಸಿಂಧುವಾದ ಲೇಖನದ  ID.','Invalid comment status.'=>'ಅಸಿಂಧುವಾದ ಟಿಪ್ಪಣಿಯ ಸ್ಥಿತಿಗತಿ.','Invalid comment ID.'=>'ಅಸಿಂಧುವಾದ ಟಿಪ್ಪಣಿ  ID.','Failed to delete the page.'=>'ಪುಟವನ್ನು ಅಳಿಸಲುವಲ್ಲಿ ವಿಫಲವಾಗಿದೆ.','Sorry, no such page.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬಗೆಯ ಪುಟಗಳು ಇಲ್ಲ. ','Allow new users to sign up'=>'ಹೊಸ ಬಳಕೆದಾರರಿಗೆ ನೋಂದಾಯಿಸಿಕೊಳ್ಳಲು ಅವಕಾಶ ನೀಡಿ','Time Zone'=>'ಸಮಯ ವಲಯ','Software Version'=>'ಸಾಫ್ಟ್ ವೇರ್ ನ ಆವೃತ್ತಿ','Software Name'=>'ಸಾಫ್ಟ್ ವೇರ್ ನ ಹೆಸರು','User registration has been disabled.'=>'ಬಳಕೆದಾರರ ನೋಂದಾವಣೆಯನ್ನು ಸ್ಠಗಿತಗೊಳಿಸಲಾಗಿದೆ. ','Registration has been disabled.'=>'ನೋಂದಾವಣೆಯನ್ನು ಸ್ಠಗಿತಗೊಳಿಸಲಾಗಿದೆ.','If you have not received your email yet, there are a number of things you can do:'=>'ನಿಮ್ಮ ಇಮೇಲ್ ಅನ್ನು ನೀವು ಇನ್ನೂ ಸ್ವೀಕರಿಸದಿದ್ದರೆ, ನೀವು ಮಾಡಬಹುದಾದ ಹಲವಾರು ವಿಷಯಗಳಿವೆ:','Still waiting for your email?'=>'ನಿಮ್ಮ ಮಿಂಚೆಗಾಗಿ ಇನ್ನೂ ಕಾಯುತಿದ್ದೀರಾ?','Sign up'=>'ಸೈನ್ ಅಪ್ ಮಾಡಿ','If you do not activate your username within two days, you will have to sign up again.'=>'ನಿಮ್ಮ ಬಳಕೆದಾರರ ಹೆಸರನ್ನು ಎರಡು ದಿನಗಳಲ್ಲಿ ಸಕ್ರಿಯಗೊಳಿಸಗೊಳಿಸದಿದ್ದಲ್ಲಿ, ನೀವು ಮತ್ತೆ ನೋಂದಾಯಿಸಿಕೊಳ್ಳಬೇಕಾಗುತ್ತದೆ.','But, before you can start using your new username, <strong>you must activate it</strong>.'=>'ಆದರೆ, ನಿಮ್ಮ ಹೊಸ ಬಳಕೆದಾರರ ಹೆಸರನ್ನು ಬಳಸುವ ಮುನ್ನ, <strong>ಅದನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಬೇಕು</strong>.','%s is your new username'=>'%s ಇದು ನಿಮ್ಮ ಹೊಸ ಬಳಕೆದಾರರ ಹೆಸರು','Next'=>'ಮುಂದೆ','Just a username, please.'=>'ದಯವಿಟ್ಟು, ಕೇವಲ ಬಳಕೆದಾರರ ಹೆಸರು ಮಾತ್ರ. ','Get your own %s account in seconds'=>'ನಿಮ್ಮದೇ ಸ್ವಂತ ಖಾತೆ %s ಯನ್ನು ಕ್ಷಣಗಳಲ್ಲಿ ಪಡೆಯಿರಿ.','There was a problem, please correct the form below and try again.'=>'ಇಲ್ಲೊಂದು ದೋಷವಿದೆ, ದಯವಿಟ್ಟು ಕೆಳಗಿನ ನಮೂನೆಯನ್ನು ಸರಿಪಡಿಸಿ ಮತ್ತು ನಂತರ ಪ್ರಯತ್ನಿಸಿ.','Email&nbsp;Address:'=>'ಮಿಂಚೆ&nbsp;ವಿಳಾಸ:','(Must be at least 4 characters, lowercase letters and numbers only.)'=>'(ಕನಿಷ್ಠ 4 ಅಕ್ಷರಗಳು, ಸಣ್ಣ ಅಕ್ಷರಗಳು ಮತ್ತು ಸಂಖ್ಯೆಗಳು ಮಾತ್ರ ಇರಬೇಕು.)','Privacy:'=>'ಗೋಪ್ಯತೆ :','Oops: %s'=>'ಅಯ್ಯೋ: %s','There does not seem to be any new mail.'=>'ಯಾವುದೇ ಹೊಸ ಮೇಲ್ ಇದ್ದಂತೆ ತೋರುತ್ತಿಲ್ಲ.','Slow down cowboy, no need to check for new mails so often!'=>'ಸಾವಧಾನ ಮಹನೀಯರೆ, ಹೊಸ ಮಿಂಚೆಗಳಿಗಾಗಿ ಇಷ್ಟು ಆತುರ ಬೇಡ!','You are now logged out.'=>'ನೀವು ಈಗ ಲಾಗೌಟ್ ಆಗಿದ್ದೀರಿ. ','You have logged in successfully.'=>'ನೀವು ಯಶಸ್ವಿಯಾಗಿ ಲಾಗಿನ್ ಆಗಿದ್ದೀರಿ.','Lost your password?'=>'ನಿಮ್ಮ ಪ್ರವೇಶಪದ ಕಳೆದಿದೆಯೇ?','Register For This Site'=>'ಈ ಜಾಲತಾಣಕ್ಕೆ ನೋಂದಾಯಿಸಿಕೊಳ್ಳಿ','Registration Form'=>'ನೋಂದಣಿ ನಮೂನೆ','Get New Password'=>'ಹೊಸ ಪ್ರವೇಶಪದ ಪಡೆಯಿರಿ','Lost Password'=>'ಪ್ರವೇಶಪದ ಕಳೆದಿದೆ','<strong>Error:</strong> The email address is not correct.'=>'<strong>ದೋಷ:</strong> ಇಮೇಲ್ ವಿಳಾಸ ಸರಿಯಾಗಿಲ್ಲ.','<strong>Error:</strong> Please type your email address.'=>'<strong>ದೋಷ:</strong> ದಯವಿಟ್ಟು ನಿಮ್ಮ ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ನಮೂದಿಸಿ..','Invalid key.'=>'ಅಸಿಂಧುವಾದ ಕೀಲಿ','[%s] Password Reset'=>'[%s] ಪ್ರವೇಶಪದ ಮರುಹೊಂದಿಸಿ','Password reset is not allowed for this user'=>'ಪ್ರವೇಶಪದ ಮರುಹೊಂದಿಸಲು ಈ ಬಳಕೆದಾರರಿಗೆ ಅನುಮತಿ ಇಲ್ಲ. ','<strong>Error:</strong> Please enter a username or email address.'=>'<strong>ದೋಷ:</strong> ದಯವಿಟ್ಟು ಬಳಕೆದಾರಹೆಸರು ಅಥವಾ ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ನಮೂದಿಸಿ.','Powered by WordPress'=>'ವರ್ಡ್‌ಪ್ರೆಸ್‌ನಿಂದ ಪುಷ್ಟೀಕೃತ.','<strong>Error:</strong> WordPress %1$s requires MySQL %2$s or higher'=>'<strong>ದೋಷ:</strong> ವರ್ಡ್‌ಪ್ರೆಸ್ %1$s ಗೆ MySQL ನ %2$s ಅಥವಾ ಹೆಚ್ಚಿನ ಆವೃತ್ತಿಯ ಅಗತ್ಯವಿದೆ','Sidebar %d'=>'ಸೈಡ್‌ ಬಾರ್ %d','Please log in again.'=>'ದಯವಿಟ್ಟು ಮತ್ತೊಮ್ಮೆ ಲಾಗಿನ್ ಆಗಿ.',