t">(%s)</span>' . "\0" . 'ಪ್ರಕಟಿತ <span class="count">(%s)</span>','Revision'=>'ಪರಿಶೀಲನೆ','%s [Current Revision]'=>'%s [‍ಸಧ್ಯದ ಆವೃತ್ತಿ]‍','%s [Autosave]'=>'%s [Autosave]‍','Home'=>'ಮುಖ ಪುಟ ','Previous page'=>'ಹಿಂದಿನ ಪುಟ ','Next page'=>'ಮುಂದಿನ ಪುಟ','There is no excerpt because this is a protected post.'=>'ಇದು ಸಂರಕ್ಷಿತ ಲೇಖನವಾದ್ದರಿಂದ ಆಯ್ದಭಾಗ ಸಿಗುತ್ತಿಲ್ಲ.','Private: %s'=>'ಖಾಸಗಿ: %s','Protected: %s'=>'ಸಂರಕ್ಷಿತ: %s','[%s] New User Registration'=>'[%s] ಹೊಸ ಬಳಕೆದಾರರ ನೋಂದಣಿ','Username: %s'=>'ಬಳಕೆದಾರರ ಹೆಸರು : %s','[%1$s] Please moderate: "%2$s"'=>'[%1$s] ದಯವಿಟ್ಟು ಪರಿಶೀಲಿಸಿ : "%2$s"','Currently %s comment is waiting for approval. Please visit the moderation panel:'=>'ಸಧ್ಯಕ್ಕೆ %s ಟಿಪ್ಪಣಿ ಅನುಮೋದನೆಗಾಗಿ ಕಾದಿವೆ. ದಯವಿಟ್ಟು ಪರಿಶೀಲನಾ ಪ್ಯಾನೆಲ್ ಗೆ ಭೇಟಿಕೊಡಿ:' . "\0" . 'ಸಧ್ಯಕ್ಕೆ %s ಟಿಪ್ಪಣಿಗಳು ಅನುಮೋದನೆಗಾಗಿ ಕಾದಿವೆ. ದಯವಿಟ್ಟು ಪರಿಶೀಲನಾ ಪ್ಯಾನೆಲ್ ಗೆ ಭೇಟಿಕೊಡಿ:','Approve it: %s'=>'ಇದನ್ನು ಅನುಮೋದಿಸಿ: %s','Pingback excerpt: '=>'ಮರುಕೋರಿಕೆ (Pingback) ಯ ಆಯ್ದಭಾಗ: ','Trackback excerpt: '=>'ಮರುಚಾರಣ (Trackback)ದ ಆಯ್ದಭಾಗ: ','Spam it: %s'=>'ಇದನ್ನು ಸ್ಪಾಮ್ ಎನ್ನಿ: %s','Delete it: %s'=>'ಇದನ್ನು ಅಳಿಸಿ: %s','Trash it: %s'=>'ನಿರುಪಯೋಗಿಯನ್ನಾಗಿ ಮಾಡಿ: %s','[%1$s] Pingback: "%2$s"'=>'[%1$s] ಮರುಕೋರಿಕೆ (Pingback): "%2$s"','[%1$s] Trackback: "%2$s"'=>'[%1$s] ಮರುಚಾರಣ (Trackback): "%2$s"','[%1$s] Comment: "%2$s"'=>'[%1$s] ಟಿಪ್ಪಣಿ: "%2$s"','If you are still stuck with this message, then check that your database contains the following tables:'=>'ಇನ್ನೂ ನೀವು ಈ ಸಂದೇಶದಲ್ಲೇ ಸಿಕ್ಕಿಕೊಂಡಿದ್ದರೆ, ನಿಮ್ಮ ಡೇಟಾಬೇಸ್ ಈ ಕೆಳಗಿನ ಟೇಬಲ್ಗಳನ್ನು ಒಳಗೊಂಡಿದೆಯೇ ಎಂದು ಪರೀಕ್ಷಿಸಿ:','What do I do now?'=>'ನಾನೀಗ ಏನು ಮಾಡಲಿ?','This file is too big. Files must be less than %s KB in size.'=>'ಈ ಕಡತ ತುಂಬಾ ದೊಡ್ಡದಾಗಿದೆ. ಕಡತಗಳು ಗಾತ್ರದಲ್ಲಿ %s KB ಗಿಂತ ಕಡಿಮೆ ಇರಬೇಕು.','Sorry, you have used your space allocation of %s. Please delete some files to upload more files.'=>'ಕ್ಷಮಿಸಿ, ನಿಮ್ಮ ಸ್ಥಳ ಹಂಚಿಕೆಯ %s ಬಳಸಿದ್ದೀರಿ. ಹೆಚ್ಚಿನ ಫೈಲ್‌ಗಳನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ದಯವಿಟ್ಟು ಕೆಲವು ಫೈಲ್‌ಗಳನ್ನು ಅಳಿಸಿ.','New %1$s User: %2$s'=>'ಹೊಸ %1$s  ಬಳಕೆದಾರರು  : %2$s','New User Registration: %s'=>'ಹೊಸ ಬಳಕೆದಾರರ ನೋಂದಣಿ: %s','That username is already activated.'=>'ಈ ಬಳಕೆದಾರರ ಹೆಸರು ಈಗಾಗಲೇ ಸಕ್ರಿಯವಾಗಿದೆ.','Could not create user'=>'ಬಳಕೆದಾರರನ್ನು ರಚಿಸಲಾಗಲಿಲ್ಲ.','Invalid activation key.'=>'ಅಸಿಂಧುವಾದ ಸಕ್ರಿಯೀಕರಣದ ಕೀ','That email address has already been used. Please check your inbox for an activation email. It will become available in a couple of days if you do nothing.'=>'ಈ ಮಿಂಚೆ ವಿಳಾಸ ಈಗಾಗಲೇ ಬಳಕೆಯಾಗಿದೆ. ನಿಮ್ಮ ಇನ್‌ಬಾಕ್ಸ್‌ನ್ನು ಯನ್ನು ಸಕ್ರಿಯಗೊಳಿಸುವ ಮಿಂಚೆಗಾಗಿ ಪರೀಕ್ಷಿಸಿ. ನೀವು ಏನು ಮಾಡದೇ ಇದ್ದರೂ, ಇನ್ನು ಕೆಲವೇ ದಿನಗಳಲ್ಲಿ ಇದು ಲಭ್ಯವಾಗಲಿದೆ. ','That username is currently reserved but may be available in a couple of days.'=>'ಈ ಬಳಕೆದಾರರ ಹೆಸರನ್ನು ಸಧ್ಯಕ್ಕೆ ಕಾಯ್ದಿರಿಸಲಾಗಿದೆ, ಆದರೆ ಇದು ಇನ್ನು ಕೆಲವೇ ದಿನಗಳಲ್ಲಿ ಲಭ್ಯವಾಗಬಹುದು.','Sorry, that email address is already used!'=>'ಕ್ಷಮಿಸಿ, ಮಿಂಚೆ ವಿಳಾಸ ಈಗಾಗಲೇ ಬಳಕೆಯಲ್ಲಿದೆ! ','Sorry, that username already exists!'=>'ಕ್ಷಮಿಸಿ, ಬಳಕೆದಾರರ ಹೆಸರು ಈಗಾಗಲೇ ಬಳಕೆಯಲ್ಲಿದೆ!','Sorry, that email address is not allowed!'=>'ಕ್ಷಮಿಸಿ, ಮಿಂಚೆ ವಿಳಾಸವನ್ನು ಬಳಸಲು ಅವಕಾಶವಿಲ್ಲ.','Sorry, usernames must have letters too!'=>'ಕ್ಷಮಿಸಿ, ಬಳಕೆದಾರರ ಹೆಸರುಗಳು ಅಕ್ಷರಗಳನ್ನೂ ಒಳಗೊಂಡಿರಬೇಕು! ','You cannot use that email address to signup. There are problems with them blocking some emails from WordPress. Please use another email provider.'=>'ಸೈನ್ ಅಪ್ ಮಾಡಲು ನೀವು ಆ ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ಬಳಸಲಾಗುವುದಿಲ್ಲ. WordPress ನಿಂದ ಕೆಲವು ಇಮೇಲ್‌ಗಳನ್ನು ನಿರ್ಬಂಧಿಸುವಲ್ಲಿ ಸಮಸ್ಯೆಗಳಿವೆ. ದಯವಿಟ್ಟು ಇನ್ನೊಂದು ಇಮೇಲ್ ಪೂರೈಕೆದಾರರನ್ನು ಬಳಸಿ.','That user does not exist.'=>'ಈ ಬಳಕೆದಾರರು ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','PM'=>'ಅಪರಾಹ್ನ','AM'=>'ಫೂರ್ವಾಹ್ನ ','pm'=>'ಅಪರಾಹ್ನ','am'=>'ಫೂರ್ವಾಹ್ನ','&laquo; Older Comments'=>'&laquo; ಹಳೆಯ ಟಿಪ್ಪಣಿಗಳು','Newer Comments &raquo;'=>'ಹೊಸ ಟಿಪ್ಪಣಿಗಳು &raquo;','Last Post'=>'ಕೊನೆಯ ಲೇಖನ ','Next Post'=>'ಮುಂದಿನ ಲೇಖನ','Previous Post'=>'ಹಿಂದಿನ ಲೇಖನ','Comments Feed'=>'ಟಿಪ್ಪಣಿಗಳ Feed','Insert Page Break tag'=>'ಪೇಜ್ ಬ್ರೇಕ್ ಟ್ಯಾಗ್ ಅನ್ನು ಸೇರಿಸಿ','Fill Screen'=>'ಪರದೆ ತುಂಬಿಸಿ','Remove link'=>'ಲಿಂಕನ್ನು ತೆಗೆಯಿರಿ','Insert link'=>'ಲಿಂಕನ್ನು ಸೇರಿಸಿ','Check Spelling'=>'ಕಾಗುಣಿತವನ್ನು ಪರೀಕ್ಷಿಸಿ','Select all'=>'ಎಲ್ಲವನ್ನೂ ಆರಿಸಿ','Action'=>'ಕ್ರಿಯೆ','Letter'=>'ಪದ','Link Rel'=>'L